INSERT INTO `artistas` VALUES ('00FQb4jTyendYWaN8pK0wa','Lana Del Rey','Elizabeth Woolridge Grant (born June 21, 1985), known professionally as Lana Del Rey, is an American singer-songwriter. Her music often explores themes of romance and nostalgia, with references to popular culture and mid-20th century Americana. She has received multiple awards, including an MTV Video Music Award, three MTV Europe Music Awards, two Brit Awards, two Billboard Women in Music awards, and a Satellite Award, along with nominations for eleven Grammy Awards and a Golden Globe Award.',1455153557,5019204,'Emile Haynie, Lorde, Melanie Martinez, Marina & the Diamonds, Saint Avangeline'),('00YTqRClk82aMchQQpYMd5','Our Last Night','Our Last Night is a post-hardcore band from Hollis, New Hampshire, United States. The group formed in 2004 and is in recent years known for making post-hardcore and alternative metal cover versions of pop songs.\n\nAlbums:\nBuilding Cities From Scratch (2005)\nThe Ghosts Among Us (2008)\nWe Will All Evolve (2010)\nAge Of Ignorance (2012)\nYounger Dreams (2015)\nLet Light Overcome (2019)\nOvercome The Darkness (2019)\nLet Light Overcome The Darkness (2020)\nLeft Alone (2025)',21791162,571330,'Fame On Fire, Glass Tides, Palisades, The Word Alive, We Came as Romans'),('02rd0anEWfMtF7iMku9uor','Reba McEntire','Reba Nell McEntire (born on March 28, 1955 - Kiowa, Oklahoma, USA) is a Grammy Award-winning singer and one of the best-selling country music performers of all time, known for her pop-tinged ballads that include 24 #1 hits. She has issued 28 studio albums and 13 compilations, with more than 50 million records sold as of 2007.\n\nWith a contract to Mercury Records (1975), McEntire began her professional career singing heavily pop-influenced ballads, a far cry from the neotraditionalist movement she would help lead a few years later.',7584168,504401,'Martina McBride, Wynonna Judd, Trisha Yearwood, Sara Evans, Jo Dee Messina'),('048LktY5zMnakWq7PTtFrz','CKay','Chukwuka Ekweani (born 16 July 1995), better known by his stage name Ckay (SEE-kay), is a Nigerian singer-songwriter and record producer signed to Warner Music South Africa. He was formerly signed to Chocolate City, a member of Warner Music Group independent label services ADA. His international hit single \"Love Nwantiti\", also known as \"Love Nwantiti (Ah Ah Ah)\", was released in 2019 by Chocolate City.',8881148,687257,'Omah Lay, Victony, Fireboy DML, Joeboy, Oxlade'),('04gDigrS5kc9YWfZHwBETP','Maroon 5','Maroon 5 is an American pop rock band that originated in Los Angeles, California, United States. The group was formed in 1994 as Kara\'s Flowers while its members were still in high school and originally consisted of Adam Levine (lead vocals, guitar), Jesse Carmichael (guitar, backing vocals) Mickey Madden (bass guitar) and Ryan Dusick (drums). Kara\'s Flowers signed to Reprise Records and released an album, \"The Fourth World\", in 1997. After a tepid response to the album',268573582,6386298,'OneRepublic, Adam Levine, The Script, Train, DNCE'),('05fG473iIaoy82BF1aGhL8','Slipknot','Slipknot is an American heavy metal band formed in Des Moines, Iowa, in 1995 by percussionist Shawn Crahan, vocalist/percussionist Anders Colsefni, and bassist Paul Gray. Following several lineup changes, the group eventually established a nine-member formation:\n#0 Sid Wilson - turntables;\n#1 Joey Jordison - drums;\n#2 Paul Gray - bass guitar;\n#3 Chris Fehn - percussion;\n#4 Jim Root - guitar;\n#5 Craig \"133\" Jones - samples and keyboard;\n#6 Shawn \"Clown\" Crahan - percussion;',341702734,4062766,'Korn, Stone Sour, System of a Down, Mudvayne, Vended'),('05oH07COxkXKIMt6mIPRee','Brandy','Brandy Rayana Norwood, known professionally by the mononym Brandy, is an American singer, songwriter, record producer, actress and model. She is known for her distinctive sound, characterized by her peculiar timbre, voice-layering, and intricate riffs, which has earned her the title of \"the Vocal Bible\". Her work has earned her numerous awards and accolades, including a Grammy Award and an American Music Award.\n\nBorn in McComb, Mississippi, Norwood was raised in Carson, California, beginning her career as a backing vocalist for teen groups.',27958757,1670995,'Monica, Toni Braxton, Mýa, Aaliyah, Faith Evans'),('07YUOmWljBTXwIseAUd9TW','Sebastian Yatra','Sebastián Obando Giraldo (born 15 October 1994), known professionally as Sebastián Yatra, is a Colombian singer and songwriter. He began as a Latin pop artist and has recorded many ballads, but has released several successful reggaeton singles. Yatra is noted for his romantic lyrics, melding traditional lyricism with modern reggaeton influences. He rose to prominence in Latin America in 2016 when he released the hit \"Traicionera\". He has released',13911547,606943,'Piso 21, Cali & El Dandee, Manuel Turizo, Ela Taubert, Fonseca'),('07YZf4WDAMNwqr4jfgOZ8y','Jason Derulo','Jason Desrouleaux (born September 21, 1989 in Miami, Florida, U.S.A), known more simply as Jason Derülo, is a North American singer-songwriter, dancer, choreographer, producer and actor signed to JR Rotem’s label Beluga Heights. He has been writing hit singles for acts such as Lil Wayne, Pleasure P, Pitbull, Stat Quo, Iyaz and Birdman since 2007, and he released his eponymous self-titled debut album in March 2010. His debut single from the album',6080660,763190,'Taio Cruz, Jay Sean, Iyaz, Usher, Sean Paul'),('0avMDS4HyoCEP6RqZJWpY2','Ethel Cain','Ethel Cain is a musical project of American singer-songwriter, record producer, and model Hayden Silas Anhedönia (born March 24, 1998). This project is noted for lyrics focused on nostalgic and Southern Gothic themes, while the music has been associated with the ambient, indie rock, and contemporary folk genres. \n\nWhile Ethel Cain is her most notable project to-date, Anhedönia has other projects under different monikers, such as ΛTLΛS, Miss Anhedönia, Tommy, White Silas, and אשמדאי.',126450809,1156949,'Nicole Dollanganger, Vyva Melinkolya, Wulven, Midwife, 1017 ALYX 9SM'),('0b1sIQumIAsNbqAoIClSpy','j-hope','j-hope known as Jung Hoseok (Korean/Hangul: 정호석; born February 18, 1994 in Gwangju, South Korea and is commonly referred to by his stage name j-hope, is currently lead dancer, rapper, and producer from the South Korea band member of BTS (Hangul: 방탄소년단)\n\nBefore debuting with BTS, j-hope had been part of a street dance team called NEURON. Then, during Christmas of his first year as a high school student, moved to Seoul alone and took lessons every day at the company.',665839716,948001,'BTS, Jin, Agust D, RM, 조권'),('0b2B3PwcYzQAhuJacmcYgc','The HU','The HU (\"human\" in Mongol) is a Mongolian folk metal band formed in 2016. They use traditional Mongolian instrumentation, including the Morin khuur, Tovshuur and Mongolian throat singing, and call their style of music \"hunnu rock\". The name is inspired by the Hunnu, an ancient Mongol empire, known as Xiongnu in western culture. Some of the band\'s lyrics include old Mongolian war cries and poetry.\nTwo videos on YouTube released in Autumn 2018, \"Yuve Yuve Yu - 28 September\" and \"Wolf Totem - 16 November\"',4750563,275623,'Nine Treasures, Tengger Cavalry, Corvus Corax, Korpiklaani, Turisas'),('0BEI7i5sgUuivcfwXLzFmM','Serj Tankian','Serj Tankian (born August 21, 1967 in Beirut, Lebanon) is an Armenian-American singer. He started as a singer in the alternative metal band System of A Down and after they went on hiatus he continued his career as a solo artist and producer. He is known for his gritty yet wide vocal range. His solo output mixes various styles and genres, including metal, rock and Armenian musical motifs.\n\nAt age five, Serj Tankian moved with his parents to Los Angeles, California.',41209483,1074609,'Daron Malakian and Scars on Broadway, System of a Down, Scars on Broadway, Viza, Stone Sour'),('0blbVefuxOGltDBa00dspv','LiSA','There are at least eight known artists with the name \"Lisa\": two are from Japan, one from Thailand who based in South Korea, one from France, two from Holland, one from USA, and one from Italy. \n\n1) Risa Oribe (織部里沙 Oribe Risa, born June 24, 1987), better known by her stage name LiSA  is a Japanese singer signed to Aniplex under Sony Music Artists. Her stage name is an acronym for \'Love is Same All\', a band she formed in 2008. She is known',117194098,1814186,'Jennie, JISOO, BLACKPINK, Rosé, Meovv'),('0BvkDsjIUla7X0k6CSWh1I','Luke Bryan','Luke Bryan is a country singer, songwriter, and television personality. He is one of the world\'s best-selling music artists, with over 75 million records sold. His first ten albums – I\'ll Stay Me (2007), Doin\' My Thing (2009), Tailgates & Tanlines (2011), Crash My Party (2013), Spring Break...Here to Party (2013), Spring Break...Checkin\' Out (2015), Kill the Lights (2015), Farm Tour... Here\'s to the Farmer (2016), What Makes You Country (2017), and Born Here Live Here Die Here (2020) – have included 30 #1 hits.',24694251,1094924,'Jason Aldean, Florida Georgia Line, Dierks Bentley, Lee Brice, Cole Swindell'),('0C8ZW7ezQVs4URX5aX7Kqx','Selena Gomez','Selena Marie Gomez (born July 22, 1992 in Grand Prairie, TX) is an American singer, actress and film producer. Gomez began her acting career on the children\'s television series Barney & Friends (2002–2004). As a teenager, she rose to prominence for starring as Alex Russo on the Disney Channel television series Wizards of Waverly Place (2007–2012). Alongside her television career, Gomez appeared in the films Another Cinderella Story (2008), Princess Protection Program (2009)',194258842,3024269,'Selena Gomez & the Scene, Miley Cyrus, Camila Cabello, Bridgit Mendler, Selena Gomez & Marshmello'),('0cGUm45nv7Z6M6qdXYQGTX','Kehlani','Kehlani Ashley Parrish (born April 24, 1995), known professionally as Kehlani, is an American singer and songwriter. Kehlani is originally from Oakland, California where they achieved initial fame as a member of the teen pop group, Poplyfe, which was a finalist on America\'s Got Talent. Kehlani released their first mixtape Cloud 19, in 2014; followed by their sophomore mixtape You Should Be Here the next year. Their debut album SweetSexySavage was released in January 2017 to mainly positive reception',61899911,1542194,'Kiana Ledé, Summer Walker, Victoria Monét, Ella Mai, kwn'),('0ChjBYedhZTQnWZWQYg15U','Bryan Martin','Bryan Martin is an American country singer-songwriter from Louisiana. The self-taught musician comes from a blue-collar, working-class background and worked in the oil fields before pursuing a career in music. Discovered on social media after his viral hits, Martin has released the albums If It Was Easy in 2019 and Self-Inflicted Scars in 2022. His musical genres include traditional, outlaw, country gospel and Southern rock. Martin has also written songs for artists including Lenny Cooper, Tainted Lyric, Jamie Richards, and Austin Tolliver.',1805956,117751,'Warren Zeiders, Josh Meloy, Bailey Zimmerman, Redferrin, Cody Jinks'),('0CqjTpL2gwBuLAxCoubs53','Flavio Rodriguez','Flavio Rodríguez is Spanish R&B and soul singer.\nHe not only shines for his majestic and inspired interpretation, but also for his varied productions of undoubted quality.\nA native of Barcelona, ​​he has collaborated on a multitude of projects on the Hip Hop and R&B scene in Spain. He stands out in the best-selling song \"A Life Ahead\" by Nach from Alicante, in \"My Days\" by Dlux, in \"Blissful\" by El Disop, to name just a few examples.\nThis is a singer who not only writes his songs but pours his soul into each of them.',27932,647,'D.Valentino, Indigo JAMS, DLux, DOLLAR SELMOUNI, EllegaS'),('0DCw6lHkzh9t7f8Hb4Z0Sx','Arch Enemy','Arch Enemy is a Swedish melodic death metal band, originally a supergroup from Halmstad, formed in 1995. Its members were in bands such as Carcass, Armageddon, Carnage, Mercyful Fate, Spiritual Beggars, The Agonist, Nevermore, and Eucharist. It was founded by Carcass guitarist Michael Amott along with Johan Liiva, who were both originally from the death metal band Carnage. The band has released eleven studio albums, three live albums, three video albums and four EPs.',60811726,900126,'Amon Amarth, The Halo Effect, In Flames, Dark Tranquillity, The Agonist'),('0eI3X5rAzHRZVe5FPk4MN1','Bad Wolves','Bad Wolves is a metal supergroup, composed of lead singer Daniel \"DL\" Laskiewicz (ex-guitarist of The Acacia Strain), guitarists Doc Coyle (ex-God Forbid) and Chris Cain (Bury Your Dead), drummer John Boecklin (ex-Devildriver) , and bassist Kyle Konkiel. \nTheir original lead singer, Tommy Vext, was dismissed from the band in January 2021 on account of his political beliefs and accusations of violence against him. Their debut album \"Disobey\" was released on May 11',6474836,355389,'Through Fire, Five Finger Death Punch, Silent Theory, Gemini Syndrome, Tommy Vext'),('0elWFr7TW8piilVRYJUe4P','Natanael Cano','From Hermosillo, Sonora. singer-songwriter-producer Natanael Cano know as the pioneer of the highly popular \'\'Corridos Tumbados\'\' genre has influences from Ariel Camacho.\nCano reached new heights in 2019 when he collaborated with global Latin superstar Bad Bunny on the 4x latin multi-platinum single \'\'Soy El Diablo (Remix)\'\'. \nIn 2020, he became the first Mexican artist to be featured on Apple Music’s ‘Up Next’ series.\nHis album \'\'Natakong\'\' appeared on Rolling Stone\'s \'\'The 50 Best Spanish-language Albums of 2022\'\' list.',31598708,338801,'Junior H, Peso Pluma, Fuerza Regida, Gabito Ballesteros, Herencia de Patrones'),('0EmeFodog0BfCgMzAIvKQp','Shakira','Shakira Isabel Mebarak Ripoll is a Colombian singer. Born and raised in Barranquilla, She made her recording debut with Sony Music Colombia at the age of 13. Following the commercial failure of her first two albums, Magia (1991) and Peligro (1993), she rose to prominence in Hispanic countries with her next albums, Pies Descalzos (1995) and Dónde Están los Ladrones? (1998). She entered the English-language market with her fifth album, Laundry Service (2001), which sold over 13 million copies worldwide.',168894003,4650484,'Paulina Rubio, Thalía, Belinda, Gloria Trevi, Julieta Venegas'),('0epOFNiUfyON9EYx7Tpr6V','The Strokes','The Strokes is an American indie rock band, known for their distinctive sound and cultural impact, particularly in the early 2000s.\n\nMembers\nJulian Casablancas (vocals), Nick Valensi (guitar), Albert Hammond Jr. (guitar), Nikolai Fraiture (bass), and Fabrizio Moretti (drums)\n\nFormation\nThe founding process of The Strokes was a serendipitous convergence of childhood connections and a shared musical vision. Julian Casablancas, Fabrizio Moretti, and Nick Valensi, childhood friends with varying musical experiences, came together in the late \'90s.',453503430,5525220,'Julian Casablancas, Albert Hammond, Jr., Arctic Monkeys, Interpol, The Last Shadow Puppets'),('0EyZDKtc41e4A3a3v69MxD','Muscadine Bloodline','There’s a new force making major waves in country music, Muscadine Bloodline. Proud natives of Mobile Alabama, Gary Stanton and Charlie Muncaster started Muscadine Bloodline in early 2016. From the first time they took stage, Nashville started talking... so now, with two Billboard charting critically acclaimed EP’s under their belt, it’s no surprise the rest of the music world is quickly catching on. The duo’s reputation for high-energy live experiences has resulted in a schedule full of shows spanning from coast to coast.',2227271,96364,'Flatland Cavalry, Cody Johnson, Koe Wetzel, Parker McCollum, Wyatt Flores'),('0f2YkMXwFNJNSX7MymevKE','Kaash Paige','D\'Kyla Paige Woolen is an American singer and songwriter, better known by her stage name Kaash Paige. She\'s mentioned that Kaash means \"Kill All Arrogance Stop Hatred\". Born on January 8, 2001, in Grand Prairie, Ellis County, Texas, United States, Kaash Paige kicked things off with “Mindset of a Playa”, “Geeked Gab”, “Depression” and “Sobriety ++” featuring Lord in 2018. Kaash Paige’s career skyrocketed with the release of her single \"Love Songs\", which spread through the internet and the entertainment app TikTok.',8088936,603103,'Summer Walker, Jhené Aiko, Ambré, Jacquees, Kehlani'),('0fiWOxhsBsQQvFDtxUQWo0','Brett Young','Brett Charles Young (born March 23, 1981 Anaheim, Orange County, California) is an American pop singer and songwriter. He was a baseball pitcher at his school but took the composition after being injured, his debut EP entitled, produced by Dann Huff, was released by Republic Nashville on February 12, 2016. The main single, Sleep Without You , was released on April 11. Look at a pitcher on the mound, on any team, from a nine-year-old boy in the Babe Ruth league to a million-dollar ace in the big leagues.',3738122,190836,'Thomas Rhett, Jordan Davis, Lee Brice, Dan + Shay, Chris Lane'),('0GDGKpJFhVpcjIGF8N6Ewt','Gojira','There are multiple artists called Gojira;\n\n1) Gojira is a metal band from Bayonne, France. Their lyrics focus on life, ecology, and spiritual themes. They were formed in 1996 by brothers Joe Duplantier (vocals and lead guitar) and Mario Duplantier (drums), Christian Andreu (guitar) and Alexandre Cornillon (bass guitar). Cornillon left the band in 2001 and Jean-Michel Labadie became their bass player. Genres that they have been associated with over their career include death metal, progressive metal, thrash metal and groove metal.',79872916,972380,'Meshuggah, Mastodon, Opeth, Lamb of God, Death'),('0ghlgldX5Dd6720Q3qFyQB','TOMORROW X TOGETHER','TOMORROW X TOGETHER (pronounced \"tomorrow by together\", Hangul: 투모로우바이투게더), also known as TXT, are a South Korean boy group formed by BigHit Entertainment in 2019. The group is composed of 5 members (in order of reveal): Yeonjun, Soobin, Beomgyu, Taehyun, and Hueningkai. Their fandom name is [ b]MOA (Moments of Alwaysness)  which was announced on August 22, 2019.\n\nThe group debuted on March 4th, 2019, with the extended play The Dream Chapter: STAR (꿈의 장: STAR)',402860246,1147077,'YEONJUN, BEOMGYU, TOMORROW X TOGETHER, Jonas Brothers, TOMORROW X TOGETHER, Anitta, BOYNEXTDOOR'),('0H39MdGGX6dbnnQPt6NQkZ','SAINt JHN','In the words of SAINt JHN:\n\n\"Nobody needs to write a bio for me. This is stupid. My name is SAINt JHN, that\'s my real name, it\'s spelled a little different tho. I\'m from Brooklyn, I spent half of my childhood growing up in Georgetown, Guyana. I was dirt poor in Brooklyn and some version of rich in Guyana, because apparently 2 nickles can buy you a sports car in a 3rd world country. Who knew?! I\'m from a SUPER Christian household where my mom forced us to go to every church imaginable, EVERY, SINGLE, WEEK! I hated it.',20689267,943314,'6LACK, Roy Woods, Tyla Yaweh, THEY., Vory'),('0hCNtLu0JehylgoiP8L4Gh','Nicki Minaj','Onika Tanya Maraj-Petty, born December 8th, 1982, is known professionally as Nicki Minaj. Minaj is a Trinidadian-born rapper and singer based in the United States of America. Nicki Minaj is most recognized for her musical versatility, alter egos, and the animated flow of her raps. She first gained underground attention after releasing her debut mixtape, Playtime Is Over. Nicki later released two more mixtapes before her debut album, Sucka Free and Beam Me Up Scotty.',295860229,4591408,'JT, Young Money, London On Da Track, City Girls, Yo Gotti'),('0id62QV2SZZfvBn9xpmuCl','Aloe Blacc','Egbert Nathaniel Dawkins III (born 1979 in Orange County, California), better known by the stage name Aloe Blacc, is an American soul singer, rapper and musician. He began his recording career as an MC back in 1995 when he joined up with hip-hop producer Exile to form the mainstay indie rap group Emanon. Aloe released his debut solo album Shine Through on Stonethrow Records in 2006 and followed this up in 2010 with Good Things. He has also collaborated with the Cradle Orchestra under the name Bee',14344601,1208669,'Mayer Hawthorne, John Legend, Gnarls Barkley, CeeLo Green, Ben l\'Oncle Soul'),('0j49VqyyFRbclqg8Jv3Sdq','Saint Avangeline','Saint Avangeline, a rising star in the indie pop scene, possesses a deep affinity for sapphic poetry. Her forthcoming music delves into her personal journey as a lesbian teenager in the southern regions, exploring the unique experiences of queer individuals as they come of age. Drawing sonic parallels to Lana Del Rey, her lyrical compositions derive inspiration from diverse sources, including her religious upbringing, the enchanting landscapes of Florida',3324520,283988,'Honey Gentry, CEZK, Lana Del Rey, Mercy Necromancy, Solya'),('0Je74SitssvJg1w4Ra2EK7','4 Non Blondes','4 Non Blondes was an early-90s American alternative rock band. Lead vocalist Linda Perry has since released solo work and produced songs on hit albums by P!nk, Lisa Marie Presley and Christina Aguilera. The band consisted of bassist Christa Hillhouse, guitarist Roger Rocha, drummer Dawn Richardson and vocalist Linda Perry. \n\n4 Non Blondes had a huge hit single in 1993 with \"What\'s Up\". A year later, DJ Miko remixed the track as a dance song, and it became a hit again, on radio and in clubs.',10378104,1312561,'Spin Doctors, Meredith Brooks, Linda Perry, Soul Asylum, Joan Osborne'),('0kD8IT1CzF7js2XKM9lLLa','STARSET','Starset is an American alternative rock band formed in 2013 in Columbus, Ohio, by lead vocalist and Downplay former member Dustin Bates\n\nThe current lineup consistst of: Dustin Bates (lead vocals, keyboards, piano, synths and guitars), Ron DeChant (bass, keyboards and backing vocals), Brock Richards (guitars and backing vocals) and Adam Gilbert (drums and percussion).\n\nThey released their debut studio album, Transmissions, in 2014 with the label Razor & Tie, followed by a second studio album, Vessels, in 2017.',25804925,509179,'Downplay, Written by Wolves, Red, Project Vela, Breaking Benjamin'),('0knGpCTbmG4ctl1wzYRZs4','Dijon','Dijon Duenas (simply known as Dijon) is an American alternative/R&B singer-songwriter and producer, also known as the former vocalist of the R&B duo Abhi//Dijon. After the duo released two projects respectively in 2015 and 2016, Dijon began to step into his own in 2017, releasing a string of solo singles, including \"Skin\" and \"Nico\'s Red Truck\". His debut EP Sci Fi 1 was released in 2019 under the Warner-supported label R&R Digital, and was shortly followed by How Do You Feel About Getting Married the following year.',26190443,720729,'Mk.gee, Nourished by Time, Abhi//Dijon, Boylife, Blood Orange'),('0kObWap02DEg9EAJ3PBxzf','Starship','Starship is the name of more than one artist:\n1) An American pop/rock band\n2) Trance act\n3) UK powerpop\n4) Tech house group\n5) 70s rock band with Micky Dolenz\n\nAlso some scrobbles from K-Pop acts managed by the South Korean company Starship Entertainment are being scrobbled under the artist Starship.\n\n1) Starship is an American pop/rock band best known for their hits \"Nothing\'s Gonna Stop Us Now\" and \"We Built This City\" that operated from 1985 to 1989, reforming in 1992 although featuring just vocalist Mickey Thomas.',10229538,1272158,'Mr. Mister, John Waite, Eric Carmen, Survivor, Peter Cetera'),('0L5fC7Ogm2YwgqVCRcF1bT','Volbeat','Volbeat is a heavy metal band from Denmark, founded in 2001. They released their first album, The Strength/the Sound/the Songs, in 2005 and the follow up, Rock the Rebel/Metal the Devil, was released in Denmark on February 19, 2007, and in the rest of Europe on February 26, 2007. In March 2007, it topped the Danish album chart as the best selling album, the first metal album ever to do so.\n\nVolbeat was formed in 2001 after frontman Michael Poulsen split up his former band, Dominus.',55168086,962017,'Five Finger Death Punch, Godsmack, Disturbed, Battle Beast, Dynazty'),('0lVlNsuGaOr9vMHCZIAKMt','Machine Head','Machine Head is an American metal band from Oakland, California. The band was formed in 1991 by vocalist/guitarist Robb Flynn and bassist Adam Duce. The band\'s aggressive musicianship made it one of the pioneering bands in the new wave of American heavy metal, and it is also considered to be part of the second wave of thrash metal bands from the 1990s. Machine Head\'s current lineup comprises Flynn and bassist Jared MacEachern. Duce, guitarists Logan Mader',49851847,1193270,'Chimaira, Lamb of God, Trivium, DevilDriver, Soulfly'),('0NbQe5CNgh4YApOCDuHSjb','The Devil Wears Prada','The Devil Wears Prada is a metalcore band from Dayton, Ohio, formed in 2005. The band members include Mike Hranica (lead vocals, additional guitars), Jeremy DePoyster (rhythm guitar, vocals), Kyle Sipress (lead guitar, backing vocals), Jonathan Gering (keyboards, synthesizers, programming, backing vocals), Giuseppe Capolupo (drums), and Mason Nagy (bass). Former members include James Baney (keyboards, synthesizers, programming), Chris Rubey (lead guitar',50537749,869304,'Fit For A King, Like Moths to Flames, Silent Planet, Currents, Blessthefall'),('0NIIxcxNHmOoyBx03SfTCD','Tinashe','Tinashe Jorgensen Kachingwe (/tiːˈnɑːʃeɪ/ tee-NAH-shay; born February 6, 1993) is an American singer, songwriter, dancer, and actress. Born in Lexington, Kentucky, she moved to Pasadena, California, as a child and began pursuing work in entertainment. Her early roles included a motion-capture performance in the animated film \"The Polar Express\" (2004), Robin Wheeler in the Cartoon Network series \"Out of Jimmy\'s Head\" (2007–2008), and a recurring role on the CBS series \"Two and a Half Men\" (2008–2009).',80463520,1514925,'Normani, Victoria Monét, Kelela, Chlöe, FLO'),('0OgdRTPItr9dw4XYp4JJUx','Fit For A King','Fit For A King is a metalcore band from Dallas, Texas, United States formed in 2007. The band comprises vocalist Ryan Kirby, bassist-vocalist Ryan \"Tuck\" O\'Leary, guitarists Bobby Lynge and Daniel Gailey, and drummer Trent Celaya.\n\nThe band was formed in Dallas, Texas in 2007 by Jared Easterling, Aaron Decur, Justin Juno, Jared McFerron, Alex Danforth and Jed McNeill. The band had performed locally and regionally and released two EPs in their beginning years.',11197310,238152,'Wage War, Kingdom of Giants, Bury Tomorrow, Currents, We Came as Romans'),('0oOet2f43PA68X5RxKobEy','Shreya Ghoshal','Shreya Ghoshal (श्रेया घोषाल) is a 4-time National Film Award and 7-time Filmfare Award-winning Indian playback singer of Bengali origin. She won a national award for her debut song \'bairi piya\' in Devdas and created history worthwhile.\n\nGhoshal grew up in the remote northwestern corner of Rajasthan, in the small township of Rawatbhata near the city of Kota. Her father works in Bhabha Atomic Research Center as an Engineer in',3199764,171077,'Sonu Nigam, Arijit Singh, Sunidhi Chauhan, KK, Pritam'),('0pePYDrJGk8gqMRbXrLJC8','Luis R Conriquez','Luis Roberto Conriquez es un cantante mexicano de Sonora. Después de dejar su trabajo en una gasolinera, se centró en escribir canciones y pronto firmó con el sello independiente Kartel Music en 2018, donde lanzó su primer álbum Mis Inicios. Recibió atención con su sencillo \"El Buho\" en 2019, que fue uno de los sencillos de su disco Corridos Bélicos, que fue lanzado en 2020. Entre ese mismo año y 2022 lanzaría más álbumes y decenas de sencillos.',6459275,170895,'Peso Pluma, Gabito Ballesteros, Fuerza Regida, Tito Double P, Natanael Cano'),('0qu422H5MOoQxGjd4IzHbS','Yves Tumor','Yves Tumor is a moniker of an experimental musician Sean Lee Bowie, born in Miami, Florida and currently based in Turin, Italy.\n\nThey are known for their unique approach to blending different genres together (ambient, art pop, rock, synth-punk, electronic), creating a psychedelic atmosphere with an add-on of various instruments.\nThey have put out music under various pseudonyms, like Teams, bekelé berhanu, rajel ali and  shanti (producer name)\n\nTo date, they have released five studio albums and one compilation album:',45705997,1000326,'Dean Blunt, Bar Italia, Eartheater, Arca, Oneohtrix Point Never'),('0rEuaTPLMhlViNCJrg3NEH','Beast In Black','Beast in Black is a metal band from Helsinki, Finland formed in 2015. Their current line-up consists of founding member Anton Kabanan (guitar), Yannis Papadopoulous (vocals), Kasperi Heikkinen (guitar), Mate Molnar (bass) and Atte Palokangas (drums). The only line-up change the band went through is when original drummer Sami Hänninen left the band in 2017 for medical reasons. The band released one ep (Power of the Beast) and three full length albums (Berserker in 2017, From Hell with Love in 2019 & Dark Connection in 2021).',10212517,191855,'Battle Beast, Brothers of Metal, Dynazty, Bloodbound, Gloryhammer'),('0RqtSIYZmd4fiBKVFqyIqD','Thirty Seconds To Mars','30 Seconds to Mars is an American alternative rock band from Los Angeles, California, formed in 1998. The band consists of brothers Jared Leto (lead vocals, guitar, bass, keyboards) and Shannon Leto (drums, percussion). During the course of its existence, it has undergone various line-up changes with the Leto brothers being the only consistent members.\n\nThe band\'s debut album, 30 Seconds to Mars (2002), was produced by Bob Ezrin and released to positive reviews but only to limited commercial success.',124097805,2290624,'The Rasmus, Dead by Sunrise, Placebo, Hoobastank, 3 Doors Down'),('0spHbv2fw49lDMkbOAdaqX','WWE','World Wrestling Entertainment, LLC. (WWE) is a publicly-traded, privately-controlled integrated media (focusing in television, Internet, and live events) and sports entertainment company dealing primarily in professional wrestling, with major revenue sources also coming from film, music, product licensing, and direct product sales. \n\nThe vast majority of music used at WWE events is written and recorded by artists either working for WWE directly (such as Jimmy Hart',16085915,456115,'All Elite Wrestling, Joe Hendry, WWE & Jim Johnston, Jim Johnston, CFO$'),('0tbeZu9lv8YEKSQ9tZSslu','Amber Mark','Singer-songwriter/Producer Amber Mark\'s multifaceted and sophisticated pop sound is rooted in a wide range of inspirations soaked up from time spent in the U.S., India, Germany, Brazil, and Nepal. She began writing music as a way to work through the 2013 death of her mother and in 2016, while in her early twenties, released her first songs: \"Space,\" \"Monsoon\" (featuring her mother\'s voice), and \"Way Back.\" The debut, supported by DJ Zane Lowe, left the biggest impact.',9005483,497666,'Hope Tala, Nao, Mahalia, Maeta, Ravyn Lenae'),('0Ty63ceoRnnJKVEYP0VQpk','Sting','Gordon Matthew Thomas Sumner CBE (born 2 October 1951), known as Sting, is an English musician and actor. He was the frontman, songwriter and bassist for new wave rock band The Police from 1977 until their breakup in 1986. He launched a solo career in 1985 and has included elements of rock, jazz, reggae, classical, new-age, and worldbeat in his music.\n\nAs a solo musician and a member of The Police, Sting has received 17 Grammy Awards: he won Song of the Year for \"Every Breath You Take\"',61754482,2660517,'The Police, Peter Gabriel, Phil Collins, Simply Red, Dire Straits'),('0u2FHSq3ln94y5Q57xazwf','Keith Urban','Keith Lionel Urban (born 26 October 1967) is a New Zealand-born country music singer, songwriter and guitarist whose commercial success has been mainly in the United States and Australia. Originally the front man for The Ranch, a three-piece group that released one album in 1997 to critical acclaim, Urban disbanded the group to pursue a solo career.  In 2004 his album \"Be Here\" was nominated for best country album at the Grammy Awards and at the Academy of Country Music Awards.',19995464,1092295,'Tim McGraw, Kenny Chesney, Jake Owen, Dierks Bentley, Thomas Rhett'),('0ukgrNYk51TkMQr0f2Br4Q','Maverick Sabre','London born, Irish raised singer songwriter Maverick Sabre is breaking the mould. With his soulful voice and skillful guitar playing, he draws audiences in a leaves them in wonder. Silencing crowds with his lamenting social-political content, this young rising star is generating a lot of interest from press and booking agents alike. Recently tipped by Hot Press as being the Irish newcomer who will give the established artists some serious competition, Maverick was also nominated \'Best Homegrown Act\' in the 2008 Urban Takeover Awards.',5020098,494132,'Two Another, Jordan Mackampa, Ben l\'Oncle Soul, Jordan Rakei, Allan Rayman'),('0uTkKGuqdf7CtKlZLt9N0Y','Nevertel','Nevertel was formed in 2013 by Raul Lopez, Jeremy Michael, and Alec Davis. Though the three of them were all in different parts of the country, they all shared the same goal. With Raul in Boston, and Jeremy and Alec in two different locations of Florida, a challenge had presented itself. Together they worked on digitally assembling over 50 songs and they eventually cut it down to the 10 songs on Living Fiction.\n\nLater that year Raul returned to Florida',2317243,94215,'ALESTI, From Ashes to New, Normandie, Line So Thin, Zero 9:36'),('0UWZUmn7sybxMCqrw9tGa7','Juanes','Juan Esteban Aristizábal Vásquez (born August 9, 1972), best known as Juanes, is a rock musician from Medellín, Colombia. When he was younger, his father started calling him Juanes, rather than Juan, a contraction of his two first names Juan and Esteban. As his friends grew to know him by this name, he chose to keep it for his musical career, which started when he, Andrés García, Fernando \"Toby\" Tobón and José David Lopera, formed the rock band Ekhymosis in 1988.',20716848,1162782,'Bacilos, Maná, Carlos Vives, Fonseca, Diego Torres'),('0v2e0oznnTaIXKLGKHphfX','Polaris','There are numerous bands named Polaris.\n1. An alt metal/djent band from Australia\n2. An indie pop/rock band from the United States\n3. A punk band from England\n4. A rock band from Japan\n5. A DJ and producer from France\n6. An electronic project from Poland\n7. a post-hardcore band from the United Kingdom\n8. an alternative rock band from Argentina\n9. A power metal band from France\n10. A techno band from Spain\n11. A project of musician Neil Sutherland',18839867,467484,'Currents, Invent Animate, Alpha Wolf, ERRA, Silent Planet'),('0VpsiJTEi0fQsp0SEekO2K','Celtian','Celtian is a folk metal band from Spain founded in 2017 by the flautist Diego Palacio, and led on vocals by the singer Xana Lavey. Their sound is strongly inspired by bands that mix Heavy metal with folk music European as Wizard of Oz, Saurom, , among others. Eluveitie\n\nCeltian\nCountry of origin:  Spain - Alcalá de Henares, Community of Madrid\nFormed in:  2017\nGenre:  Symphonic Folk Metal\nCurrent label: Maldito Records\n\nCompilation appearance(s):',240190,8430,'Saurom, Warcry, Mägo de Oz, Saratoga, Tierra Santa'),('0vR2qb8m9WHeZ5ByCbimq2','Reik','Reik is a Mexican band from Mexicali, Baja California, Mexico. Formed by Jesús Alberto Navarro Rosas (Lead Vocals), Julio Ramírez Eguía (Guitar, Backing Vocals), and Gilberto Marín Espinoza \"Bibi\" (Backing Guitar, Backing Vocals).\n\nIn 2003, Jesús Navarro and Julio Ramirez started their then-nascent musical project, tentatively called \"Reik\". It was then they recorded their first demos, which were released through the Mexican underground club scene.',13461744,595199,'Camila, Sin Bandera, Jesse & Joy, Río Roma, Ha*Ash'),('0vYQRW5LIDeYQOccTviQNX','Kris Kristofferson','Kristoffer Kristofferson (June 22, 1936 – September 28, 2024) was an American country singer, songwriter and actor. Among his songwriting credits are \"Me and Bobby McGee\", \"For the Good Times\", \"Sunday Mornin\' Comin\' Down\", and \"Help Me Make It Through the Night\", all of which were hits for other artists.\n\nIn 1985, Kristofferson joined fellow country artists Waylon Jennings, Willie Nelson and Johnny Cash in forming the country music supergroup The Highwaymen',4847706,438434,'Waylon Jennings, Willie Nelson, The Highwaymen, Guy Clark, Merle Haggard'),('0WPCPYm5IDNtQjuJOGNPcy','Brothers of Metal','Brothers of Metal is a Swedish power metal band formed in 2012 from Falun. Their first album Prophecy of Ragnarök was released in November 2017. The band consists of three vocalists (two male, one female), three guitar players, a bass player, and a drummer. The band\'s visual style and lyrics are inspired by Vikings and Norse mythology, and are often purposefully over-the-top, which earns them both criticism and praise.\n\nBrothers of Metal formed in 2012 with a vision to create \"true metal',5231372,136018,'Beast in Black, Bloodbound, Orden Ogan, Gloryhammer, Battle Beast'),('0X2BH1fck6amBIoJhDVmmJ','Ellie Goulding','Ellie Goulding (born Elena Jane Goulding, 30 December 1986 in Hereford, England) is an English singer-songwriter. Having caught the public\'s attention in 2010 with her singles \"Starry Eyed\" and \"Guns and Horses,\" British vocalist Ellie Goulding quickly rose to the top of the charts with her infectious electronic pop sound. Although she started out writing songs in a folk-inflected style, she eventually grew into a more electronic-influenced artist, touching upon dance music and ambient synth pop.',145732107,3744604,'Foxes, Tove Lo, Bebe Rexha, Rita Ora, Pixie Lott'),('0x7qiZJaal6j8qS7yCydFk','Savage Ga$p','Gaspare Magaddino (December 29, 1998), better know by his stage name Savage Ga$p, is an American artist. Gasp is best known for song Pumpkins Scream In the Dead of Night featuring artist shinigami.',6543181,277593,'buffalo_farm, Original God, Ronen, I\'m Geist, Powfu'),('0Xf8oDAJYd2D0k3NLI19OV','CHIC','Chic (sometimes fully capitalized as CHIC) are an American disco and funk band that was formed in 1976 by guitarist Nile Rodgers and bassist Bernard Edwards in New York City, USA. It is best-known for its commercially successful disco songs, including \"Dance, Dance, Dance (Yowsah, Yowsah, Yowsah)\" (1977), \"Everybody Dance\" (1977), \"Le Freak\" (1978), \"I Want Your Love\" (1978), \"Good Times\" (1979), and \"My Forbidden Lover\" (1979).\n\nThere can be little argument that Chic was disco\'s greatest band; and',10181887,1129675,'Sister Sledge, Kool & the Gang, Change, KC and The Sunshine Band, Brothers Johnson'),('0XKOBt59crntr7HQXXO8Yz','Brooks & Dunn','Brooks & Dunn are a country singer-songwriter duo, the most successful in the history of the musical genre. Kix Brooks and Ronnie Dunn debuted as Brooks & Dunn in 1991. Known as providing one the defining sounds of modern country, they have since won the Vocal Duo Award of the Country Music Association every year between 1992 and 2005, with the exception of 2000 in which southern rock duo Montgomery Gentry took the honor. Other notable awards include the CMA Album of the Year award for 1994 and the Entertainer of the Year for 1996.',12382080,901314,'Travis Tritt, Alan Jackson, Tracy Byrd, Toby Keith, John Michael Montgomery'),('0xOeVMOz2fVg5BJY3N6akT','Jaden','Jaden Christopher Syre Smith (born July 8, 1998) is an American actor, rapper, singer and songwriter. He is the son of Jada Pinkett Smith and Will Smith. Jaden Smith\'s first movie role was with his father in the 2006 film The Pursuit of Happyness. He also acted in the 2008 remake of The Day the Earth Stood Still and the 2010 remake of The Karate Kid, and was in the 2013 film After Earth with his father.\nSmith released his debut album, Syre in late 2017.',45509212,1121200,'Aminé, Rich Brian, 6LACK, IDK, Jack Harlow'),('0yb46jwm7gqbZXVXZQ8Z1e','Bishop Briggs','Bishop Briggs is English musician and singer-songwriter Sarah Grace McLaughlin (born 18 July 1992), currently based in Los Angeles, California. \n\nBriggs was born in London to Scottish parents from Bishopbriggs, Scotland, which inspired her professional name. At age four, she moved to Tokyo with her parents. She sang in public for the first time at a Tokyo karaoke bar, and immediately realized she wanted to continue performing throughout her life.',8646901,628004,'X Ambassadors, Ruelle, Valerie Broussard, MisterWives, MS MR'),('0YHgnSkV3S5mvSSCTRWDi5','Poor Man\'s Poison','Like any great band, the sound is the clear result of collaboration and compromise. Diverse influences converge into a singular consistent vision. Each component is integral, and each serve the greater whole. The effect is serious but never hopeless, thoughtful but still kinetic, with a bit of anti-authoritarianism inherent to the working class. Really, it’s a bit surprising that music this warm and optimistic was born of a near collapse amongst its creators.',6732823,273013,'Poor Mans Poison, Fish in a Birdcage, Brown Bird, The Devil Makes Three, The Dead South'),('0z4gvV4rjIZ9wHck67ucSV','Akon','Alioune Badara Akon Thiam, born April 16, 1977 in Saint Louis, Missouri, United States, known simply as Akon, is a Senegalese-American singer-songwriter, record producer, businessman, and philanthropist.\n\nHe rose to prominence in 2004 following the release of the singles \"Locked Up\" and \"Lonely\", from his debut album \"Trouble\". His second album, \"Konvicted\", earned him a Grammy Award nomination for the single Smack That featuring Eminem. His latest album, \"Freedom\", was released in 2008.',58243503,3588021,'Sean Kingston, Kardinal Offishall, T-Pain, Ne-Yo, Nelly'),('0Z8XVUAOBPM4x12wKnFHEQ','Parker McCollum','Never Enough, Parker McCollum’s second major-label release, is a statement album. If its predecessor, Gold Chain Cowboy, announced Parker’s arrival in the country music mainstream, Never Enough (MCA Nashville) says that, damn right, he’s here to stay.\n\nLike Gold Chain Cowboy, it pairs Parker with producer Jon Randall (Miranda Lambert, Dierks Bentley), a fellow Texan who understands exactly what fuels Parker’s artistry: authenticity, vulnerability, and a little bit of defiance.',4363722,135679,'Koe Wetzel, Riley Green, Cody Johnson, Flatland Cavalry, Bailey Zimmerman'),('0zfT626RwO6zN3RDYeRit5','Black Label Society','Black Label Society is a heavy metal band formed by former Ozzy Osbourne/Pride & Glory guitar player Zakk Wylde in Los Angeles, California in 1998. They have released ten albums to date, eight of which are studio albums. The band, aside from Wylde consists of bassist John \"JD\" Deservio, drummer Jeff Fabb, and rhythm guitarist Dario Lorina.\n\nThe band is not to be confused with Zakk Wylde\'s solo project (sometimes known as Book of Shadows after its only album) or with Pride & Glory, Wylde\'s southern rock band.',37428992,979503,'Zakk Wylde, Pride & Glory, Down, Pantera, Zakk Sabbath'),('12Zk1DFhCbHY6v3xep2ZjI','070 Shake','Danielle Balbuena, better known by her stage name 070 Shake, is an American singer and rapper from North Bergen, New Jersey. 070 Shake is a part of the musical collective 070, who have released a mixtape together titled The 070 Project: Chapter 1 (2016). Shake released her debut extended play, Glitter, in March 2018.\nWhile Shake and her 070 counterparts – PHI, J Sebastian, Yung Rose and Ether – continue to buzz about their local Jersey hip-hop scene',20444810,724429,'KayCyy, 6LACK, Fousheé, Kid Cudi, Dua Saleh'),('13ZEDW6vyBF12HYcZRr4EV','Tyler Childers','Tyler Childers (born June 21, 1991) is an American singer and songwriter. His music is a mix of country, bluegrass and folk. He released his breakthrough album Purgatory in August 2017. Childers released his third and most recent LP, Country Squire, via his own Hickman Holler Records, under exclusive license to RCA Records in August 2019. \n\nTyler Childers was born and raised in Lawrence County, Kentucky. His father worked in the coal industry and his mother is a nurse.',36025364,556767,'Colter Wall, Turnpike Troubadours, Sturgill Simpson, Zach Bryan, Wyatt Flores'),('159qqlGwzE04xyqpfAwRLo','Parkway Drive','Parkway Drive is a metalcore band from Byron Bay, Australia.\n\nThe band formed in the summer of 2003, their name coming from the street they used to practice on in their home town of Byron Bay, Australia. Not long after they had formed, they released a split EP with Adelaide band I Killed The Prom Queen. Later that year, the band also made an appearance on the Byron Bay Hardcore compilation What We\'ve Built, preceded by their debut EP, Don\'t Close Your Eyes.',68643031,866448,'Bury Tomorrow, The Ghost Inside, As I Lay Dying, Architects, Killswitch Engage'),('19k8AgwwTSxeaxkOuCQEJs','Jelly Roll','Jason Bradley DeFord (born December 4, 1984 in Antioch, TN), known professionally by his stage name Jelly Roll (sometimes written as JellyRoll), is an American rapper known for his collaborations with Lil Wyte, Struggle Jennings, Tech N9ne, Merkules, and Ryan Upchurch.\n\nJason DeFord grew up in Nashville, Tennessee, in the southside community of Antioch.\n\nJelly Roll\'s 2010 collaboration \"Pop Another Pill\" with Memphis rapper Lil Wyte reached over 6.',6376028,305693,'Chase Matthew, Struggle Jennings, Upchurch, Yelawolf, Shaboozey'),('1ADdpen72RPuafRcv0YRBf','Antonio Orozco','Antonio Orozco is a Spanish singer-songwriter from Barcelona, Spain.\nHe has won several prizes like the Premio Onda and sold lots of records, his first album sold more than 100,000 copies, whereas his second album titled Semilla del Silencio sold over 300,000 copies.\nIn 2005 he released a self titled album Antonio Orozco, which was a compilation of his best songs (twelve in total) that eventually propelled him into stardom outside Spain, mainly in Latin America and other parts of the world.',1419202,117643,'Manuel Carrasco, Conchita, El Arrebato, Marta Santos, Melendi'),('1aWJsBQa67l72j1VT3D6Ow','Micro TDH','Fernando Daniel Morillo Rivas, conocido artísticamente como Micro TDH, ​ es un cantante, rapero y trapero venezolano.​ Fue galardonado en los Premios Union Rock Show como «Mejor artista revelación» en 2016.​ Conocido por sencillos como «Cafuné», «Bésame sin sentir», «Aquí estoy», entre otros .​',2678791,118550,'Neutro Shorty, Big Soto, Canserbero, Rawayana, Rels B'),('1b7AEdUSudOQoZF5ebUxCL','HUMBE','Humberto Rodríguez Terrazas (born 11 November 2000), known mononymously as HUMBE, is a Latin Grammy-nominated Mexican singer, mostly known for his songs “Fantasmas”, \"El Poeta\", \"Amor de Cine\" and \"Te Lo Prometo\".\n\nHUMBE was born in Monterrey, Nuevo León, Mexico. He began singing and playing the piano at the age of 9 at his grandmother\'s house in Chihuahua. From that moment on, he expanded his learning to other instruments such as the guitar, drums, and ukulele.',8068661,184479,'Latin mafia, Kenia Os, Danna Paola, Jesse & Joy, Manuel Medrano'),('1CF8aEN939swnuIZGFI7Hk','The Word Alive','The Word Alive is an American melodic metalcore/alternative metal band from Phoenix, Arizona, formed in 2008, the band is currently signed to Fearless Records. Their 2009 label debut, Empire reached position 15 on the Top Heatseekers, meeting a great amount of positive acclaim upon its release in 2009. The following year, the group recorded and released their debut full-length album, Deceiver on August 31, 2010, which reached 97 on the Billboard 200 and 15 on Independent Albums.',14383795,548549,'Palisades, Blessthefall, Memphis May Fire, Secrets, We Came as Romans'),('1cJ5tVoeAEFcZBAwSZ0CtF','The Plot In You','The Plot in You is an American metalcore band formed in 2010 in Hancock County, Ohio. Originally a side project of former Before Their Eyes member Landon Tewers, the group is composed of Tewers, guitarist Josh Childress, bassist Ethan Yoder and drummer Michael Cooper.\n\nThe Plot in You have released three EPs and five studio albums. Their debut EP Wife Beater was released in 2010, followed by their first studio album First Born in 2011, and second studio album Could You Watch Your Children Burn in 2013.',19011390,407040,'Landon Tewers, Bad Omens, Currents, Motionless in White, Thousand Below'),('1CoZyIx7UvdxT5c8UkMzHd','Jorja Smith','Jorja Smith is an English singer from Walsall, UK. Smith impressed many and earned attention with her hip-hop and R&B-inspired debut single \"Blue Lights\" and has taken the rest of the year to deliver songs that fuse soul, blues, and even classical. She spent much of 2016 getting people very excited about her effortless, informed, and deeply soulful pop with a trio of eclectic singles. Her first EP Project 11 arrives so perfectly formed it almost feels like showing off. Many songs mark Smith out as her hero Amy Winehouse’s truest successor.',41532447,1289491,'Mahalia, Pip Millett, Snoh Aalegra, Greentea Peng, Tems'),('1Cs0zKBU1kc0i8ypK3B9ai','David Guetta','Pierre David Guetta is a French DJ and music producer. He has sold over 10 million albums and 65 million singles globally, with more than 14 billion streams. In 2011, 2020, and 2021, Guetta was voted the number one DJ in the DJ Mag Top 100 DJs poll. In 2013, Billboard crowned \"When Love Takes Over\" as the number-one dance-pop collaboration of all time, with singer Kelly Rowland.\n\nHe released his first album, Just a Little More Love, in 2002. Later, he released Guetta Blaster (2004) and Pop Life (2007).',177639916,5007849,'Calvin Harris, Robin Schulz, Jax Jones, R3hab, Ofenbach'),('1dbp04JzZ81JXlMGupCnJ8','Antonio José','There are more than one artist with the name Antonio José:\n1) Antonio José - Spanish singer.\n2) Antonio José - Spanish composer and folklorist.\n\n1. Antonio José Sánchez Mazuecos is a Spanish singer who represented Spain at Junior Eurovision Song Contest 2005, at the age of 11, with the song Te Traigo Flores and placed 2nd.\n\nThe song then became the title of his debut album \"Te Traigo Flores\", which merged flamenco with Latin rhythms.\n\nIn the summer of 2007',512430,40998,'Pablo López, Pablo Alborán, Manuel Carrasco, Dani Fernández, Luis Fonsi'),('1DFr97A9HnbV3SKTJFu62M','Motörhead','Motörhead was an English metal band formed in London in 1975 by bassist and lead vocalist Lemmy Kilmister, guitarist Larry Wallis and drummer Lucas Fox. Lemmy was also the primary songwriter and only constant member. The band are often considered a precursor to the new wave of British heavy metal, which re-energised heavy metal in the late 1970s and early 1980s. Though several guitarists and drummers have played in Motörhead, most of their best-selling',80406373,2100660,'Judas Priest, Saxon, Black Sabbath, Dio, Accept'),('1dID9zgn0OV0Y8ud7Mh2tS','Dustin Lynch','Dustin Lynch is a country singer-songwriter from Tullahoma, Tennessee. He made the 90 mile move to Nashville in 2003 to attend David Lipscomb University, and rented an apartment near the Bluebird Cafe, a popular music venue for songwriters. Lynch regularly attended the Bluebird, gradually began writing and playing shows himself in the Music City as well as the neighboring college circuit. He eventually signed a publishing deal with Super 98/The Song Factory in 2010 and a record deal with Broken Bow Records the following year.',4116942,236179,'Russell Dickerson, Thomas Rhett, Jordan Davis, Jason Aldean, Florida Georgia Line'),('1DTZRmlVZBxx2wRQBtx6yi','Midland','Midland is the name of more than one artist:\n1)  Country music group from Dripping Springs Texas.\n2)  Harry Agius, DJ, Producer and record label owner from London, UK. \n\n1) Midland is a country music group formed in 2014 in Dripping Springs, Texas. They have released three studio albums, On the Rocks, Let It Roll and The Last Resort: Greetings From, which have accounted for seven charted singles on the Billboard country chart: \"Drinkin\' Problem\", Burn Out\", \"Make a Little\", \"Mr.',5591691,313186,'Anthony Naples, Leon Vynehall, Joy Orbison, Lonestar, Jack J'),('1Dvfqq39HxvCJ3GvfeIFuT','Mastodon','Mastodon is an American metal band from Atlanta, Georgia, formed in 2000. The group is composed of Troy Sanders (bass/vocals), Bill Kelliher (rhythm guitar/backing vocals), and Brann Dailor (drums/vocals). The band\'s lead guitarist was Brent Hinds from 1999-2025. Mastodon has released seven studio albums, as well as a number of other releases. The band\'s 2002 debut album, Remission, garnered significant critical acclaim for its unique sound. Mastodon\'s second full-length release',83133062,1223566,'Baroness, Gojira, Opeth, The Ocean, Between the Buried and Me'),('1E2AEtxaFaJtH0lO7kgNKw','Russell Dickerson','Multi-Platinum chart-topper and Triple Tigers entertainer Russell Dickerson is no stranger to the grind. The country headliner first broke through by wearing his heart on his sleeve, launching a string of five deeply romantic #1 hits -- “Yours” (3x Platinum), “Blue Tacoma” (2x Platinum), “Love You Like I Used To” (2x Platinum), “Every Little Thing” (Platinum), and “God Gave Me a Girl.” He followed that success with the slinky, soul-infused “She Likes It” (with Jake Scott',2580647,167661,'Dustin Lynch, Jordan Davis, Thomas Rhett, Dylan Scott, Chris Lane'),('1EowJ1WwkMzkCkRomFhui7','RADWIMPS','Radwimps is a Japanese rock band that formed in their first year of highschool in 2001 in Kanagawa, Japan. They play an eccentric mix of rock, punk, funk and jazz. The band achieved great commercial success in 2006 with their album Radwimps 4: Okazu no Gohan, and are best known for their later singles \"Order Made\" (2008) and \"Dada\" (2011), both of which hit number one on Oricon\'s single charts.\n\nThe five original members had been friends since middle school.',40275897,656317,'米津玄師, BUMP OF CHICKEN, Galileo Galilei, Yorushika, back number'),('1Ffb6ejR6Fe5IamqA5oRUF','Bring Me The Horizon','Bring Me the Horizon is a British metalcore/pop rock/electronic band formed in Sheffield, England, in 2004. The group currently consists of lead vocalist Oli Sykes, drummer Matt Nicholls, guitarist Lee Malia, and bassist Matt Kean. They are signed to RCA Records globally and to Columbia Records in the United States.\n\nThe band released its debut album \"Count Your Blessings\" in 2006. The album featured a deathcore style that received mixed reactions and generally unfavorable reviews from critics.',301367754,2697353,'Bad Omens, The Plot in You, Motionless in White, Asking Alexandria, Architects'),('1GERDglQrxe4ynLzcdG6qP','Evan Honer','Evan Honer was still a college student in Southern California when his music, a blend of acoustic folk, indie Americana, and alternative pop, began to gain a global audience. Just before that, he had been uploading videos to social media to little response. On the day of his graduation, Honer released West On I-10 a debut album that quickly led to collaborations with Liam St. John and Wyatt Flores.',4033090,186076,'Dylan Gossett, Wyatt Flores, Sam Barber, Charles Wesley Godwin, Drayton Farley'),('1HY2Jd0NmPuamShAr6KMms','Lady Gaga','Stefani Joanne Angelina Germanotta, known professionally as Lady Gaga, (born March 28, 1986 in New York, NY) is an American singer, songwriter and actress. She is known for her image reinventions and musical versatility. Gaga began performing as a teenager, singing at open mic nights and acting in school plays. She studied at Collaborative Arts Project 21, through the New York University Tisch School of the Arts, before dropping out to pursue a career in music.',965200306,7440273,'Miley Cyrus, Ke$ha, Madonna, Britney Spears, Marina'),('1hzfo8twXdOegF3xireCYs','Milky Chance','Milky Chance is a German alternative pop folk rock duo with reggae and electronic music influences made up of Clemens Rehbein as vocalist and musician and Philipp Dausch as DJ. Both originating from Kassel, they are signed to Kassel-based label Lichtdicht Records.\n\nThe duo finished their high school education at Jacob-Grimm Schule. Clemens played in a jazz quartet known as Flown Tones where he played bass guitar. Philipp was a DJ. \n\nTheir first single \'Stolen Dance\'  was released in 2012',37489569,1641332,'Henry and the Waiter, Sir Sly, Broken Back, alt-J, AnnenMayKantereit'),('1Ih0fEQQsy9EeAJbYEeQRa','Avantasia','Avantasia is a German supergroup metal opera project created by Tobias Sammet, vocalist of the band Edguy. It has been characterized as a rock opera, as it features the contributions of various vocalists and musicians and it consists of concept albums. Conceived in 1999 as studio-only, two-album project, Avantasia has since released seven other studio albums and has toured the world multiple times. It can be divided into four periods of activity. The first',31373798,477992,'Edguy, Sonata Arctica, Kamelot, Gamma Ray, Freedom Call'),('1jtvmXiemNFkPO11NMdjfu','Nsqk','Nacido en Monterrey, Nuevo León (México) y criado en Houston, Texas (Estados Unidos de América), Rodrigo Torres de la Garza, mejor conocido como NSQK (Nesquick), es un productor y cantante que mezcla notas de los géneros Pop, Rap, R&B, Rock y EDM para crear música con la intención de romper barreras de géneros y temas.\n\nEs co-fundador y miembro del colectivo regiomontano No Pedí Permiso, forma parte del dúo de música pop-urbana Southboys y más recientemente, comienza su carrera solista.',12655056,90106,'AQUIHAYAQUIHAY, Dillom, Young Cister, Cruz Cafuné, Ca7riel & Paco Amoroso'),('1JWMpIl0nhqFJNdO3IOQ20','49 Winchester','Last October, while standing onstage in front of 20,000 people at London’s 02 Arena, it dawned on 49 Winchester lead singer/guitarist Isaac Gibson that on the same day, exactly 10 years ago, he formed the rapidly rising alt-country band.\n\n“There’s been nothing in my life that’s ever lasted a decade,” Gibson says. “We had just gotten out of high school when we played our first show — 10 years later we’re opening for Luke Combs at the O2 Arena.”',1859906,89785,'Turnpike Troubadours, Charles Wesley Godwin, Colby Acuff, Wyatt Flores, Silverada'),('1KCSPY1glIKqW2TotWuXOR','P!nk','Alecia Beth Moore (born September 8, 1979 in Doylestown, PA), known professionally as Pink (stylized as P!nk), is an American singer and songwriter. She was originally a member of the girl group Choice. In 1995, LaFace Records saw potential in Pink and offered her a solo recording contract. Her R&B-influenced debut studio album Can\'t Take Me Home (2000) was certified double-platinum in the United States and spawned two Billboard Hot 100 top-ten songs: \"There You Go\" and \"Most Girls\".',119017351,3644569,'Kelly Clarkson, Avril Lavigne, Jessie J, Christina Aguilera, Anastacia'),('1LU7BxbUvvuA4eNDdEO22D','3AM','3AM es un proyecto 100% independiente que se identifica con los géneros hip-hop romántico, trap y pop, aunque son muy versátiles en cualquier género. Son cantantes y compositores de sus propias canciones y también participaron de la composición de la canción que lanzó el cantante Danny Ocean “volaré”.',4668151,99273,'Danny Ocean, 3AM, Babi, 3AM, Beret, 3AM, Andrea Ferrero, 3AM, KHEA'),('1McMsnEElThX1knmY4oliG','Olivia Rodrigo','Olivia Isabel Rodrigo (born February 20, 2003) is an American singer, songwriter, and actress. She gained recognition with her lead roles on the Disney television programs Bizaardvark and High School Musical: The Musical: The Series. After signing with Geffen and Interscope Records, Rodrigo released her debut single \"drivers license\" in 2021, which broke various records and became one of the best-selling songs of the year, propelling her to mainstream fame. She followed it up with the singles \"deja vu\" and \"good 4 u\".',513819578,2906299,'Taylor Swift, Sabrina Carpenter, Gracie Abrams, Chappell Roan, Conan Gray'),('1mfDfLsMxYcOOZkzBxvSVW','Cole Swindell','Cole Swindell is a country music singer and songwriter. He has written singles for Craig Campbell, Thomas Rhett, Scotty McCreery, and Luke Bryan, and has released four albums for Warner Bros. Records Nashville. He has released 13 singles, eight of which have reached #1 on the Hot Country Songs and/or Country Airplay charts, with three more reaching the Top 10.\n\nHis parents are William Keith Swindell and Betty Carol Rainey. His father died unexpectedly on September 2, 2013, at 65.',4478103,234151,'Lee Brice, Thomas Rhett, Florida Georgia Line, Chris Young, Luke Bryan'),('1mX1TWKpNxDSAH16LgDfiR','Jesse & Joy','Jesse & Joy are a Latin Grammy award winning Mexican pop duo formed in 2005 by siblings Jesse Huerta (born December 31, 1982) and Joy Huerta (born June 20, 1986).\n\nJesse & Joy are two young siblings from Mexico City. They began to show a passion for music from a very young age. In 2001 (when they were 18 and 15 years of age), they began writing lyrics and songs with their father. They were later signed under the Warner label on April 18, 2005.\n\nJesse plays the piano',9198766,391170,'Reik, Ha*Ash, Camila, HA-ASH, Sin Bandera'),('1O4hqQz2nV0jrlF9VEFBNK','Def Con Dos','Def Con Dos or DCD (Spanish for Def Con Two) is a metal rap band from Madrid, Spain.\n\nGreatly influenced by hip hop bands Beastie Boys, Public Enemy, and Run D.M.C., and rock band Siniestro Total, they started rapping over hip hop bases created by producer Julián Hernández (musician and singer of Siniestro Total). In their Segundo Asalto tape (1989), the sound still was basically hip hop, but they started using rock guitars. Since Armas pal pueblo, the sound has been evolving into rap metal, with touches of techno and nu metal.',856612,30075,'Sôber, Narco, Hora Zulu, Riot Propaganda, Habeas Corpus'),('1O8CSXsPwEqxcoBE360PPO','Stratovarius','Stratovarius is a power metal band from Finland. They became more popular in the \'90s, and throughout their career have inspired upcoming power metal bands with their baroque arranged keyboard solos & Ritchie Blackmore-like guitar portions.\n\nStratovarius was founded in Finland in 1984 from former members of the band Black Water. They went through a number of personnel and musical changes before the band found its own voice. In 1984, the name was changed to Stratovarius (a portmanteau of Stratocaster and Stradivarius), an idea of Stråhlman\'s.',30529506,630739,'Sonata Arctica, Edguy, HammerFall, Helloween, Rhapsody'),('1ooV8YZC1KbpEcrmI8WH0F','Yebba','Abigail Elizabeth Smith, (born January 16, 1995) known professionally as Yebba, is an American Grammy-award-winning singer and songwriter from West Memphis, Arkansas. She first became known for her backing vocal performance on Chance the Rapper\'s SNL performance of the song \"Same Drugs\" in 2016 and releasing her debut single \"Evergreen\" in 2017. She has also collaborated with a number of artists, including PJ Morton, Sam Smith, Mark Ronson, Stormzy and Ed Sheeran.',6974074,476641,'Jazmine Sullivan, Cleo Sol, Alex Isley, Emily King, Durand Bernarr'),('1OUDQLymoysITxprkd0Qvj','Coti','1)Coti:\nArgentinian singer & songwriter which has composed many great songs, like \"Color Esperanza\", the song that made Diego Torres a big star.  His 2005 collaboration with Latin singers Paulina Rubio and Julieta Venegas produced the international smash hit \"Nada Fue Un Error\"  (which approximately means \"None of it was a Mistake\").\n\n2)Coti:\nCostantino Luca Rolando Kiriakos, born in Milan, Italy in 1966, moved to Greece at the age of 6, where, since the mid-eighties, better known simply as Coti (or Coti K.',1605960,197594,'Nena Daconte, Bacilos, Diego Torres, Alex Ubago, Amaral'),('1p6CdzJRoicjRcSdWoB9Qc','Mitchell Tenpenny','Mitchell was born and raised in Nashville Tennessee. He grew up around song writers and artist thriving in the Nashville music scene. Having family in the music industry instilled a musical drive to succeed and create music that tells a story and speaks true from the heart. From his soft timbre to his lyrics about life and love, Mitchell is truly one of Nashville\'s own.',2118564,118273,'Jordan Davis, Nate Smith, Sam Hunt, Dylan Scott, Luke Combs'),('1pBLC0qVRTB5zVMuteQ9jJ','Lily-Rose Depp','Lily-Rose Melody Depp is a French-American actress and model. She is the daughter of actor & musician Johnny Depp and model & musician Vanessa Paradis. She debuted her musical career in 2023 with \'The Idol\' soundtrack.',2290565,179810,'Lily Rose Depp, Shy Smith, Madison Beer, Kim Petras, Ashley O'),('1QAJqy2dA3ihHBFIHRphZj','Cigarettes After Sex','Cigarettes After Sex are an American dream pop band, formed in El Paso, Texas, in 2008 by Greg Gonzalez. The band is known for their ethereal, limerent and often dream-like musical style, lyrics often based on the themes of romance and love, as well as Gonzalez\'s voice, which has been described as androgynous. While marketed as an [ambient pop] band, Cigarettes After Sex are also considered to be shoegaze.\n\nThe band\'s debut extended play, I., was released in 2012',275793124,2679206,'Strawberry Guy, Dream, Ivory, Bubble Tea and Cigarettes, Cemeteries, Salvia Palth'),('1Qp56T7n950O3EGMsSl81D','Ghost','1) Ghost, also formerly known as Ghost B.C. in the United States, is a Swedish metal band that was formed in Linköping in 2006. In 2010, they released a three-track demo followed by a 7-inch vinyl titled \"Elizabeth\", and later their debut full-length album Opus Eponymous. The song \"Ritual\" was chosen by Kerrang! as one of \"The 50 Most Evil Songs Ever.\" The Grammis-nominated album was widely praised and significantly increased their popularity. Their second album and major label debut',146303358,1546716,'Volbeat, Ozzy Osbourne, Avenged Sevenfold, Metallica, Lucifer'),('1snhtMLeb2DYoMOcVbb8iB','Kenshi Yonezu','(For information on his work as a vocaloid producer, please see ハチ.)\n\n米津玄師 (Yonezu Kenshi), born on March 10, 1991, is a singer, songwriter & illustrator. He has released vocaloid music under the name ハチ (Hachi) since 2009. His official home page is at Reissue Records.\n\nOn May 16, 2012, he released his debut non-vocaloid album, diorama, using his real name. He was picked up by a major label (Universal Music Japan) about one year later, and released the single, サンタマリア (Santa Maria) on May 29, 2013.',4905272,50278,'King Gnu, Vaundy, Mrs. GREEN APPLE, Official髭男dism, Tatsuya Kitani'),('1Tie3AZgLQZqYEp8Fv4zOZ','Koe Wetzel','Surrounded by flames, amps cranked all the way up, and no fucks given, Koe Wetzel leaves a trail of sold-out venues, screaming fans, and empty booze bottles in his wake wherever he goes. Proudly hailing from northeast Texas, he has quietly asserted himself as the ultimate country rockstar, bulldozing the boundaries between Nashville songcraft, rowdy Texas spirit, and rain-swept Seattle hard rock. After moving 1 million units under the radar and popping off as one of the hottest live performers in the game',5310753,153496,'Treaty Oak Revival, Pecos & the Rooftops, Southall, Parker McCollum, Giovannie and the Hired Guns'),('1TpOqFPZPxxeuLHL3oSl2t','Diggy Graves','Raised in the PNW, 30 year old Diggy Graves likes to describe his music as a melting pot of genres that ranges from rap to horror core. Diggy has been making music for most of his life and decided to create his persona behind the mask in 2020. You might know him from his most popular songs Red Vineyard and Circus Psycho. You can usually find him hidden in the woods making music in his cabin. He always looks forward to performing live and seeing all his loyal fans.',1332079,47015,'$carecrow, Resentvul, Witchouse 40k, Kill Dyll, Grim Salvo'),('1U1el3k54VvEUzo3ybLPlM','Kali Uchis','Karly-Marina Loaiza, professionally known as Kali Uchis, is a Colombian-American singer-songwriter, record producer, music video director and fashion designer. She writes and produces most of her own music.\n\nThe stylistic range of left-field pop artist Kali Uchis is reflected in the variety of her collaborators – an extensive genre-crossing list that includes Tyler, the Creator, Gorillaz, Daniel Caesar, Juanes, and BadBadNotGood. A singer, songwriter',286873390,2876633,'SZA, Doja Cat, Ravyn Lenae, Solange, Amaarae'),('1UM5OPJuE5dGDgyPSNSAqH','Lèpoka','Spanish folk metal band. They sound like Mago de Oz and Korpiklaani. This is the correct spelling of the name.',22505,1700,'Salduie, Debler, Ekyrian, Abäk, HADADANZA'),('1uNFoZAHBGtllmzznpCI3s','Justin Bieber','Justin Drew Bieber (born March 1, 1994 in London, Ontario, Canada) is a Grammy Award winning Canadian pop singer, songwriter, and multi-instrumentalist. Bieber was discovered in 2008 by American talent manager Scooter Braun, who came across Bieber\'s videos on YouTube and later became his manager. Braun arranged for him to meet with entertainer Usher Raymond in Atlanta, Georgia. Bieber was signed to Raymond Braun Media Group (RBMG), and then to an Island Records recording contract offered by record executive L.A. Reid.',286049411,4500118,'Zayn, Shawn Mendes, Givēon, Poo Bear, Ariana Grande'),('1UTPBmNbXNTittyMJrNkvw','Blake Shelton','Blake Tollison Shelton is a country music singer and television personality. Shelton has charted 50 singles, including 30 #1\'s, 17 of which were consecutive. The 11th #1  (\"Doin\' What She Likes\") broke \"the record for the most consecutive #1 singles in the Country Airplay chart\'s 24-year history\". Throughout his career, he has received nine Grammy Award nominations, including two for Best Country Album.\n\nIn 2001, he made his debut with the single \"Austin\".',17294218,1083282,'Dierks Bentley, Luke Bryan, Jason Aldean, Chris Young, Justin Moore'),('1v3tdpIdBSW14rHUfiEVOv','Lauren Alaina','Lauren Alaina (born Lauren Alaina Kristine Suddeth on November 8, 1994) is an American singer, songwriter, and actress from Rossville, Georgia. She was the runner-up on the tenth season of American Idol. Her debut studio album, “Wildflower”, was released on October 11, 2011. Her second album, “Road Less Traveled”, was released January 27, 2017. Alaina later achieved her first No. 1 on the Country Airplay chart with the album\'s title track.',1723004,133809,'Carly Pearce, Maddie & Tae, Danielle Bradbery, Kelsea Ballerini, Carrie Underwood'),('1W3FSF1BLpY3hlVIgvenLz','The-Dream','The-Dream: Terius Youngdell Nash (born June 14, 1978 in Rockingham, North Carolina), better known by his stage name The-Dream, is is a Grammy Award winning American R&B singer-songwriter, producer and Executive Vice President of Island Def Jam Records. In 2007 he released his debut album Love Hate which spawned three top 20 singles. In 2009 he released his second album, Love vs. Money , which reached #2 on the Billboard 200 and features guest appearances from artists such as Kanye West.',10232277,966954,'Trey Songz, J. Holiday, Pretty Ricky, Pleasure P, Avant'),('1WaFQSHVGZQJTbf0BdxdNo','Tommy Richman','Tommy Richman (born March 21, 2000) is an American singer, rapper, and songwriter from Virginia. His first initial placements included working with R&B star Brent Faiyaz before he saw massive viral success on TikTok, particularly with his song \"MILLION DOLLAR BABY\", which reached #2 on the Billboard Hot 100 and top 10 in several countries internationally.',25958026,1413553,'mynameisntjmack, Jordan Ward, 4batz, Rubii, Paco'),('1wKDGglKV4FsFS85r2Dmpr','Airbag','There are  at least 9 bands with the same name:\n\n1. Airbag,  from Norway\n2. Airbag, from Spain\n3. Airbag, from Argentina\n4. Airbag, from South Korea.\n5. Airbag, from Bulgaria\n6. Airbag, from the Netherlands\n7. Airbag, from China\n8. Airbag, from Japan\n9. Airbag, from Czech Republic\n\n1 .Airbag is a five member progressive rock group from Norway. The line up (from 2010) is Anders Hovdan - Bass, Asle Tostrup - Vocals, guitar, Bjørn Riis - Guitar, vocals, Henrik Fossum - Drums and Jørgen Hagen - Keyboards.',7774495,171145,'Bjørn Riis, The Pineapple Thief, RPWL, Gazpacho, Blackfield'),('1wRPtKGflJrBx9BmLsSwlU','Pritam','Pritam Chakraborty (chakravarty) better known as Pritam is a music director and composer from India who is currently based in Mumbai.\n\nEarly life\nPritam was born in Kolkata into a Bengali family. Pritam is the son of Prabodh Chakraborty, who runs a music school for children. Pritam gained his early training in music from his father and learned to play the guitar while still in school.\n\nAfter completing his schooling at St. James\' School and college education at Presidency College, he went to a music school.',25592869,268203,'Vishal-Shekhar, Shankar-Ehsaan-Loy, Sachin-Jigar, Salim–Sulaiman, Atif Aslam'),('1Xfmvd48oOhEWkscWyEbh9','Lloyd','1. Lloyd Polite, Jr. (born January 3, 1986 in New Orleans, Louisiana) is an American R&B singer, rapper, dancer and actor signed to a joint venture between Interscope, Polow da Don\'s label Zone 4 and his own label Young Goldie Music. First discovered at the age of 12 when in the group N-Toon with his brother, he released his debut solo album Southside in 2004. He followed this with 2007\'s Street Love and 2008\'s Lessons in Love. His fourth studio album, King of Hearts, was released July 2011.',16050295,1503489,'Jeremih, Trey Songz, Jacquees, Pretty Ricky, August Alsina'),('1xUhNgw4eJDZfvumIpcz1B','Children Of Bodom','Children of Bodom was a Finnish melodic death metal band from Espoo, formed in 1993 under the name Inearthed. The final lineup before their disbandment in 2019 consisted of vocalist and guitarist Alexi Laiho, drummer Jaska Raatikainen, bassist Henkka Seppälä, keyboardist Janne Wirman, and guitarist Daniel Freyberg. Over the course of their career, the band released ten studio albums, three live albums, two EPs, two compilation albums, and one DVD.',95047449,1231307,'Kalmah, Bodom After Midnight, Norther, Sinergy, Warmen'),('1Xylc3o4UrD53lo9CvFvVg','Zara Larsson','Zara Maria Larsson (born 16 December 1997) is a Swedish singer-songwriter and actress. She gained national recognition in 2008 after winning the second season of Talang, the Swedish adaptation of the Got Talent format. She achieved international success with singles such as \"Lush Life\" (2015), \"Never Forget You\" (2015), \"Girls Like\" (2016) with Tinie Tempah, \"This One\'s for You\" with David Guetta, \"Ain\'t My Fault\" (2016), \"I Would Like\" (2016), \"Symphony\" (2017) with Clean Bandit',59103073,1822212,'Perrie, Ava Max, ADÉLA, Addison Rae, Leigh-Anne'),('1Xyo4u8uXC1ZmMpatF05PJ','The Weeknd','Abel Makkonen Tesfaye, popularly known as The Weeknd (born February 16, 1990 in Toronto, Ontario, Canada), is a Canadian R&B/hip-hop musician, singer-songwriter and record producer. He chose his stage name in tribute to when he was 17 years old, when, along with his friend La Mar Taylor, he dropped out of high school, took his mattress, and \"left one weekend and never came home\". However, his estranged former producer Jeremy Rose claims the name was his idea.',1032780346,5055179,'Tory Lanez, Drake, PARTYNEXTDOOR, Don Toliver, Black Atlass'),('1yxSLGMDHlW21z4YXirZDS','Black Eyed Peas','Black Eyed Peas is an American hip hop/pop group formed in Los Angeles in 1995. The group\'s current line-up consists of will.i.am, Taboo and apl.de.ap. Black Eyed Peas have so-far sold an estimated 56 million albums and singles worldwide.\n\nBlack Eyed Peas went to centenary state high school and got their start in 1988 when will.i.am (born 1975 William James Adams Jr.) and apl.de.ap (born 1974 Allan Pineda) began rapping and performing together around Los Angeles.',142067740,5493491,'Fergie, will.i.am, The Pussycat Dolls, Timbaland, Flo Rida'),('1z7b1Pr1rSlvWRzsW3HOrS','Russ','Russell Vitale (born September 26, 1992), known by his stage name Russ, is an American hip hop recording artist, singer-songwriter and record producer.\n\nThere is also a UK drill artist called Russ. Now known as Russ Millions.',35884883,1177384,'Joyner Lucas, G-Eazy, Phora, mike., 6LACK'),('1ZGTSMjK1D2HrpPTOh916U','Josh Ross','Universal Music Canada/UMG Nashville artist Josh Ross is one of Canada’s most promising singer-songwriter-performers. On an unconventional path of his own design, Ross pairs a dark, mellow blast of modern country rock with a warm vocal rasp, heart-on-his-sleeve writing and addictive hooks that respect no borders – genre or otherwise. Pulling influence everywhere from Guns N’ Roses and Metallica to country-rock outlaw Steve Earle, the former',1003340,77370,'Dylan Scott, Bailey Zimmerman, Tyler Hubbard, Tucker Wetmore, Jordan Davis'),('1ZN1c1qWEGZNX1pGeKCPpf','Billy Strings','Billy Strings (born William Lee Apostol in Lansing, MI, on October 3, 1992) is an American guitarist and bluegrass musician.  He won a Grammy Award in 2021. \n\nA master of the guitar, banjo, and mandolin, Strings is a singer and instrumentalist whose music starts with the sound and speed of bluegrass and folds in elements of rock, jazz, and psychedelia. Strings deals in acoustic music, but his lyrics are rooted in contemporary issues (\"Dust in a Baggie\" sounds like a classic bluegrass breakdown',5097392,172754,'Greensky Bluegrass, Daniel Donato, Kitchen Dwellers, Leftover Salmon, Tony Rice'),('1zuJe6b1roixEKMOtyrEak','Tina Turner','Tina Turner (born Anna Mae Bullock; November 26, 1939 – May 24, 2023) was an American-born Swiss singer, songwriter, and actress. She gained initial recognition as the lead vocalist of the musical duo Ike & Tina Turner, which became known for its energetic live performances and a series of hit songs. The duo disbanded following their divorce in 1976.\n\nFollowing the end of the partnership, Turner launched a solo career and achieved significant commercial success.',21055653,1660134,'Ike & Tina Turner, Whitney Houston, Cher, Diana Ross, Cyndi Lauper'),('20wkVLutqVOYrc0kxFs7rA','Daniel Caesar','Daniel Caesar’s first chapter unfolded in a suburb of Toronto, where he was born to Bajan and Jamaican parents and raised listening to soul and gospel music while singing in front of his father’s church congregation. The singer and songwriter left home at 17 to pursue his calling as a musical artist. Caesar independently released his first two EPs, Praise Break (2014) and Pilgrim’s Paradise (2017), to widespread praise—the first of which landed at #19 on Rolling Stone’s list of “20 Best R&B Albums of 2014.',202496912,2154812,'Brent Faiyaz, Sonder, Bruno Major, Givēon, Arthur Nery'),('21UPYSRWFKwtqvSAnFnSvS','Amaarae','Ama Serwah Genfi (born July 4, 1994), known professionally as Amaarae, is a Ghanaian-American singer, songwriter, producer, and engineer known for her work around representation and gender in music. She is known for her fusion of pop, R&B, Afrobeats, and alté, as well as her fluid representation of gender and sexuality.\n\nAma Serwah Genfi was born in New York and raised between Atlanta and Accra to Ghanaian parents Ama Bawuah and Kwadwo Boateng Genfi.',30555467,938668,'Rochelle Jordan, Erika de Casier, Kelela, Sudan Archives, Tinashe'),('21WS9wngs9AqFckK7yYJPM','PnB Rock','Rakim Hasheem Allen (December 9, 1991 – September 12, 2022), better known by his stage name PnB Rock, was an American rapper and singer from Philadelphia, Pennsylvania.\n\nPnB Rock hails from Pastorius and Baynton Streets in the Germantown section of Philadelphia — that’s where he found the “P” and “B” in his name. That’s also where he found himself in a bit of trouble.\n\nWhen Rock was 13 years old, he got sent away to a youth detention program for fighting in school and committing robberies.',10694659,589773,'A Boogie wit da Hoodie, Lil Durk, J.I the Prince of N.Y, Rod Wave, Toosii'),('23wr9RJZg0PmYvVFyNkQ4j','Gary Moore','Gary Moore (born April 4, 1952 as Robert William Gary Moore in Belfast, Northern Ireland, United Kingdom; died February 6, 2011 in Malaga, Spain) is acknowledged as one of the finest guitarists to have originated in Ireland. He was a virtuoso guitarist and is considered by his fans to be one of the best guitar players ever.\n\nIn a career dating back to the 1960s he has played with bands including Thin Lizzy, Colosseum II, Greg Lake and Skid Row as well as having a successful solo career.',17259599,950105,'Joe Bonamassa, Snowy White, Thin Lizzy, Philip Sayce, The Jeff Healey Band'),('250b0Wlc5Vk0CoUsaCY84M','JENNIE','Jennie Kim (Hangul: 김제니, born January 16, 1996, in Anyang, South Korea), better known as JENNIE (제니), is a South Korean singer-songwriter, rapper, model, designer, and actress under ODDATELIER and Columbia Records. She is a member of the girl group BLACKPINK (Hangul: 블랙핑크), and made her solo debut on November 12, 2018 with the single album \"SOLO\".\n\nBorn and raised in South Korea until 2004, JENNIE later lived in New Zealand before returning to South Korea to successfully audition for YG Entertainment in 2010.',92737444,1342373,'JISOO, Lisa, Rosé, BLACKPINK, Meovv'),('25jJ6vyXwTRa0e6XCcdR6U','Ari Abdul','Ari Abdul (born Arianna Abdul) is a 22 year old singer & songwriter. Ari has forged her own musical brand with the dark alternative pop style.\n\nMostly known for her hit single “BABYDOLL” Ari gained a lot of popularity through TikTok.\nAri and her friends Thomas and Isabel LaRosa write and produce their music together.\n\nAri\'s first EP \"Fallen Angel\" was released in 2022 together with the \"Speed\" version, made up of 17 minutes, 6 songs, including her hit BABYDOLL.',13930253,648564,'Isabel LaRosa, Thomas LaRosa, Dutch Melrose, Ella Boh, Limi'),('25uiPmTg16RbhZWAqwLBy5','Charli xcx','Charlotte Emma Aitchison, known professionally as Charli XCX, is an English singer and songwriter. Born in Cambridge and raised in Start Hill, Essex, she began posting songs on MySpace in 2008, which led to her discovery by a promoter who invited her to perform at warehouse raves and parties. In 2010, she signed a recording contract with Asylum Records, releasing a series of singles and mixtapes throughout 2011 and 2012.\n\nIn 2012, Charli rose to prominence with the Icona Pop collaboration \"I Love It\"',644656692,3548941,'Sophie, Slayyyter, Caroline Polachek, Addison Rae, Sky Ferreira'),('26C2AjqgMr5aDzj6Yp2ORz','Brent Cobb','Brent Cobb (born in Americus, Georgia) is an American country music singer-songwriter.\n\nIf the love of music can follow a bloodline then you could say that writer & recording artist Brent Cobb was born to be a musician. In fact, so many members of Brent’s extended family have musical ability that he can’t really name them all. Music was not only in his blood, it was played and heard in his home as a child and in the homes of most of his relatives throughout his youth.',1851377,177463,'Colter Wall, The SteelDrivers, 49 Winchester, Tyler Childers, Vincent Neil Emerson'),('26dSoYclwsYLMAKD3tpOr4','Britney Spears','Britney Jean Spears  (born December 2, 1981 in McComb, Mississippi) is an American singer, songwriter, dancer and writer. She is credited with influencing the revival of teen pop during the late 1990s and early 2000s, for which she is referred to as the \"Princess of Pop\". Regarded as a pop icon, Spears has sold nearly 150 million records worldwide, including over 70 million solely in the United States, making her one of the world\'s best-selling music artists.',470913410,6188594,'Christina Aguilera, Madonna, Lindsay Lohan, Kylie Minogue, The Pussycat Dolls'),('26opZSJcXshCmCwxgZQmBc','Whiskey Myers','Whiskey Myers is an American southern rock group from Tyler, Texas composed of Cody Cannon, Cody Tate, John Jeffers, Jeff Hogg and Gary Brown. In 2008, they signed with Smith Entertainment and released their debut album, Road of Life. Their second album, Firewater, was released by Wiggy Thump in 2011 and debuted in the Top 30 on the Billboard Top Country Albums chart.\n\nIn a modest rent house in the small East Texas town of Elkhart, Texas, Cody Cannon and Cody Tate began to write music, only dreaming of the success that is sure to follow.',4347781,189719,'Koe Wetzel, Treaty Oak Revival, The Steel Woods, Southall, The Red Clay Strays'),('26T3LtbuGT1Fu9m0eRq5X3','Cage The Elephant','Cage the Elephant is an alternative rock band which formed in 2005 in Bowling Green, Kentucky, United States.\n\nThe band consists of Matt Shultz (vocals), Brad Shultz (guitar), Nick Bockrath (guitar), Daniel Tichenor (bass, vocals), Jared Champion (drums) and Matthan Minster (keyboard, vocals, guitar). \n\nTheir breakthrough single was Ain\'t No Rest For The Wicked, which peaked at #83 on the Billboard Hot 100, #32 on the UK Singles Chart and #3 on the Billboard Alternative Songs chart.',138547962,3256717,'Young the Giant, The Strokes, Portugal. The Man, Arctic Monkeys, The Backseat Lovers'),('26VFTg2z8YR0cCuwLzESi2','Halsey','Ashley Nicolette Frangipane, known professionally as Halsey, is an American singer and songwriter. Her stage name is a reference to the Halsey Street station of the New York City Subway in Brooklyn, and is an anagram of her first name. Her awards and nominations include four Billboard Music Awards, four iHeartRadio Music Awards, two Teen Choice Awards, one GLAAD Media Award, one Global Award, a Guinness World Record, a MTV Video Music Award and a Grammy Award nomination.',208575362,2643041,'Tove Lo, Bea Miller, Hayley Kiyoko, Lorde, Ke$ha'),('278ZYwGhdK6QTzE3MFePnP','Trivium','Trivium is a heavy metal band which formed in Orlando, Florida, United States in 1999. The band currently consists of Matt Heafy (vocals, guitar), Corey Beaulieu (guitar), Paolo Gregoletto (bass) and Alex Bent (drums). Heafy is the band\'s only remaining original member. \n\nTrivium crosses multiple heavy metal genres such as thrash metal, alternative metal, groove metal, and heavy metal. Their style has evolved over the years from their earliest work on Ember to Inferno right through to In Waves.',80747716,1339093,'Bullet for My Valentine, Killswitch Engage, All That Remains, As I Lay Dying, Machine Head'),('28AyklUmMECPwdfo8NEsV0','Jimmy Buffett','Jimmy Buffett (born James William Buffett  in in Pascagoula, Mississippi, on 25 December 1946; died 1  September 2023) was an American singer-songwriter remembered for his \"island escapism\" lifestyle and music including hits such as \"Margaritaville\" (ranked 234th on the Recording Industry Association of America\'s list of \"Songs of the Century\") and \"Come Monday\". His devoted followers are known as \"Parrotheads\", with the youngest members being \"Parakeets\".',12567576,629724,'Kenny Chesney, Jerry Jeff Walker, Robert Earl Keen, James Taylor, John Mellencamp'),('28DdkLhrzQNizZ0ExQpyku','Rizky Febian','Rizky Febian (born Rizky Febian Adriansyah Sutisna; May 2, 1993 in Bandung, Indonesia), is an Indonesian singer-songwriter, actor and TV presenter. He is the eldest son of the Indonesian comedian Sule. \"Kesempurnaan Cinta\" is his first single, under the label of NET Mediatama.\n\nRizky Febrian Adriansah Sutisna is the eldest son of a famous comedian who has a name Indonesia Sule (Original Entis Sutisna) and Lina. His name began to rebound and come to fill in some of the events on screen to entertain the audience.',942526,43771,'Mahalini, Afgan, Tiara Andini, Hivi!, Keisya Levronka'),('28gNT5KBp7IjEOQoevXf9N','Camilo','Camilo Echeverri was the winner of XS Factor 2007 in Colombia. Camilo was born on the 16th March 1994 in Medellin, Colombia, but when he was 4 years old he moved to Monteria.',6954050,347595,'Piso 21, Mike Bahía, Sebastián Yatra, Reik, Fonseca'),('29Wmfm1CojrjQ3aQP0FI65','All Them Witches','All Them Witches is an explosive psychedelic trio from Nashville, Tennessee, USA Employing a heady, D.I.Y. blend of bluesy, neo-psychedelic rock, stoner metal, and progressive space rock, they emerged in 2012. The band\'s name is taken from a book of witchcraft, All of Them Witches, featured in the 1968 film Rosemary\'s Baby.\n\nNick Pipitone of Monster Riff described how the band are \"influenced just as much by Dr. John and Mississippi bluesman Junior',7843951,286199,'King Buffalo, Mars Red Sky, Graveyard, 1000mods, The Heavy Eyes'),('2cWZOOzeOm4WmBJRnD5R7I','Normani','Normani Kordei Hamilton is an American singer and dancer. She auditioned as a solo act for the American television series The X Factor in 2012, after which she became a member of the girl group Fifth Harmony. While in Fifth Harmony, Normani competed in Dancing with the Stars (2017) and released her first song outside of the group \"Love Lies (with Normani)\" (2018), a duet with Khalid which peaked in the top ten in the US and was certified 5x platinum by RIAA.',21621986,758250,'Chlöe, Victoria Monét, FLO, Tinashe, Kehlani'),('2d3VHzlOEwXvmBdS4pzOPL','LeAnn Rimes','Margaret LeAnn Rimes (born August 28, 1982, in Jackson, Mississippi) is a popular American country and pop music singer. \n\nRimes emerged with her first single, \"Blue,\" when she was just thirteen years old in 1996. She is most recognized for her crossover hit \"How Do I Live\" which, according to the Billboard charts, is one of the most successful songs in American music history, spending 69 weeks on the Hot 100 chart, which currently stands as the second longest run in the chart\'s history (behind Jason Mraz\'s \"I\'m Yours\").',10330603,903184,'Faith Hill, Martina McBride, Sara Evans, Shania Twain, Trisha Yearwood'),('2dIgFjalVxs4ThymZ67YCE','Stray Kids','Stray Kids (Korean: 스트레이 키즈; RR: Seuteurei Kijeu; often abbreviated as SKZ) are a South Korean boy band formed by JYP Entertainment through the 2017 reality show of the same name. The group is composed of eight members: Bang Chan, Lee Know, Changbin, Hyunjin, Han, Felix, Seungmin, and I.N. Originally a nine-piece group, member Kim Woojin left due to personal circumstances in October 2019.\n\nStray Kids released their pre-debut extended play Mixtape in January 2018 and officially debuted on March 25 with the EP I am NOT',440440789,1242606,'Seungmin, Xdinary Heroes, Han, Kickflip, ATEEZ'),('2dJyJptNE5bMmbN6z08iNJ','El Arrebato','Javier Labandón, más conocido por su nombre artístico El Arrebato, es un cantautor español de rumba-pop y flamenco.\n\nComenzó su carrera artística sobre 1985 y su carrera discográfica en 1988 sacando su primer disco con el grupo Piel morena en el que le acompañaban 2 grandes amigos de su Sevilla natal . Con ellos cosechó sus primeros éxitos hasta el 8 de septiembre de 1998, cuando Piel Morena se disolvió definitivamente tras varios cambios en la formación.',580143,62863,'El Barrio, Estopa, Antonio Orozco, Melendi, Andy & Lucas'),('2ECP3nWC88LaFz4oQzTo3Z','Café Quijano','Café Quijano is a Spanish Pop group. It is made up of three brothers: Manuel, Óscar, and Raúl, all of whom are signers. They live in León where, in the center of the city they manage the club \"La Lola\" with their father. Besides having published 4 cd\' s with great success, they have collaborated with Disney for soundtracks and have been in promotional photos of Castilla y León for tourism in the region.',987290,100158,'Pereza, Estopa, M-Clan, Melendi, Fito Y Fitipaldis'),('2EMAnMvWE2eb56ToJVfCWs','Bryson Tiller','Bryson Tiller (born January 2, 1993) is an American singer-songwriter from Louisville, Kentucky. Early approval from Timbaland and Drake boosted the career of Bryson Tiller, a contemporary R&B songwriter and singer -- a self-termed \"trap soul\" artist who also raps -- from Louisville, Kentucky. Tiller made waves with SoundCloud uploads like \"Don\'t,\" \"Break Bread,\" \"Let \'Em Know,\" and \"Sorry Not Sorry.\" \"Don\'t,\" a sparse ballad, was given an official release in May 2015.',95390074,1598776,'PARTYNEXTDOOR, Brent Faiyaz, Tory Lanez, Summer Walker, Sonder'),('2ErsJAz6qJ5cqjoVAvfvaC','Charles Wesley Godwin','A native of Morgantown, West Virginia, singer-songwriter Charles Wesley Godwin paints a rich and honest portrayal of his homeland and its people with his debut album. Seneca is a moving snapshot of his 26 years of life and well-soiled roots in the Appalachian hills, a backdrop that has given birth to some of the most intelligent and hard-working people in the country.\n\nWhen you partake in his gripping storytelling, it comes as no surprise that Godwin’s shared bills with the likes of Shooter Jennings',2429454,119460,'Turnpike Troubadours, Flatland Cavalry, Wyatt Flores, 49 Winchester, Colby Acuff'),('2EXpthNgSeTDeX8nGwxppp','Paris Paloma','Paris Paloma (born November 17, 1999) is a singer-songwriter from Derbyshire, UK. Her debut single “Narcissus” was released in 2020, followed by her second single “Ocean Baby” and \"Underneath.\" Her debut EP, cemeteries and socials was released in September 2021. \n\n\"Labour\", her most popular track to date and a viral hit, was released in March 2023.\n\n\"UK singer songwriter Paris Paloma channels the experience of womanhood into her songwriting, speaking to the female experience, grief, love, death, and power.',16071253,658806,'Amélie Farren, Rabbitology, Florence + the Machine, Erin LeCount, Phildel'),('2FXC3k01G6Gw61bmprjgqS','Hozier','Andrew Hozier-Byrne (born 17 March 1990), known mononymously as Hozier, is an Irish musician and singer-songwriter from Bray, County Wicklow, Ireland. In 2013 he released his debut EP, featuring the hit single \"Take Me to Church\", and his second EP \"From Eden\" in 2014. His debut studio album, \"Hozier\", was released in Ireland in September 2014 and globally in October 2014.\n\nHozier was born in Bray, County Wicklow, Ireland.  His mother is the visual artist Raine Hozier-Byrne (who also designed his latest album cover).',260202303,3183335,'Noah Kahan, Florence + the Machine, Gigi Perez, Lucy Dacus, The Lumineers'),('2ICR2m4hOBPhaYiZB3rnLW','Sonder','(1) Made up of producers Atu and Dpat with lead vocals by Brent Faiyaz , the collaborative entity Sonder took form in 2016, quickly crafting a slew of songs characterized by minimal beats, blurry multi-tracked vocal harmonies, and a fragmented, futuristic take on traditional R&amp;B. The trio spent the fall of 2016 in a flurry of productivity, dropping mixes \"Victoria,\" \"Undone,\" and \"Sheath\" in quick succession, all three projects notable in their seductive, low-lit production and extended running times, none under ten minutes long.',44061295,985330,'Brent Faiyaz, Avenoir, Chase Shakur, PARTYNEXTDOOR, Paperboy Fabe'),('2iEvnFsWxR0Syqu2JNopAd','Smash Mouth','Smash Mouth is an alternative rock band from San Jose, California, United States that formed in 1994, the band\'s lineup consists of  founding bassist Paul De Lisle, keyboardist Michael Klooster (1997-present), drummer Randy Cooke (2010-present), guitarist Sean Hurwitz (2011-present), and lead singer Zach Goode (2021-present). Their hit songs include \"Walkin\' on the Sun\" (1997) and \"All Star\" (1999).\n\nFocused at times playing \"neo-ska\" music, the band has adopted retro styles spanning several decades of popular music',27088080,2280998,'Sugar Ray, The Presidents of the United States of America, Barenaked Ladies, Reel Big Fish, Cake'),('2IvkS5MXK0vPGnwyJsrEyV','Eric Church','Eric Church is a country singer-songwriter. He has released nine studio albums through Capitol Nashville since 2005. His debut album, 2006\'s Sinners Like Me, produced three singles on the Billboard country charts including the top 20 hits \"How \'Bout You\", \"Two Pink Lines\", and \"Guys Like Me\".\n\nHis second album, 2009\'s Carolina, produced three more singles: \"Smoke a Little Smoke\" and his first top 10 hits, \"Love Your Love the Most\" and \"Hell on the Heart\".',14727477,754638,'Dierks Bentley, Kenny Chesney, Jake Owen, Jason Aldean, Billy Currington'),('2jku7tDXc6XoB6MO2hFuqg','Tory Lanez','Tory Lanez was born Daystar Peterson on July 27th, 1992 to his father, Sonstar Peterson and his mother, Luella Peterson in Toronto, Canada. At the age of 11, Tory discovered that his mother was ill with a rare disease that affects  four in every one million people. With the devastating loss of his mother and the absence of this father who is an ordained minister, Tory was forced to provide for himself at the early age of fourteen. Although his dad was not present in his everyday life',131293258,1836067,'Bryson Tiller, PARTYNEXTDOOR, Drake, A Boogie wit da Hoodie, Don Toliver'),('2K2bsaNeuQAFkuVwrrlJe0','Wind Walkers','Hailing from the vibrant music scene of central Massachusetts, Wind Walkers are leading in redefining the very essence of post-hardcore and alternative metal. \n\nAlongside the instrumental expertise of Timothy Comeau and Neil Comeau on guitar, Craig Martin on bass, and Ethan Cheesman on drums, the pivotal moment of their evolution came with the addition of vocalist Trevor Borg. With his exceptional vocal prowess and captivating stage presence, he\'s added a new layer of depth and intensity to their already established sound.',3720115,130681,'Rain City Drive, Awaken I Am, Caskets, Until i Wake, Slaves'),('2KaW48xlLnXC2v8tvyhWsa','Amaranthe','Amaranthe is a Swedish/Danish band, originated from Gothenburg, Sweden, formed in 2008 that fuses melodic metal with pop melodies. Formed by Jake E (Dreamland, Dream Evil) and Olof Mörck (Dragonland, Nightrage), the project began taking shape, when singers Elize Ryd (toured with Kamelot) and Andreas Solvestrom (Cipher System, Within Y), signed on, as did drummer Morten Løwe Sørensen (The Cleansing, Koldborn, Mercenary). Bassist Johan Andreassen',24629273,345339,'Battle Beast, Beyond the Black, Metalite, Ad Infinitum, Beast in Black'),('2kucQ9jQwuD8jWdtR9Ef38','Sam Hunt','Sam Lowry Hunt (born December 8, 1984 in Cedartown, Georgia, United States) is an American country singer, songwriter and former college football player. He is known for writing singles for Kenny Chesney, Keith Urban, and Billy Currington. In 2014, Hunt signed with MCA Nashville and released his debut album \"Montevallo\", which includes the number 1 Country Airplay hits \"Leave the Night On\" and \"Take Your Time\".\n\nSam Hunt co-wrote Kenny Chesney\'s 2012 hit \"Come Over\", for which he received an ASCAP award.',9901937,486692,'Jordan Davis, Thomas Rhett, Dustin Lynch, Cole Swindell, Florida Georgia Line'),('2kxP07DLgs4xlWz8YHlvfh','NIKI','There are at least three known artists with this name:\n\n1) Nicole Zefanya, known professionally as NIKI, is an Indonesian rising R&B singer-songwriter under 88rising label--along with another rising star fellow Rich Brian and Joji. She has written songs since she was 13 and produced her own music which she uploaded on Youtube, as well as her soothing cover songs.\n\n2)Niki aka Kairit Tuhkanen is Estonian Pop singer. Her songs are taken from Russian Pop artist Zhanna Friske.',69955108,895155,'88rising, Bruno Major, Paul Partohap, DENȲ, Janine'),('2mAYpnSe3g2Y22JcZ2ddku','Soap&Skin','Soap&Skin is the experimental musical project of Austrian artist Anja Plaschg (born 5 April 1990).\nAnja Plaschg grew up in a small village called Gnas in south east Styria, where her parents have a farm. She has played piano since she was six. At the age of 14 she began violin studies and developed an interest in electronic music. She attended the Graz Polytechnic for Graphic Design, but dropped out at 16 and moved to Vienna shortly afterwards. There she studied art at the Academy of Fine Arts in the master class of Daniel Richter',12757074,721245,'CocoRosie, Agnes Obel, Emily Jane White, Dillon, Chelsea Wolfe'),('2MqhkhX4npxDZ62ObR5ELO','Hoobastank','Hoobastank (sometimes stylized as h∞bastank, and originally known as Hoobustank) is an American rock band formed in 1994 in Agoura Hills, California. The founding members include lead vocalist Doug Robb, guitarist Dan Estrin, drummer Chris Hesse, and original bassist Markku Lappalainen. The group initially began as a Talking Heads cover band.\n\nHoobastank was signed to Island Records from 2001 to 2012 and has released six studio albums and one extended play.',47027591,2804824,'3 Doors Down, Trapt, Papa Roach, 12 Stones, Sick Puppies'),('2mVVjNmdjXZZDvhgQWiakk','Khruangbin','Khruangbin (IPA: /ˈkɹʌŋbɪn/) is an American three-piece band from Houston, Texas, formed of Laura Lee on bass, Mark Speer on guitar, and Donald Johnson on drums. The trio\'s first single \'A Calf Born In Winter\' was released in May 2014 by Late Night Tales offshoot Night Time Stories, and saw support from DJs Zane Lowe, Cerys Matthews, Tom Ravenscroft, Gideon Coe and magazines as musically diverse as Test Pressing, For Folks Sake, i-D, The 405 and Ransom Note.',43263620,1005114,'Arc De Soleil, BALTHVS, Menahan Street Band, Glass Beams, Surprise Chef'),('2n2RSaZqBuUUukhbLlpnE6','Sleep Token','Sleep Token is an English rock band formed in London in 2016. The members remain anonymous, performing while wearing masks. The band self-released their debut EP \"One\" in 2016 and followed it with the EP \"Two\" in 2017 after signing with Basick Records.\n\nSleep Token later signed with Spinefarm Records and released their first full-length album, \"Sundowning,\" in 2019. This was followed by \"This Place Will Become Your Tomb\" in 2021. Their third album',133846505,756990,'breakk.away, Bad Omens, Spiritbox, Sleep Theory, Thornhill'),('2NdeV5rLm47xAvogXrYhJX','Ciara','Ciara Princess Wilson is an American singer. Born in Fort Hood, Texas, her family eventually settled in Atlanta, Georgia, where she joined the girl group Hearsay. She later signed a publishing deal and befriended producer Jazze Pha, who recorded demos that would appear on her debut album. With his help, Ciara signed a record deal with LaFace Records.\n\nIn 2004, Ciara released her debut studio album, Goodies. It was certified triple platinum by the',44139540,2695841,'Kelly Rowland, Keri Hilson, Destiny\'s Child, Nicole Scherzinger, Monica'),('2pH3wEn4eYlMMIIQyKPbVR','DragonForce','DragonForce is a British power metal band based in London, England. Formed in 1999, the group is known for their long and fast guitar solos, fantasy-themed lyrics, and electronic sounds in their music to add to their retro video game-influenced sound. DragonForce has released seven studio albums, two live albums, one compilation album, one live DVD and one demo.\n\nHistory - Early years and Valley of the Damned (1999–2003).\nDragonForce was founded in 1999 by guitarists Herman Li and Sam Totman, under the name of DragonHeart.',38810584,1134356,'Twilight Force, Freedom Call, Gloryhammer, Rhapsody of Fire, Power Quest'),('2pSObt5Fk8izuX8ZfI3jRn','Upchurch','Ryan Upchurch (born May 24, 1991), known professionally as Upchurch or Upchurch the Redneck, is an American performer from Cheatham County, Tennessee, on the outskirts of Nashville, Tennessee.[1] He describes himself as a \"comic, rapper, and musician\n\nUpchurch created Upchurch the Redneck with his friend Shade Glover and began uploading videos to YouTube.[2] He released an extended play, Cheatham County, in 2015, followed by a full-length album, Heart of America, in 2016.',2079196,43263,'Adam Calhoun, The Lacs, Kidd G, Creed Fisher, Struggle Jennings'),('2QMsj4XJ7ne2hojxt6v5eb','Riley Green','Riley Green has been compelling country music fans to raise a drink, shed a tear, and, above all, celebrate where they are from, since first releasing his self-titled EP in 2018 with Big Machine Label Group. His songs like the #1 PLATINUM hit “There Was This Girl,” the 3X-PLATINUM-certified heart-tugger “I Wish Grandpas Never Died” (which he performed live at the 55th ACM Awards), and his chart-topping collab with Thomas Rhett, “Half of Me',6170150,188519,'Cody Johnson, Parker McCollum, Luke Combs, Morgan Wallen, Bailey Zimmerman'),('2QoU3awHVdcHS8LrZEKvSM','Wilco','Wilco is an American alternative rock band which formed in 1994 in Chicago, Illinois, United States by the remaining members of alternative country group Uncle Tupelo following singer Jay Farrar\'s departure from that group. Wilco\'s lineup has changed frequently, with only singer Jeff Tweedy and bassist John Stirratt remaining from the original incarnation. The other current members are guitarist Nels Cline, multi-instrumentalists Pat Sansone and Mikael Jorgensen, and drummer Glenn Kotche.',99466926,1911005,'Billy Bragg & Wilco, Jeff Tweedy, Uncle Tupelo, Loose Fur, Tweedy'),('2R57sY41L9XvGPiIgHOaYq','The Pretty Reckless','The Pretty Reckless is an American alternative rock band from New York, United States. The current members are Taylor Momsen (lead vocals, rhythm guitar), Ben Phillips (lead guitar, backing vocals), Mark Damon (bass) and Jamie Perkins (drums). The band formed in 2009 when Momsen stated that she would quit acting after her television role Jenny Humphrey from the hit TV show Gossip Girl (2007-2012) to focus on her music career.\n\nIn 2010, they released their debut studio album Light Me Up.',55162956,1241688,'Halestorm, Dorothy, DIAMANTE, Evanescence, Icon for Hire'),('2RYonYiVhhzBz82UFXOvEN','KEVIN WOO','Kevin Woo (Korean: 우성현) (born November 25, 1991), is a Korean-American singer, actor, and MC. He is primarily known as a former member of South Korean boy band U-KISS,[1]  from 2008 until 2017, as well as a host of various programs such as After School Club. He made his Japanese solo debut on October 25, 2018 with the single \"Ride Along\". He then made his official U.S solo debut on June 29, 2021 with the single \"Got It\".\n\nIn 2025, Kevin was credited to have provided the singing vocals of SAJA BOYS',50414,8030,'BZ-Boys, LIM JIMIN, GreatGuys, Hong Eunki, D-CRUNCH'),('2txHhyCwHjUEpJjWrEyqyX','Tom Odell','Tom Peter Odell is a British singer-songwriter from Chichester (UK), who studied at the Brighton Institute of Modern Music. Signed to Columbia Records, Odell made his television debut on November 30, 2012 as a performer on \"Later… with Jools Holland\" on BBC. He released his debut extended play, \"Songs From Another Love\", on October 15, 2012; with his first studio album entitled \"Long Way Down\" which was released on June 24, 2013 (Sept 17, 2013 in US).',46811326,1932381,'Tom Rosenthal, James Bay, Birdy, SYML, mehro'),('2UBTfUoLI07iRqGeUrwhZh','Steve Earle','Steve Earle (born Stephen Fain Earle on January 17, 1955 in San Antonio, Texas) is a singer-songwriter best known for his country music and rock \'n roll tinged \"alt-country.\" He is also a published writer, a keen political activist (particularly in protesting against the death penalty in the U.S., as in his song \"Ellis Unit One\" from the movie Dead Man Walking), and has written and directed a play. Earle also had small roles on the HBO television shows \"The Wire\" and \"Treme\".',8916260,631338,'Steve Earle & The Dukes, Guy Clark, Justin Townes Earle, John Hiatt, Lucinda Williams'),('2UOVgpgiNTC6KK0vSC77aD','Amorphis','Amorphis is a Finnish progressive folk metal band started by Jan Rechberger, Tomi Koivusaari and Esa Holopainen in Helsinki, Finland in 1990. Amorphis absorbed and incorporated influences from many metal genres, and with time passing their sound evolved dramatically. Initially, the band was a Death Metal act, but with time they have evolved into making music that is more classifiable as Doom Metal with folk influences, and, more recently, Folk Metal and Symphonic Metal, utilizing increasingly complex arrangements and a less brutal sound.',44384012,554318,'Insomnium, Dark Tranquillity, Paradise Lost, In Mourning, Sentenced'),('2v7wIbCkIzxOfT3GnqCexD','Cody Jinks','Cody Jinks is an outlaw country music singer and songwriter. His 2016 album, I\'m Not the Devil, reached #4 on the Billboard Country Albums chart, while his 2018 album, Lifers, reached #2 on the same chart.\n\nJinks is a native of Haltom City in Fort Worth, Texas,  and attended Haltom High School. He started learning to play a few country music riffs on the guitar from his father when he was 16, but soon formed a heavy metal band.\n\nJinks started out as the lead singer of a thrash metal band from Fort Worth named Unchecked Aggression',3532952,126481,'Turnpike Troubadours, Whitey Morgan and the 78\'s, The Steel Woods, Jamey Johnson, Tanner Usrey'),('2vd2HnNh4pdYa9gDVHFjEu','As I Lay Dying','As I Lay Dying is an American metalcore band from San Diego, California, formed in 2000 by vocalist Tim Lambesis. The first complete lineup, which included drummer Jordan Mancino, was established in 2001. The band has released eight studio albums, one split album, and two compilation albums.\n\nThe fourth studio album, \"An Ocean Between Us,\" peaked at number 8 on the Billboard 200 and number 1 on the Top Rock chart. The band has performed at festivals including Wacken Open Air',63192481,1106699,'All That Remains, Unearth, Killswitch Engage, August Burns Red, Miss May I'),('2VDZoCBGjxbHJbnzSX5nP6','KXLLSWXTCH','Jonathan Robert Whitmer (born July 17, 1999), professionally known as Kxllswxtch, is a recording artist and songwriter from Orange County, California based in Miami, Florida. He is known for his screaming vocals and horror-inspired visuals often featuring knives and fighting.\n\nKxllswxtch began making music in 2017 and quickly gained a local following. He dropped several songs before releasing his first EP InVain on SoundCloud. He would go on to make much of his earlier music private.',16994452,788889,'do not resurrect, Kamaara, Faceless 1-7, ruzlxn, XZARKHAN'),('2WoVwexZuODvclzULjPQtm','Sampha','Sampha\'s artful and emotive mix of pop, R&B, and electronic music isn\'t easily categorizable, and is further distinguished by a heartfelt vocal style that tends to sound as if it\'s on the brink of choking back tears. The artist established himself as a valued remixer and studio collaborator sought by emergent underground talents and mainstream stars alike, including SBTRKT, Jessie Ware, Drake, Beyoncé, and Kanye West. Process (2017), his full-length debut, went Top Ten in his native U.',22151535,700315,'SBTRKT & Sampha, Anderson .Paak, NxWorries, James Blake, Smino'),('2wY79sveU1sp5g7SokKOiI','Sam Smith','Samuel Frederick Smith (born 19 May 1992) is an English singer and songwriter. They rose to prominence in October 2012 after being featured on Disclosure\'s breakthrough single \"Latch\", which peaked at number eleven on the UK Singles Chart. Smith was subsequently featured on Naughty Boy\'s \"La La La\", which became a number one single in May 2013. In December 2013, they were nominated for the 2014 Brit Critics\' Choice Award and the BBC\'s Sound of 2014 poll, winning both.',108104794,2956152,'Adele, Jessie J, Calum Scott, James Arthur, Ed Sheeran'),('2XIbOWDT5vZPW7jNyzdfcK','Caskets','Caskets, formed in 2018 under the name Captives, are a British post-hardcore band from Leeds, England.\n\nThe band was founded by bassist Christopher McIntosh, who played rhythm guitar at the time, Benji Wilson (lead guitar) and bassist Lee Horner, who together left their previous project Faultlines to pursue new projects. The band was completed with James Lazenby (drums) and Matthew Flood (vocals). Flood had previously played guitar and sang in the pop punk band Silhouettes.',8180508,265262,'Awaken I Am, Wind Walkers, Rain City Drive, Nerv, Until i Wake'),('2ye2Wgw4gimLv2eAKyk1NB','Metallica','Metallica is an American heavy metal band. The band was formed in 1981 in Los Angeles by vocalist/guitarist James Hetfield and drummer Lars Ulrich, and has been based in San Francisco for most of its career. The band\'s fast tempos, instrumentals and aggressive musicianship made them one of the founding \"big four\" bands of thrash metal, alongside Megadeth, Anthrax and Slayer. Metallica\'s current lineup comprises founding members and primary songwriters Hetfield and Ulrich, longtime lead guitarist Kirk Hammett and bassist Robert Trujillo.',513976054,4992979,'Megadeth, Slayer, Pantera, Anthrax, Iron Maiden'),('2yEwvVSSSUkcLeSTNyHKh8','TOOL','Tool is an American alternative metal/progressive metal band from Los Angeles. Formed in 1990, the group\'s line-up includes vocalist Maynard James Keenan, guitarist Adam Jones and drummer Danny Carey. Justin Chancellor has been the band\'s bassist since 1995, replacing their original bassist Paul D\'Amour. Tool has won four Grammy Awards, performed worldwide tours, and produced albums topping the charts in several countries.\n\nTo date, the band has released five studio albums, one EP and one box set.',219057055,2520436,'A Perfect Circle, Puscifer, Rishloo, Karnivool, Gojira'),('30e8DmahrEamvLbFRPdWmk','Justin Moore','Multi-platinum hitmaker Justin Moore has built a loyal following over the past decade with his traditional country sound and captivating live shows. Currently climbing through the Top 40 at Country radio, his latest single, “You, Me, and Whiskey,” the smoldering duet with Priscilla Block follows in the footsteps of his 11th #1 hit, “With A Woman You Love,” which served as the first offering from his new album, Stray Dog, out now. He reached double-digit chart success with his 10th #1',4483609,417114,'Jason Aldean, Jake Owen, Chris Young, Randy Houser, Dierks Bentley'),('31TPClRtHm23RisEBtV3X7','Justin Timberlake','Justin Randall Timberlake (born January 31, 1981) is an American singer, songwriter, actor, record producer, and dancer. He is recognized as a prominent figure in popular music and has sold an estimated 88 million records worldwide.\n\nBorn and raised in Memphis, Tennessee, Timberlake began his career on musical television programs as a child, including competing on \"Star Search\" and appearing on the Disney Channel\'s \"The All New Mickey Mouse Club\" in the early to mid-1990s.',155117283,5307749,'*NSYNC, Usher, Robin Thicke, Timbaland, Jennifer Lopez'),('32vWCbZh0xZ4o9gkz4PsEU','Dolly Parton','Dolly Rebecca Parton (born January 19, 1946 in  Sevierville, Tennessee, U.S.) is an American country singer, songwriter, composer, producer, entrepreneur, author and actress.\n\nParton began performing as a child, singing on local radio and television in East Tennessee. At age 12 she was appearing on Knoxville TV, and at 13, she was recording on a small label and appearing at the Grand Ole Opry in Nashville. When she graduated from high school in 1964 she moved to Nashville',34922877,2189409,'Porter Wagoner & Dolly Parton, Reba McEntire, Loretta Lynn, Dolly Parton, Linda Ronstadt & Emmylou Harris, Tammy Wynette'),('32WkQRZEVKSzVAAYqukAEA','Lady A','Lady Antebellum was the name of the American country trio that changed its name to Lady A on 11 June 2020, amid the George Floyd protests. \n\nThe trio originally formed in Nashville, Tennessee, in 2006 by Charles Kelley (lead and background vocals), Dave Haywood (background vocals, guitar, piano, mandolin) and Hillary Scott (lead and background vocals). \n\nScott is the daughter of country music singer Linda Davis, and Charles Kelley is the brother of pop artist Josh Kelley.',19672067,1114391,'Carrie Underwood, Little Big Town, Keith Urban, The Band Perry, Rascal Flatts'),('336vr2M3Va0FjyvB55lJEd','D\'Angelo','D\'Angelo (born Michael Eugene Archer on 11 February 1974 in Richmond, VA United States; died 14 October 2025) was a neo-soul singer, keyboardist, and guitarist. He released three studio albums, Brown Sugar (1995), Voodoo (2000), and Black Messiah (2014, formally credited to D\'Angelo and the Vanguard).\n\nD\'Angelo signed a publishing deal with EMI Music in 1991 after catching the attention of record executives with a demo tape. He penned the hit song \"U Will Know\" on the Jason\'s Lyric soundtrack.',28606939,1217962,'D’Angelo and The Vanguard, Maxwell, Erykah Badu, D\'Angelo and The Vanguard, Stevie Wonder'),('33EUXrFKGjpUSGacqEHhU4','Iggy Pop','Iggy Pop (born James Newell Osterberg, Jr.; April 21, 1947) is an American singer, songwriter, musician, and actor. Though widely known as an innovator and \"godfather\" of punk rock, Pop\'s music has encompassed a number of styles over the years, including pop, hard rock, jazz and blues. Pop became known as \'Iggy\' in high school, during which time he served as drummer for local blues band The Iguanas. He is vocalist of influential proto-punk band The Stooges (Pop and the other surviving members of the group reunited in 2003)',43645484,2212585,'The Stooges, Iggy Pop & James Williamson, Lou Reed, David Bowie, New York Dolls'),('33qOK5uJ8AR2xuQQAhHump','Teddy Swims','Jaten Dimsdale, known by his moniker, Teddy Swims, is an American Singer-songwriter from Atlanta, GA.\n\nTeddy grew up navigating different worlds: he was a football player, a musical theater student and the grandson of a Pentecostal pastor. Teddy was exposed to a wider variety of music than most “country boys”. In high school and over the next few years he was in several bands, genres ranging from 80’s hair metal, funk, modern metalcore, soul, and country alternative bands.',18192387,1042264,'Victor Ray, GoldFord, Rag\'n\'Bone Man, JP Cooper, Alex Warren'),('3444S3C4U9Ts86BnCtSPRV','Treaty Oak Revival','Treaty Oak Revival is a Texas country rock band founded deep in the heart of West Texas. Starting in 2019; the band has formed itself on a foundation of Texas Red Dirt Country combined with it’s influences of punk and southern rock in their style and playing.',7465753,138628,'Koe Wetzel, Gavin Adcock, Ole 60, Pecos & the Rooftops, Josh Meloy'),('37394IP6uhnjIpsawpMu4l','Killswitch Engage','Killswitch Engage is an American metalcore band from Westfield, Massachusetts, formed in 1999 after the disbanding of Overcast and Aftershock. Killswitch Engage\'s current lineup consists of vocalist Jesse Leach, guitarists Joel Stroetzel and Adam Dutkiewicz, bassist Mike D\'Antonio, and drummer Justin Foley (formerly in Blood Has Been Shed). The band has released nine studio albums and three live performance albums. Their ninth studio album, This Consequence, was released on February 21st, 2025.',83955576,1670988,'All That Remains, Times of Grace, As I Lay Dying, Light the Torch, Trivium'),('37w38cCSGgKLdayTRjna4W','Mazzy Star','Mazzy Star is an American alternative rock band formed in 1988 in Santa Monica, California, from remnants of the group Opal. Founding member David Roback\'s friend Hope Sandoval became the group\'s vocalist when Kendra Smith left Opal.\n\nMazzy Star is best known for the song \"Fade Into You\", which brought the band some success in the mid-1990s and was the group\'s biggest mainstream hit, earning extensive exposure on MTV, VH1 and radio airplay. Roback and Sandoval were the creative center of the band',99313332,2550451,'Hope Sandoval & The Warm Inventions, The Sundays, Mojave 3, Cocteau Twins, Slowdive'),('3AuMNF8rQAKOzjYppFNAoB','Kelly Rowland','Kelendria Trené Rowland is an American singer, songwriter, actress and television personality. She rose to fame in the late 1990s as a member of Destiny\'s Child, one of the world\'s best-selling girl groups of all time. During the group\'s three-year hiatus, Rowland released her debut solo studio album, Simply Deep (2002), which debuted at number one on the UK Albums Chart and sold over 3 million copies worldwide. It included the Billboard Hot 100 number-one single \"Dilemma\" (with Nelly)',17811352,1533880,'Ciara, Keri Hilson, Destiny\'s Child, LeToya, Fantasia'),('3b8QkneNDz4JHKKKlLgYZg','Florida Georgia Line','Florida Georgia Line is an American country music duo founded in 2010 by vocalists and songwriters Tyler Hubbard of Georgia and Brian Kelley of Florida; however, the band is on an indefinite hiatus from touring and “taking a break” from making music together as the members pursue solo careers. Their 2012 debut single \"Cruise\" broke two major sales records: it was downloaded over seven million times, making it the first country song ever to receive the Diamond certification',13307622,591481,'Luke Bryan, Jason Aldean, Jake Owen, Cole Swindell, Dustin Lynch'),('3BEV5FcxOtkQJ7lLRKMh3V','Tyler Hubbard','Tyler Hubbard is a singer-songwriter, and musician, best known as a member of the Nashville-based duo Florida Georgia Line. After that duo went on hiatus in 2021, Hubbard began recording as a solo artist on EMI Nashville. His first solo chart entry was a guest vocalist on Tim McGraw\'s \"Undivided\", followed by his first solo single \"5 Foot 9\", which topped the Billboard Country Airplay charts in 2022. He released his self-titled debut album in 2023.',1436021,101384,'Jordan Davis, Dylan Scott, Nate Smith, Cole Swindell, Randy Houser'),('3bhu7P5PfngueRHiB9hjcx','Elle King','Tanner Elle Schneider (born July 3, 1989), known professionally as Elle King, is an American singer, songwriter, and musician. Her musical style encompasses country, soul, rock and blues.\n\nIn 2012, King released her debut EP \"The Elle King EP\" on RCA; one track from that EP, \"Playing for Keeps\", is the theme song for VH1\'s Mob Wives Chicago series.\n\nShe released her debut album \"Love Stuff\" in 2015. It produced the US top ten single \"Ex\'s & Oh\'s\", which earned her two Grammy Award nominations.',7051108,709045,'Gin Wigmore, ZZ Ward, Bishop Briggs, Rachel Platten, Neon Trees'),('3BJX1nYizKvWpZTY5HOAr4','Charley Crockett','Charley Crockett (born March 24, 1984) is an American blues, country, and Americana singer, guitarist, and songwriter. He has released ten albums since 2015, with Lil G.L.\'s Blue Bonanza peaking at number 11 on the US Billboard Blues Albums chart. In 2020, Crockett released a mixtape containing low-fidelity recordings titled Field Recordings, Vol. 1 and the studio album Welcome to Hard Times. In 2021, Crockett released two albums, 10 for Slim: Charley Crockett Sings James Hand (a tribute album to James \"Slim\" Hand) and Music City USA.',5827709,175442,'Vincent Neil Emerson, Colter Wall, Sturgill Simpson, Sierra Ferrell, Brent Cobb'),('3bLSAQPeix7Xm2e5Gtn48R','The Steeldrivers','The SteelDrivers is an American bluegrass band from Nashville, Tennessee. Members include fiddler Tammy Rogers, bassist Mike Fleming, guitarist Gary Nichols and banjoist Richard Bailey. The band has recorded two albums on the Rounder Records label and one independent live album recorded at The Station Inn.\n\nAfter playing at bluegrass festivals from around 2005 they signed to Rounder Records and released a self-titled debut in 2008. The album peaked at No.',3112460,179900,'Brent Cobb, Colter Wall, Town Mountain, Trampled by Turtles, Tyler Childers'),('3BM0EaYmkKWuPmmHFUTQHv','Kreator','Kreator is a German thrash metal band from Essen, formed in 1982. The group’s current lineup includes lead vocalist and rhythm guitarist Miland \"Mille\" Petrozza, drummer Jürgen \"Ventor\" Reil, lead guitarist Sami Yli-Sirniö, and bassist Frédéric Leclercq. Over the band’s more than four-decade career, its lineup has changed several times, particularly in the positions of bassist and lead guitarist. Petrozza and Reil remain the only original members, with Reil having briefly left the band in 1994 before rejoining in 1996.',38541099,650448,'Destruction, Sodom, Exodus, Testament, Tankard'),('3bnPBquC93vbHmamojAf59','Angelus Apatrida','Born in March 2000, Angelus Apatrida became in a few years one of the most important Spanish thrash metal bands. Many demos and band members passed through the history of Angelus Apatrida, but it was in January 2003 when the band changed their attitude and image and decided to make a harder and faster music, nearer to that of bands like Pantera, Megadeth, Overkill, Anthrax or Annihilator.\n\nThe first album Evil Unleashed (Maldito Records, March 2006) made the band one of the biggest thrash metal acts in Spain',1361926,45002,'Crisix, Soziedad Alkoholika, Gama Bomb, Hatchet, Havok'),('3bvfu2KAve4lPHrhEFDZna','Lola Indigo','Lola Indigo es un proyecto musical formado en 2018 por la cantante Mimi Doblas como vocalista​ y bailarina, junto a Mónica Peña, Saydi Lubanzadio, Laura Ruiz y Claudia Riera acompañándola en el baile.\nEl 29 de junio de 2018 Mimi Doblas anunció a través de las redes sociales que su música estaba cerca, mediante esta publicación señalaba que no estaría sola en el proyecto y que se rodearía de un cuerpo de bailarinas con lo que se completaría Lola Indigo:',6414109,165844,'Aitana, Ana Mena, Belén Aguilera, Vicco, Suzete'),('3CygdxquGHurS7f9LjNLkv','Little Big Town','Little Big Town is an American country music band.\n\nFormed in 1999, the band has four members: Karen Fairchild, Kimberly Schlapman, Jimi Westbrook and Phillip Sweet. There is no lead singer in the band; instead, they trade lead vocal duties as well as rely on the harmonies of the four members.\n\nLittle Big Town\'s self-titled 2002 debut for Sony\'s Monument Records was panned critically and did not sell commercially. The album had only one minor hit single',7704167,665422,'Miranda Lambert, Dierks Bentley, Sugarland, The Band Perry, Carrie Underwood'),('3ETLPQkcEd7z4k3IbZmXMq','Cleo Sol','Cleo Sol was born to musical parents who met in a Jazz band. Her Mum, half Serbian and Spanish, is a singer and plays the guitar and flute. Cleo’s Jamaican Dad plays the bass and piano. Cleo quickly became the singer in the family, jostling for attention amongst seven other siblings, she received a second hand karaoke player from her mum which gave her a platform to display her early talents to her musical family.\n\nIt was Stevie Wonder’s ‘Don’t',14126330,599068,'Sault, Snoh Aalegra, Amaria, Ray Lozano, Ari Lennox'),('3eVa5w3URK5duf6eyVDbu9','ROSÉ','ROSÉ (Hangul: 로제) or Roseanne Park is a South Korean-New Zealander singer-songwriter under THEBLACKLABEL and Atlantic Records. And also holds a group contract with YG Entertainment, serving as the vocalist for the girl group BLACKPINK (Hangul: 블랙핑크).\n\nIn March 2021, ROSÉ made her solo debut with her single album R, selling 448,089 copies in its first week - the highest figure by a Korean female soloist. Its lead single “On the Ground” was a commercial success',94684556,1545938,'JISOO, Rosé, Bruno Mars, Jennie, BLACKPINK, Lisa'),('3EVsC9ZK7QMDuK4FPcZaEq','Josh Meloy','Josh Meloy is an American country singer-songwriter from Oklahoma. Inspired from the Red Dirt country rock scene of his home state, Meloy released his debut album in 2018. His music is characterized by gritty vocals, reflective lyrics and a minimalist acoustic sound.\n\nBorn and raised in Oklahoma, Meloy grew up in a family with deep ties to music but didn’t explore music himself until he began playing guitar in college.\n\nSince launching his musical career in 2018',1966758,130273,'Gavin Adcock, Tanner Usrey, Treaty Oak Revival, Dylan Gossett, Wyatt Flores'),('3FfvYsEGaIb52QPXhg4DcH','Jason Aldean','Jason Aldean is a country music singer and songwriter. He\'s had 30 of his singles hit #1 on the Hot Country Songs or Country Airplay charts.\n\nSince 2005, Aldean has been signed to Broken Bow Records, a record label for which he has released 11 albums and 40 singles. His 2010 album, My Kinda Party, is certified quadruple-platinum by the Recording Industry Association of America (RIAA). His 2012 album Night Train is certified double-platinum, while his 2005 self-titled debut',21727496,1054762,'Luke Bryan, Dierks Bentley, Chris Young, Florida Georgia Line, Billy Currington'),('3FUY2gzHeIiaesXtOAdB7A','Train','Train is an American pop rock band from San Francisco that was formed in 1993. Since 2024, the band consists of Pat Monahan (lead vocals), Taylor Locke (guitar, vocals), Hector Maldonado (bass, vocals), Jerry Becker (keyboards, guitar), and Matt Musty (drums).\n\nWith a lineup that included original members Monahan, Rob Hotchkiss, Jimmy Stafford, Scott Underwood, and Charlie Colin, the band achieved mainstream success with their debut album Train. The album was released in 1998 with the hit \"Meet Virginia\".',55677334,3268967,'Matchbox Twenty, Sister Hazel, Five for Fighting, The Script, Rob Thomas'),('3FvwVFWRyvxmLyVBO9nBmM','COLORS','There are at least five bands who have recorded under the name Colors.\n\n1) Now defunct Denver, Colorado based dissonant hardcore group that formed in June of 2008. In August of 2010, they recorded nine of the songs that they had written in the two years prior, eight of which were released as \'Palindromes\'. After a lineup change that October, they briefly adopted a new moniker and began working on new material before permanently disbanding in March of 2011.',488890,22322,'LDS Church Choirs, Fra Lippo Lippi, Death Goals, Ariadne\'s Thread, Pilcrow'),('3gN8Ihw22Vt9mnK97gbwMQ','RUBII','RUBII is a Birmingham born singer/creative within the UK Alt-RnB scene. RUBII explores different RnB and HipHop genres with signature relaxed vocals creating a chilled but exciting approach. The first RUBII single was released in December 6th, 2019.',3882446,344007,'Enny, bina., Qendresa, Gotts Street Park, Pip Millett, IAMDDB'),('3grHWM9bx2E9vwJCdlRv9O','Kenny Chesney','Kenneth Arnold Chesney (born March 26, 1968) is an American country singer. With worldwide album sales of approximately 30 million, he released his debut album \"In My Wildest Dreams\" in 1994 and has since released 19 additional studio albums. His recordings have produced 27 singles that reached the top 40 on the Billboard Hot 100.\n\nChesney has received twelve Country Music Association Awards, including the Entertainer of the Year award four times',22018598,1172605,'Tim McGraw, Dierks Bentley, Jake Owen, Billy Currington, Eric Church'),('3H6CaRooDAoCeRCpYwOXj2','Ramirez','1) a rapper from San Francisco.\nRamirez or Rvmirxz (both forms are used) is a rapper and co-founder of the independent record label G*59 with Ruby da Cherry and $crim (which he was a part of from 2013-2025). He draws influences from UGK, Tommy Wright lll, Three 6 Mafia, Outkast, DJ Screw, KeKe, and Andre Nickatina. He is currently 28 years old and he gained underground fame from making two collaboration mixtapes with the $uicideboy$.\n\n2) A Brazillian indie rock band from Rio de Janeiro.',22685484,605309,'Scrim, Pouya & Ghostemane, Derek Pope, Gizmo, DJ Paul Elstak'),('3hE8S8ohRErocpkY7uJW4a','Within Temptation','Within Temptation is a Dutch symphonic metal/rock band founded in April 1996 by vocalist Sharon den Adel and guitarist Robert Westerholt.\n\nThe band went through numerous style changes, blending various genres throughout its career. Their debut album Enter and early singles were in vein of gothic metal.  From Mother Earth (2000) album onwards, the band shifted to symphonic metal genre, which brought Within Temptation to popularity. Their recent albums, starting with The Unforgiving (2011), lean towards  alternative rock  and  synth rock .',101390183,1356020,'Delain, Xandria, Nightwish, Epica, Tarja'),('3HR1xtIsUefdFnkI1XHgeA','The Dead South','The Dead South is a four-piece acoustic ensemble based in Regina, Saskatchewan. With Nate Hilts\' gritty vocals and aggressive guitar strumming, Scott Pringle\'s soaring harmonies and mandolin chops, Colton Crawford\'s blazing banjo licks and steady kick drum, and Danny Kenyon\'s prominent cello melodies, The Dead South blends elements of folk, bluegrass, classical, and rock which results in a unique, modern, and authentic blend of boot-stompin\' acoustic music.',3873770,189943,'The Devil Makes Three, The Haunted Windchimes, The SteelDrivers, Amigo The Devil, Poor Mans Poison'),('3HrbmsYpKjWH1lzhad7alj','Los Auténticos Decadentes','Los Auténticos Decadentes (Spanish for \"The Authentic Decadents\") is an Argentine band that mixes ska with Latin American rhythms. The band was formed around 1986 by Cucho and Nito, who invited Gastón to join them.\n\nTheir first hit was Veni Raquel, which set the tone for their later lyrics\' irreverence and ironic humor. Many of their songs are classic anthems of Argentinian nightlife, such as Corazón, Loco (Tu Forma de Ser), Entregá el Marrón, La Guitarra, Los Piratas, and El Murguero.',4642402,247537,'Los Fabulosos Cadillacs, Vicentico, Bersuit Vergarabat, Los Pericos, Los Rodríguez'),('3hteYQFiMFbJY7wS0xDymP','Gesaffelstein','French DJ and electronic musician Mike Lévy produces industrial-tinged techno and electro under the moniker Gesaffelstein, a made-up word meant as a reference to both the concept of Gesamtkunstwerk (total work of art) and Albert Einstein. Heavily influenced by early EBM acts like Nitzer Ebb and Front 242 as well as techno and house producers such as Green Velvet and Laurent Garnier, his sinister tracks injected a dose of darkness back into the club scene during the late 2000s and early 2010s.',25728890,1455972,'Sebastian, Justice, Boys Noize, Mr. Oizo, Busy P'),('3IhWQSrLj8EJjdvjFTpCyo','Vince Gill','Vince Gill (born April 12, 1957) is an American country music musician, songwriter, singer and a member of the Country Music Hall Of Fame. He achieved commercial success and fame both as frontman to the country-rock band Pure Prairie League in the 1970s, and as a solo artist beginning in 1983, where his talents as a vocalist and musician have placed him in high demand as a guest vocalist, and a duet partner (with artists including Dolly Parton, Reba McEntire, Amy Grant and Barbra Streisand).',2438082,233771,'Steve Wariner, Travis Tritt, Patty Loveless, Clint Black, Neal McCoy'),('3JDIAtVrJdQ7GFOX26LYpv','Accept','Accept is a German heavy metal band from Solingen, formed in 1976 by guitarist Wolf Hoffmann, vocalist Udo Dirkschneider, and bassist Peter Baltes. The group has its origins in the late 1960s under the earlier name Band X. Over the years, Accept has undergone numerous lineup changes. Hoffmann is the only original member to remain in the band and has performed on all of its albums. As of 2024, Accept’s lineup includes Hoffmann, vocalist Mark Tornillo',21699899,708649,'U.D.O., Saxon, Judas Priest, Running Wild, Manowar'),('3JFsVIxOn7STeilPICkkB2','Lamb of God','Lamb of God is an American groove metal band, originally formed under the name Burn the Priest.\n\nThe roots of Lamb of God were planted in the year 1990, when Mark Morton, Chris Adler and John Campbell were friends at Virginia Commonwealth University. The trio began playing at Adler\'s house in Richmond weathering chilly conditions. \"There was no heat in the house,\" recalls Campbell. \"We would hang around the kerosene heaters, get really drunk and write metal songs. Fumes and Black Label beer were definitely what fueled our early days.\"',80072491,1423902,'Burn the Priest, DevilDriver, Chimaira, Machine Head, Trivium'),('3jK9MiCrA42lLAdMGUZpwa','Anderson .Paak','Brandon Paak Anderson (born February 8, 1986), better known by his stage name Anderson .Paak, is an American rapper, singer, songwriter, record producer, and drummer. He released his debut mixtape, O.B.E. Vol. 1, in 2012 and went on to release Venice in 2014. In 2016 he followed up with Malibu, which received a nomination for Best Urban Contemporary Album at the Grammy Awards, followed by Oxnard, in 2018. At the 61st Grammy Awards, Paak won his first Grammy award for Best Rap Performance with the song \"Bubblin\".',49152358,1112255,'NxWorries, Free Nationals, Smino, Isaiah Rashad, Bruno Mars, Anderson .Paak & Silk Sonic'),('3jTlKw98Ql1jGRPYqhqHap','Skindred','Skindred is a four-piece \"ragga metal\" band from Newport, Wales. Their genre is an innovative mix of metal, punk, and reggae. The band was formed in 1999 following the disbandment of vocalist Benji Webbe\'s previous band, Dub War and his one-off side-project Mass Mental? featuring Robert Trujillo (Suicidal Tendencies, Infectious Grooves, Metallica) released the year prior.\n\nThe band initially came together with three of the four Dub War veterans with Jeff Rose and Martin Ford returning alongside Webbe, along with new bassist Daniel Pugsley.',15759866,612850,'Soil, Nonpoint, Ill Niño, Drowning Pool, Dope'),('3K2Srho6NCF3o9MswGR76H','Bakar','There is more than one artist with this name, including: \n1) Bakar is British singer-songwriter Abubakar Baker Shariff-Farr (born 12 February 1994); \n2) Bakar is French rapper Jamel Mekaidiche (born in Chartres) . \n\n1) Abubakar Baker Shariff-Farr (born 12 February 1994), better known as Bakar, is a British singer, songwriter and model. Known for his experimental indie rock style, he made his professional solo debut with the mixtape Badkid in May 2018, subsequently releasing the extended play Will You Be My Yellow? in September 2019.',26997984,1277010,'Loyle Carner, Dominic Fike, PawPaw Rod, Kofi Stone, Ag Club'),('3KV3p5EY4AvKxOlhGHORLg','Jeremih','Jeremy Phillip Felton (known professionally as Jeremih, born July 17, 1987 in Chicago, Illinois) is an American R&B singer-songwriter, rapper and producer. Jeremih began playing drums at the age of three and is able to play the saxophone, several percussion instruments and piano/keyboards. He attended Morgan Park High School, where he was part of the marching band as well as a Latin jazz band. He also learned to play percussion instruments like congas and timbales.',29605243,2100378,'Jacquees, Trey Songz, Lloyd, Eric Bellinger, Omarion'),('3L2SIGZah4QZSvN4wC8rHl','City Spud','What I can tell you ab City is that he is a very reserved man and he has reason to be with all he had been through.  The media wants to know your ups and especially your downs but right now he just hard ay work everyday, no weekend trying to make up for lost tome that should have been his.',9200,2079,'Avery Storm, Jazze Pha, Lincoln University Vocal Ensemble, Dat Nigga Daz, I-20'),('3lY9Fxceu60W1rbon7PkuF','Omar Montes','Omar Ismael Montes Moreno es un cantante y personaje mediático español que se dio a conocer por sus apariciones en reality shows como Mujeres y hombres y viceversa, Gran Hermano VIP y Supervivientes, así como por su relación con Isa Pantoja, hija de Isabel Pantoja.​',1847913,110569,'Lola Indigo, Rvfv, Juan Magán, Quevedo, Alleh'),('3mQBpAOMWYqAZyxtyeo4Lo','KC & The Sunshine Band','KC and the Sunshine Band is an American musical group. Founded in 1973, their style has included funk, R&B, and disco. Their most well known songs include the disco hits That\'s the Way (I Like It), (Shake, Shake, Shake) Shake Your Booty, I\'m Your Boogie Man, Keep It Comin\' Love, Get Down Tonight, Give It Up, and Please Don\'t Go. They took their name from Wayne Casey\'s last name (\"KC\") and the \"Sunshine Band\" from KC\'s home state of Florida (\'The Sunshine State\').',2531040,378245,'Chic, The Trammps, Sister Sledge, Tavares, Kool & the Gang'),('3NR7hAacOhmcztWvD7vJfS','Sickick','In a world dominated by the desire for fame, Sickick is the enigmatic artist making a name for himself in music without ever showing his face.\n\nThe masked producer, vocalist, and songwriter has crafted his unique style of electronica by layering seductive lyrics over hard hitting percussion. Sickick brings together elements of trap, bass, reggaeton, electro, and Rhythm and Blues to create an atmospheric, otherworldly auditory experience. \n\nDespite his musical talent, the idea of fame and crowds was once a cause of anxiety for Sickick.',4547821,301653,'2Scratch, Neovaii, blackbear, NEFFEX, The Tech Thieves'),('3o2dn2O0FCVsWDFSh8qxgG','Sabaton','Sabaton is a Swedish heavy metal band from Falun, Sweden. The vast majority of their albums are written about historical events, mainly wars and significant battles. Sabaton has been referred to as one of the \"big four\" power metal bands, along with Helloween, Blind Guardian and DragonForce. They are one of the most successful metal bands in Swedish history, with their album Carolus Rex being the best-selling Swedish heavy metal album of all time.',89377534,815533,'Powerwolf, Civil War, Gloryhammer, Brothers of Metal, Beast in Black'),('3oSJ7TBVCWMDMiYjXNiCKE','Kane Brown','Kane Brown is an American singer. He was born and raised in the Chattanooga, Tennessee area by a single mother, moving from Rossville to Fort Oglethorpe and LaFayette in Georgia, finally settling in Red Bank, Tennessee.\n\nHe attended Lakeview-Fort Oglethorpe High School where he sang in the choir with Lauren Alaina, the runner-up on season 10 of American Idol. He also attended Red Bank, Ridgeland, and Soddy Daisy High Schools, at all of which he was a stand out athlete at football, basketball and track.',8299440,457901,'Jordan Davis, Thomas Rhett, Dustin Lynch, Cole Swindell, Dylan Scott'),('3oVcF3VdpMuvMvLLyHPT4t','Sierra Ferrell','Sierra Ferrell (born on 3 August 1988) is an American singer-songwriter based in Nashville, TN. \n\nGrowing up in West Virginia, Ferrell got her start singing Shania Twain songs in a local bar at the age of seven, and left home in her early 20s to journey across the US with a troupe of wandering musicians. After years of living in her van and busking on the streets of New Orleans and Seattle, Ferrell moved to Nashville and started landing gigs there.',4431651,238111,'Bella White, Charley Crockett, Emily Nenni, Nick Shoulders, Sturgill Simpson'),('3p7PcrEHaaKLJnPUGOtRlT','Henrique & Juliano','Henrique & Juliano, brothers from Palmeirópolis, Tocantins, began their musical journey in the simplicity of their hometown, performing at local events and festivals. Their career took off with the independent release of their first CD in 2011, followed by their breakthrough hit Mistura Louca, which paved the way for their first DVD, recorded in Palmas. From the start, their authenticity and emotional lyrics distinguished them.\n\nWith hits like   Cuida Bem Dela',29718272,367303,'Zé Neto & Cristiano, Matheus & Kauan, Jorge & Mateus, Diego & Victor Hugo, Hugo & Guilherme'),('3PhoLpVuITZKcymswpck5b','Elton John','Sir Elton Hercules John (born Reginald Kenneth Dwight; 25 March 1947) is a British singer, pianist, and composer. Collaborating with lyricist Bernie Taupin since 1967, John is one of the most successful artists of all time, having sold over 300 million records worldwide in a seven-decade career in music. He is acclaimed by critics and musicians, particularly for his work during the 1970s, and his lasting impact on the music industry. John\'s music and showmanship have had a significant impact on popular music.',155085476,5030533,'Billy Joel, Rod Stewart, Paul McCartney, Queen, Elton John & Kiki Dee'),('3pulcT2wt7FEG10lQlqDJL','Amon Amarth','Amon Amarth is a Swedish melodic death metal band from Tumba, formed in 1992. The band takes its name from the Sindarin name of Mount Doom, a volcano in J. R. R. Tolkien\'s Middle-earth. Their lyrics mostly deal with Viking mythology and history, and so they have been sometimes erroneously labeled \"Viking metal\", although the band insists they play melodic death metal.\n\nThe band is composed of lead guitarist Olavi Mikkonen, vocalist Johan Hegg, bassist Ted Lundström, rhythm guitarist Johan Söderberg, and drummer Jocke Wallgren.',74147700,823546,'Arch Enemy, Ensiferum, Insomnium, Dark Tranquillity, Kataklysm'),('3qBKjEOanahMxlRojwCzhI','Zacari','Singer, songwriter, rapper, and multi-instrumentalist Zacari Pacaldo was raised in Bakersfield, California in a highly musical family. He was enrolled in a school for performing arts by age eight and began learning guitar, followed by drums, saxophone, and keyboards. After finishing high school, he worked seasonally for three years at an Alaska national park, earning money to enrol in music school in Los Angeles. During his time in L.A., Pacaldo began posting his own songs online and quickly began collaborating with much larger names.',2430486,289775,'Blxst, SiR, Mustard, Rapsody, Tems'),('3Ri4H12KFyu98LMjSoij5V','Bad Omens','Bad Omens is an American metal band formed in 2015 in Richmond, Virginia by vocalist and producer Noah Sebastian, (then) guitarist Nicholas Ruffilo and bassist Vincent Riquier.\n\nThe current lineup of the band includes: Noah Sebastian (lead vocals, programming), Nicholas Ruffilo (bass, backing vocals), Joakim Karlsson (lead guitar, programming, backing vocals and rythm guitar) and Nick Folio (drums and percussions).\n\nHistory\nThe first idea to form the band came in 2013 when Noah Sebastian, then guitarist of a Washington D.',73958589,712789,'Bring Me the Horizon, The Plot in You, Dayseeker, Motionless in White, Sleep Token'),('3RqBeV12Tt7A8xH3zBDDUF','Kelsea Ballerini','A country-pop singer and songwriter out of Knoxville, Tennessee, Kelsea Ballerini started writing songs when she was 13 years old, began learning guitar a year later, and moved to Nashville at 15 to pursue her dream of being a professional singer and songwriter. Four years later in 2013, when she was 19, Ballerini signed a publishing deal with Black River Publishing and a recording deal with Black River Entertainment later that same year. A debut single',14199957,460344,'Maren Morris, Carly Pearce, Maddie & Tae, Megan Moroney, Lauren Alaina'),('3sUpZrkehiGBaMzs2h9Mmc','Corey Kent','With the small-town charm of a boy from Bixby, OK, the big-city energy of Dallas, TX, and vocal prowess that rivals Nashville’s best – Corey Kent has been poised for a career in music from the beginning. Growing up influenced by various genres and artists, Corey started his journey in music at an early age. Taking the stage at age 11 as the lead singer for a touring Western Swing band, Corey hit early career milestones opening for legendary acts like Roy Clark and The Oak Ridge Boys.',1398991,92905,'Kameron Marlowe, Warren Zeiders, Bailey Zimmerman, Dylan Scott, Jordan Davis'),('3tlXnStJ1fFhdScmQeLpuG','Brent Faiyaz','Christopher Brent Wood (born September 19, 1995) better known as Brent Faiyaz is an R&B singer/producer based out of Baltimore, Maryland.\n\nOn September 18, 2016 Faiyaz dropped his EP A.M. Paradox; catching the attention of Goldlink. Just 2 months later on December 16, 2016, Goldlink collabed with Faiyaz and Shy Glizzy (Now Young Jefe) to create the behemoth single “Crew”.',209916312,1916732,'Sonder, Bryson Tiller, Avenoir, Paperboy Fabe, PARTYNEXTDOOR'),('3tMTXQyRrPmMyHv5SoC0TV','Juicy Luicy','1) - Juicy Lucy is a British blues rock band formed in 1969. The band name was inspired by a character in The Virgin Soldiers (1966) by Leslie Thomas. \n\nJuicy Lucy was formed by steel guitarist Glenn Ross Campbell, and prolific Blackburn saxophonist Chris Mercer, following the demise of The Misunderstood. They subsequently recruited vocalist Ray Owen, guitarist Neil Hubbard, bassist Keith Ellis, and drummer Pete Dobson.\n\nThe line-up of the band has changed throughout its existence.',174444,29225,'Bernadya, Tulus, Mahalini, Hivi!, Jaz'),('3u65Tx20y4WqxO7W7khEhj','Clara La San','Bedroom producer Clara La San is an artist keeping things private in an era when we’re told to Instagram Story our every move.\n\nThe intimacy of Clara’s sound mimics her minimal online presence, which is essentially limited to a handful of SoundCloud tracks. Her caramel-smooth voice cropped up first in 2015 on a track with balls-to-the-wall producer Scratcha DVA, but she really got people’s attention via ‘Fones’, a collab with crystalline beatmaker Mssingno.',9882737,480937,'Essosa, Avenoir, Sonder, PARTYNEXTDOOR, Brent Faiyaz'),('3uL4UpqShC4p2x1dJutoRW','Ghostemane','Eric Whitney (born 15 April 1991),[2] known professionally as Ghostemane is an American artist and musician from Lake Worth, Florida.\n\nGrowing up in Florida, Whitney was originally a guitar player for hardcore and doom metal bands.[3] Whitney moved to Los Angeles, California after starting his career as a rapper eventually finding success in the underground.\n\n\nEric Whitney was born 15 April 1991 in Lake Worth, Florida to parents from New York. Whitney grew up in West Palm Beach, Florida.',42024003,814285,'Ghostemane, Parv0, $uicideboy$, Bones, Bleed The Wicked Menace, Pouya'),('3Uobr6LgQpBbk6k4QGAb3V','I Prevail','I Prevail is an American metalcore band formed in Southfield, Michigan, in 2013. They released their first EP „Heart vs Mind” a year later. Their rise to popularity came after releasing a cover of Taylor Swift’s Blank Space (also in 2014), which ended up reaching certified platinum in the US. Since then, the band has released three albums:\n- Lifelines in 2016, which reached #15 on the Billboard 200,\n- Trauma in 2019, which became their most successful album yet - receiving both a Best Rock Album Grammy nomination',29659279,551758,'Wage War, Beartooth, Memphis May Fire, We Came as Romans, Dayseeker'),('3v0QTRruILayLe5VsaYdvk','HAARPER','Richard McLaughlin (born March 5, 1994), more commonly known by his stage name HAARPER, is a Hip-Hop artist based in Los Angeles, California. He grew up in the San Francisco Bay Area and started making music as a teenager. He released his first song in 2016.',21163913,482419,'MAKAVELIGODD, Bleed The Wicked Menace, Sxmpra, TUNDRAMANE, do not resurrect'),('3vDpQbGnzRbRVirXlfQagB','Sturgill Simpson','John Sturgill Simpson (born June 8, 1978) is an American country music and roots rock singer-songwriter.\n\nSimpson was born in Jackson, Breathitt County, Kentucky, the only child of a secretary and a state policeman who formerly worked undercover narcotics. Due to his father\'s work, Simpson\'s family moved to Versailles, outside Lexington, where Simpson graduated from Woodford County High School. Simpson\'s mother\'s family were coal miners. Simpson is the first male on his mother\'s side of the family to not work in a strip mine or deep mine.',12310758,358998,'Johnny Blue Skies, Tyler Childers, Turnpike Troubadours, Charley Crockett, Brent Cobb'),('3VNITwohbvU5Wuy5PC6dsI','Kool & The Gang','Kool & the Gang is an American R&B, soul, and funk band formed in Jersey City, New Jersey, in 1964. Its founding members include brothers Robert \"Kool\" Bell and Ronald Bell, Dennis \"Dee Tee\" Thomas, Robert \"Spike\" Mickens, Charles Smith, George Brown, Woodrow \"Woody\" Sparrow, and Ricky Westfield. They have undergone numerous changes in personnel and have explored many musical styles throughout their history, including jazz, rhythm and blues, soul, funk, disco, rock, and pop music.',20586083,1980370,'Chic, Earth, Wind & Fire, Brothers Johnson, Commodores, Sister Sledge'),('3wcj11K77LjEY1PkEazffa','Burna Boy','Damini Ebunoluwa Ogulu (born 2 July 1991), known professionally as Burna Boy, is a Nigerian singer and songwriter.\n He rose to prominence in 2012 after releasing the lead single \"Like to Party\" from his debut studio album, L.I.F.E (2013). In 2017, Burna Boy signed with Bad Habit/Atlantic Records in the United States and Warner Music Group internationally. His third studio album Outside (2018) marked his major-label debut. In 2019, he won Best International Act at the 2019 BET Awards',22156777,770259,'Asake, Wizkid, Davido, BNXN, Fireboy DML'),('3win9vGIxFfBRag9S63wwf','Bailey Zimmerman','Bailey Zimmerman (born January 27, 2000 in Louisville, Illinois, USA) is an American country singer/songwriter. Zimmerman\'s journey to musical stardom began with a Snapchat video of Black Stone Cherry’s \"Stay\" while waiting at his stepbrother’s shop. This caught the attention of songwriter Gavin Lucas, who encouraged Zimmerman to explore his own music. Their collaboration resulted in Zimmerman’s first song, \"Never Comin\' Home,\" which he shared on TikTok in December 2020.',7926837,262889,'Warren Zeiders, Morgan Wallen, Luke Combs, Jordan Davis, Tucker Wetmore'),('3X458ddYA2YcVWuVIGGOYe','Toni Braxton','Toni Michelle Braxton (born October 7, 1967 in Severn, Maryland) is an American R&B/adult-pop/contemporary singer, songwriter, and actress who was popular during the 1990s and the new millennium with hits like \"Un-Break My Heart\", \"You\'re Makin\' Me High\", \"He Wasn\'t Man Enough\" and \"Breathe Again\".\n\n She has won 7 Grammy Awards. The RIAA named Braxton as one of the top selling R&B artists of all time.\n\nShe first burst onto the scene in 1992 on the Boomerang soundtrack, after Anita Baker turned down the opportunity.',17112461,1332338,'Mary J. Blige, Monica, Whitney Houston, Brandy, Tamar Braxton'),('3XHO7cRUPCLOr6jwp8vsx5','alt-J','Alt-J (sometimes stylised ∆) was formed when Gwil Sainsbury (guitar, bass), Joe Newman (guitar, vocals), Gus Unger-Hamilton (keyboards), and Thom Sonny Green (drums) met at the University of Leeds,  Leeds, UK in 2007. The band currently resides in Cambridge.\n\nUnger-Hamilton studied English Literature; the other three Fine Art. In their second year of studies, Newman showed Sainsbury a handful of his own songs inspired by his guitar-playing dad and hallucinogens',115945989,2284235,'Foals, Milky Chance, Broken Bells, The xx, Chelou'),('3xs0LEzcPXtgNfMNcHzLIP','Rockwell','There are, at least, six artists known as Rockwell.\n\n1) A pseudonym of Kenneth Gordy, from Detroit, Michigan: The son of Motown Records\' founder, Berry Gordy, he changed his name so as to avoid charges of nepotism, wanting to make it in the music business on just his talent. He signed to Motown as a solo artist without his father\'s knowledge, taking his name from his high school band. His first single, the Michael Jackson-esque \"Somebody\'s Watching Me\".',6601612,1092424,'Ray Parker Jr., Michael Sembello, Michael Jackson, The Romantics, Cutting Crew'),('3xYXYzm9H3RzyQgBrYwIcx','Colter Wall','Colter Wall (born June 27, 1995) is a Canadian singer-songwriter from Swift Current, Saskatchewan. His self-titled debut album was released on May 12, 2017.\n\nWall was familiar with country music growing up as country artists such as Johnny Cash were played at home. He started learning guitar at the age of 13, playing music of rock bands such as AC/DC and Black Sabbath and Led Zeppelin. Later he became interested in old blues artists, and then started to listen to folk music.',13927997,411229,'Tyler Childers, Brent Cobb, Charley Crockett, Vincent Neil Emerson, The SteelDrivers'),('3Y7RZ31TRPVadSFVy1o8os','H.E.R.','Gabi Wilson (born June 27, 1997), better known by her stage name H.E.R. (acronym for Having Everything Revealed), is an American singer from Vallejo, California. Before being known as H.E.R., Wilson rose to fame by participating in 2009’s Radio Disney’s Next Big Thing. She signed to RCA Records and has released five extended plays under the label: H.E.R. Volume 1 (2016), H.E.R. Volume 2 (2017), H.E.R. Volume 2, The B Sides (2017), I Used To Know Her: The Prelude (2018) and I Used To Know Her: Part 2 (2018).',32464429,1242527,'Ella Mai, Kehlani, Summer Walker, Kiana Ledé, Jhené Aiko'),('3ycxRkcZ67ALN3GQJ57Vig','Masego','Micah Davis (born June 8, 1993), better known by his stage name Masego, is a Jamaican-American musician with South African roots. Masego is an international, contemporary genre bending entertainer who refers to his own music style as \"TrapHouseJazz\" or Emotion. He released his first album \"Loose Thoughts\" in 2016, but it was his collaborative record “Tadow” that has amassed over 47 million views on Youtube (508 million as of January 2025) and gained him international recognition.',19244194,991576,'SiR, Enny, Rayana Jay, Xavier Omär, BLK ODYSSY'),('3YQKmKGau1PzlVlkL1iodx','Twenty One Pilots','Twenty One Pilots (stylized in all lowercase or as twenty øne piløts) is an American musical duo from Columbus, Ohio. Initially a trio, the group was formed in 2009 by lead vocalist Tyler Joseph, Nick Thomas and Chris Salih, with Nick and Chris leaving in 2011. Since their departure, the line-up has consisted of Joseph and drummer Josh Dun. The duo is best known for their singles \"Stressed Out\", \"Ride\", and \"Heathens\". The group received a Grammy Award for Best Pop Duo/Group Performance at the 59th Annual Grammy Awards for \"Stressed Out\".',381453278,3112515,'Balu Brigada, half•alive, Panic! at the Disco, Imagine Dragons, AJR'),('3ZpEKRjHaHANcpk10u6Ntq','Ayra Starr','Ayra Starr is Nigerian singer and songwriter Oyinkansola Sarah Aderibigbe (born in Cotonou, Benin, on 14 June 2002). In early 2021, Starr achieved mainstream recognition with her eponymous debut extended play and its hit track \"Away\", which spent two consecutive weeks at number four on Nigeria\'s TurnTable Top 50 chart and peaked at number 17 on the US Billboard Top Triller Global chart, paving the way for the release of her 2021 debut full-length album, \"19 & Dangerous\".',6080486,316922,'Tems, Fireboy DML, Rema, Victony, Asake'),('3ZztVuWxHzNpl0THurTFCv','Architects','Architects is a mathcore/metalcore/alternative metal band from Brighton, East Sussex, United Kingdom, formed in 2004 by twin brothers Dan and Tom Searle. As drummer and guitarist, respectively, they were joined by guitarist Tim Hillier-Brook, bassist Tim Lucas, and vocalist Matt Johnson. Strongly influenced by the Dillinger Escape Plan, their initial sound was coarse, chaotic, and rhythmically complex. Lucas was soon replaced by Alex Dean while Johnson left after the release of their debut album Nightmares (2006).',73327067,789807,'Imminence, Polaris, While She Sleeps, Bury Tomorrow, Currents'),('40ZNYROS4zLfyyBSs2PGe2','Zach Bryan','Zachary Lane Bryan is an American country music singer-songwriter from Oologah, Oklahoma, known for his raspy voice and poetic lyrics. Bryan was serving in the Navy when he recorded his debut album, DeAnn, in 2019 and later left the military to pursue a career in music.\n\nFrom a family with a long history of military service, Bryan was born in Okinawa, Japan, in 1996, while his family was deployed overseas. Growing up in the small town of Oologah, Oklahoma',117893526,1116720,'Sam Barber, Charles Wesley Godwin, Dylan Gossett, Wyatt Flores, Tyler Childers'),('41MozSoPIsD1dJM0CLPjZF','BLACKPINK','BLACKPINK (Hangul: 블랙핑크; Katakana :ブラックピンク; stylized as BLΛƆKPIИK) is a four-member girl group formed by YG Entertainment, consisting of JISOO (지수), JENNIE (제니), ROSÉ (로제) and LISA (리사).\n\nOn May 31, 2016, YG Entertainment  began releasing individual teaser photos of the members for the agency\'s then-unnamed, upcoming girl group on Instagram, starting with Jennie the same day. This was followed by Lisa on June 7, Jisoo on June 14, and lastly Rosé on June 21.',291731234,1849477,'JISOO, Jennie, Rosé, Lisa, Baby Monster'),('45dkTj5sMRSjrmBSBeiHym','Tate McRae','Tate Rosner McRae (born July 1, 2003) is a Canadian singer, songwriter, and dancer. Raised in Calgary, Alberta, McRae first rose to prominence as a finalist on the American television show So You Think You Can Dance at just thirteen, showcasing her exceptional dance abilities. Following her TV success, she began sharing original songs and covers on YouTube, quickly gaining a large following for her unique voice and emotive performances.\n\nIn 2020, McRae\'s breakthrough single',223102886,2075063,'Nessa Barrett, Sabrina Carpenter, Gracie Abrams, Madison Beer, Zara Larsson'),('467M2s2YxXdlL2ZpDUNL3A','Paleface Swiss','Paleface Swiss (formerly just Paleface) is a  slamming deathcore band from Zurich, Switzerland.\n\nThe band formed in 2017, releasing their debut EP \'Chapter 1: From the Gallows\', the following year and the follow-up, \'Chapter 2: Witch King\', in 2019. In 2020, they released their debut studio album, \'Chapter 3: The Last Selection\'. In 2022, they released their second album \'Fear & Dagger\', which was met with positive reception.\n\nPaleface Swiss gained international recognition throughout the Deathcore and Beatdown Community.',4863070,158206,'Bodysnatcher, Left to Suffer, Signs of the Swarm, Spite, Kublai Khan TX'),('46lEQmDJLJeyltECJYJv1Y','Wyatt Flores','This Mexican-American Oklahoma-born troubadour sings from the gut, telling stories against a gritty country soundtrack. His unfiltered thoughts on life, death, addiction, pain, and joy emerge through his delivery.\n\n“I’m only getting one chance at life, so I try to be present,” he proclaims. “There’s more to existence than what the average person experiences. Death is always riding in the passenger seat... I choose to be friends with it.\"',3347292,125375,'Sam Barber, Dylan Gossett, Charles Wesley Godwin, Flatland Cavalry, 49 Winchester'),('49bzE5vRBRIota4qeHtQM8','Skillet','Skillet is an American Christian rock band formed in Memphis, Tennessee, in 1996 by vocalist John Cooper and guitarist Ken Steorts.\n\nThe current lineup consists of: John Cooper (lead vocals, bass and acoustic guitar), Korey Cooper (keyboards, synthesizer, rythm guitar and backing vocals), Jen Ledger (drums and backing vocals) and Seth Morrison (lead guitar).\n\nHistory\nFoundation and first years\nSkillet formed in 1996 with two members: John Cooper, former vocalist for Tennessee progressive rock band Seraph',79185604,2115647,'Thousand Foot Krutch, Ashes Remain, Disciple, Red, Nine Lashes'),('49HlOY4gkHqsYG9GCuhkcc','Celeste','There are multiple artists named Celeste.\n\n1. Celeste is a French post-black metal band with ex-Mihai Edrisch members. \n\nThey released their first EP, Pessimiste(s) in November 2006, followed by the albums Nihiliste(s) (2008), Misanthrope(s) (2009), Morte(s) Née(s) (2010), Animale(s) (2013), Infidèle(s) (2017) and Assassine(s) (2022). \n\nCeleste, along with Blut Aus Nord and Deathspell Omega, may be considered as one of the most important bands of the worldwide famous French avant-garde black metal scene.',11913580,807290,'Downfall of Gaia, Hexis, Amenra, LLNN, Year of No Light'),('4b0WsB47XCa9F83BmwQ7WX','The Righteous Brothers','The Righteous Brothers was the musical duo of Bill Medley and Bobby Hatfield. They recorded from 1963 through 1975, and continued to perform live until Hatfield\'s death in 2003. Their emotive vocal stylings were sometimes dubbed \"blue-eyed soul.\"\n\nThey adopted their name in 1962 while performing together around Los Angeles, USA as part of a five-member group called The Paramours, which featured John Wimber (who was much later one of the founders of the Vineyard Movement) on keyboards.',6819335,991854,'The Drifters, The Everly Brothers, The Ronettes, Curtis Lee, The Crystals'),('4B2Iosqk1yAbGbx08My1fM','Saurom','Saurom (formerly Saurom Lamderth) is a Spanish folk metal band based in the city of San Fernando, Cádiz. Its lyrics are often about traditional legends and poems. Some of their songs deal with literature stories, like \"The Lord of the Rings\" or \"A Song of Ice and Fire.\"',1665627,38166,'Warcry, Tierra Santa, Saratoga, Celtian, Mägo de Oz'),('4BFLElxtBEdsdwGA1kHTsx','ElGrandeToto','Taha Fassi AKA El Grande Toto (born August 3, 1995) is a rapper from Casablanca, Morocco.',1873928,46527,'DRAGANOV, Stormy, Snor, Inkonnu, 7liwa'),('4bw2Am3p9ji3mYsXNXtQcd','Piso 21','Juan David Castaño (el llanero), David Escobar (Dim), Juan David Huertas (El profe) y Pablo Mejía (Pablito), son los integrantes del grupo que ahora suena en las emisoras de la ciudad de medellin, Piso 21.\n\nEl mayor tiene solo 26 años y el menor 21. Son jóvenes, sí, pero ya son conscientes de su éxito y más que un grupo, ellos se consideran una familia, pues lo más importante, antes de cantar, es la unión y la lealtad a su amistad.\n\nTodo',5622774,309194,'Manuel Turizo, Cali & El Dandee, Mike Bahía, Maluma, Camilo'),('4BYxqVkZyFjtik7crYLg5Q','Chris Young','Christopher Alan Young (born June 12, 1985) is an American country music singer and songwriter. Young was born and raised in Murfreesboro, Tennessee and began his music career in 2002. He gained fame in 2006 as the Season 4 winner of the television program Nashville Star, a singing competition on USA. After winning, he was signed to RCA Records Nashville, releasing his self-titled debut album that same year. It produced two singles on Hot Country Songs with \"Drinkin\' Me Lonely\" and \"You\'re Gonna Love Me\".',7535229,571774,'Jason Aldean, Lee Brice, Cole Swindell, Billy Currington, Justin Moore'),('4dpARuHxo51G3z768sgnrY','Adele','Adele Laurie Blue Adkins MBE (born May 5, 1988) is an English singer and songwriter. After graduating in arts from the BRIT School in 2006, Adele signed a record deal with XL Recordings. Her debut album, 19, was released in 2008 and spawned the UK top-five singles \"Chasing Pavements\" and \"Make You Feel My Love\". The album was certified 8× platinum in the UK and triple platinum in the US. Adele was honoured with the Brit Award for Rising Star as well as the Grammy Award for Best New Artist.',306430072,5438028,'Sam Smith, Whitney Houston, Beyoncé, Sia, Céline Dion'),('4F84IBURUo98rz4r61KF70','The White Stripes','The White Stripes was an alternative rock band, formed in 1997 in Detroit, Michigan, United States. They disbanded in 2011. The group consisted of songwriter Jack White (vocals, piano/keyboards, guitar) and Meg White (drums, vocals).\n\nAfter releasing several singles and three albums within the Detroit independent music underground, The White Stripes rose to prominence in 2002, as part of the garage rock revival scene. Their successful albums White',195065479,4730993,'Jack White, The Raconteurs, The Dead Weather, The Kills, Beck'),('4fdCGYM7dtJLa3LvR1ccto','Gabriela Rocha','Gabriela Rocha Corrêa Moreira (São Paulo, 13 de março de 1994), é uma cantora e compositora brasileira de música cristã contemporânea.\n\nComeçou a se tornar conhecida através do concurso Jovens Talentos, no programa de televisão do Raul Gil, onde ingressou em março de 2006 e o venceu em maio de 2007. Desde então, vem sendo um dos maiores nomes da música gospel nacional, emplacando vários hits de sucesso, tanto em carreira solo quanto em dueto a outros artistas.',2485973,86179,'Gabriel Guedes de Almeida, Fernandinho, Morada, Julliany Souza, Isadora Pompeo'),('4fxd5Ee7UefO4CUXgwJ7IP','GIVĒON','Giveon Dezmann Evans (born 21 February 1995 in Long Beach, CA, United States), known mononymously as Givēon, is an American R&B singer and songwriter. He rose to prominence with his 2020 song \'Chicago Freestyle\' (with Drake), which peaked at number 14 on the Billboard Hot 100. That same year, Giveon signed with Epic Records to release two extended plays: the Grammy Award-nominated Take Time and When It\'s All Said and Done. He since released two full-length albums: Give or Take (2022) and Beloved (2025).',17844049,585283,'Khamari, Daniel Caesar, Brent Faiyaz, Bryson Tiller, Leon Thomas'),('4G1zP5i0r57g1c1CxrPhfM','ZillaKami','Junius Rogers (born September 20, 1998), known professionally as ZillaKami, is an American rapper and singer from Bay Shore, New York, though he lived in New York City from 2016 to 2018/19. Best known for his striking grillz, being half of City Morgue, his eccentric persona, MBF association, and provocative lyrics & music videos—which often depict drug abuse, violence, and nudity—ZillaKami’s controversial style began gaining traction online in early 2018.',21475750,367628,'City Morgue, SosMula, City Morgue, ZillaKami & SosMula, City Morgue & ZillaKami, nascar aloe'),('4GGfAshSkqoxpZdoaHm7ky','ERNEST','Ernest Keith Smith, known mononymously as Ernest (stylized in ERNEST), is an American country music singer. After writing songs for Morgan Wallen, Jake Owen, Florida Georgia Line, Thomas Rhett and Chris Lane, he signed a recording contract with Big Loud in 2019.\n\nErnest Keith Smith was born and raised in Nashville, Tennessee. He took an interest in hip hop music at an early age, citing the Space Jam soundtrack and a compact disc of Eminem songs given to him by a friend as his main influences.',2916070,133009,'Riley Green, Cody Johnson, Larry Fleet, Bailey Zimmerman, Parker McCollum'),('4GNC7GD6oZMSxPGyXy4MNB','Lewis Capaldi','Lewis Marc Capaldi (born 7 October 1996) is a Scottish singer-songwriter from Whitburn, a town in West Lothian.\n\nHe first rose to mainstream prominence on 8 November, 2018, with the release of his second EP Breach, including the massive hit single \"Someone You Loved\".\n\n2019 saw \"Someone You Loved\" charting in over 29 counties and becoming a global hit.\n\nOn 17 May, 2019, Capaldi released his debut album titled Divinely Uninspired to a Hellish Extent',49170649,1457231,'Dean Lewis, Calum Scott, James Arthur, BANNERS, Dermot Kennedy'),('4HrkLxQHZ5mgCtIVpiH5QX','From Ashes to New','Alt/nu-metal band from Pennsylvania, formed by and centred around vocalist/guitarist Matt Brandyberry.\n\nThe idea behind From Ashes to New, was to do something fresh and meaningful. By taking every kind of music that influences them, FATN is able to create a sound that is not only refreshing but also makes you feel as if you\'ve known it all along. With songs geared toward everyday struggles and uplifting lyrics in the direction of self betterment; From Ashes to New looks to capture the attention of listeners from all walks of music.',6460614,240644,'Silent Theory, Through Fire, Fight the Fade, Sleep Theory, From Fall to Spring'),('4HzKw8XcD0piJmDrrPRCYk','Majid Jordan','Majid Jordan is a Canadian R&B duo,  composed of singer Majid Al Maskati and producer Jordan Ullman. They are the latest member of the OVO Sound. Working between Ullman\'s dorm room and his parents\' basement, they launched their first joint EP titled Afterhours on SoundCloud under the pseudonym Good People.  In 2013, Majid Jordan co-produced and were credited to be featured on Drake\'s track \"Hold On, We\'re Going Home\",  and then become his most successful single-charting.',10904540,564893,'dvsn, Roy Woods, Naomi Sharon, PARTYNEXTDOOR, Arin Ray'),('4iSKnRZAxkmqNok6tv10Se','Crazy Town','Crazy Town, also known as CXT, was an American rap rock band formed in Los Angeles in 1995 by Bret \"Epic\" Mazur and Seth Brooks Binzer, known as Shifty Shellshock. The band gained mainstream success with the 2000 single \"Butterfly\", which reached number one on the US Billboard Hot 100 and significantly boosted sales of their debut album \"The Gift of Game\", released in 1999. The album sold over 1.6 million copies.\n\nTheir second studio album, \"Darkhorse\"',11308240,1196643,'Limp Bizkit, P.O.D., (hed) Planet Earth, Adema, 3rd Strike'),('4IVAbR2w4JJNJDDRFP3E83','6LACK','Ricardo Valdez Valentine Jr. (born June 24, 1992), known professionally as 6lack (stylized as 6LACK, pronounced \"black\"), is an American singer, rapper, and songwriter. He initially gained notable recognition following the release of his single, \"Prblms\", taken from his debut album, Free 6lack, which was released in November 2016.[5] He released his second album, East Atlanta Love Letter in September 2018, which peaked at number three on the Billboard 200 chart.',37010311,958077,'SAINt JHN, Bryson Tiller, SiR, dvsn, Tory Lanez'),('4IWBUUAFIplrNtaOHcJPRM','James Arthur','James Andrew Arthur (born 1988) is a British singer and musician who won the ninth series of The X Factor in 2012. His debut single, Impossible, was released after the final and debuted at #1 on the UK Singles Chart on 16 December 2012 in its first week of release.\nSince 2005, and prior to his participation in The X Factor, he was a vocalist and guitarist in a number of bands, and later, as a solo artist as well as forming his own The James Arthur Band and James Arthur Project.',45155798,1713586,'Dean Lewis, Lewis Capaldi, James TW, Calum Scott, Sam Fischer'),('4Lm0pUvmisUHMdoky5ch2I','Apocalyptica','Apocalyptica is a band from Helsinki, Finland consisting of three classically-trained cellists and a drummer. Their speciality is heavy metal music on cellos, though they also play classical music.\n\nThey started in 1993 by playing covers of Metallica, but once the concept became popular they wrote their own original works, maintaining the thrash metal influences on their albums Inquisition Symphony (mainly covers as well) and Cult. Since Reflections they have added drums to their recordings and live performances.',69329850,1614462,'Epica, Nightwish, Tarja, Within Temptation, Therion'),('4lxfqrEsLX6N1N4OCSkILp','Phil Collins','Philip David Charles Collins (born 30 January 1951) is an English singer, musician, songwriter, record producer and actor. He was the drummer and lead singer of the rock band Genesis and also has a career as a solo performer. Between 1982 and 1990, Collins scored three UK and seven US number-one singles as a solo artist. When his work with Genesis, his work with other artists, as well as his solo career is totalled, he had more US top 40 singles than any other artist during the 1980s.',62181463,3102783,'Genesis, Mike & The Mechanics, Peter Gabriel, Rod Stewart, Toto'),('4MoAOfV4ROWofLG3a3hhBN','Jon Pardi','Jon Pardi is an American country music singer and songwriter. Pardi has charted 14 singles on the Billboard Hot Country Songs and Country Airplay charts, with four hitting #1 on the latter: \"Head Over Boots\", \"Dirt On My Boots\", \"Heartache Medication\", and \"Last Night Lonely\". Signed to Capitol Nashville, he has released four studio albums: Write You A Song (2014), California Sunrise (2016), Heartache Medication (2019), and Mr. Saturday Night (2022). Pardi\'s music style is defined by neotraditional country influences.',10298789,346478,'Luke Bryan, Dierks Bentley, Jason Aldean, Billy Currington, Cody Johnson'),('4MzJMcHQBl9SIYSjwWn8QW','Spiritbox','Spiritbox is an alternative metal / metalcore / progressive metal band from Victoria, British Columbia, formed in 2017 by vocalist Courtney LaPlante and guitarist Mike Stringer.\n\nCurrent lineup includes Courtney LaPlante, Mike Stringer, bassist Josh Gilbert, and drummer Zev Rosenberg. Former members have included Ryan Loerke (drums, 2018–2020) and Bill Crook (bass, 2018–2022).\n\nThey released their debut EP Spiritbox (2017), followed by Singles Collection (2019).',40340317,495576,'Thornhill, Silent Planet, Architects, Sleep Token, ERRA'),('4nDoRrQiYLoBzwC5BhVJzF','Camila Cabello','Karla Camila Cabello Estrabao (born March 3, 1997), known by her stage name Camila Cabello, is a Cuban-Mexican-American singer and songwriter. She is a Latin-influenced pop performer who first came to prominence as a founding member of the girl group Fifth Harmony. Born in Cojimar, Cuba, Cabello moved to Miami, Florida at the age of six. Growing up in a Spanish-speaking environment (born to a Cuban mother and Mexican father), she fostered her love of music by listening to Celia Cruz and Alejandro Fernández.',121764910,2264759,'Fifth Harmony, Lauren Jauregui, Selena Gomez, Dinah Jane, Tate McRae'),('4NiJW4q9ichVqL1aUsgGAN','A Day To Remember','A Day to Remember is a post-hardcore band from Ocala, Florida, founded in 2003 by guitarist Tom Denney and drummer Bobby Scruggs. They are mainly known for their unusual amalgamation of metalcore and pop punk as a musical style, as well as playing other styles. The band consists of vocalist Jeremy McKinnon, rhythm guitarist and backing vocalist Neil Westfall, bassist Joshua Woodard, percussion and drummer Alex Shelnutt and lead guitarist Kevin Skaff.',151846819,1874736,'Beartooth, Silverstein, We Came as Romans, Memphis May Fire, Four Year Strong'),('4npEfmQ6YuiwW1GpUmaq3F','Ava Max','Amanda Ava Koci (born February 16, 1994), known professionally as Ava Max, is an American singer and songwriter. Ava first got her start in the music industry in 2008 as Amanda Kay, in which she released her first EP titled “Amanda Kay” that year. The EP featured 6 songs that were co-written and produced by Kevin Rudolf. \n\nAva would then restart her music career under the name AVA in 2013 and release the single, “Take Away the Pain”.  A year later, she would meet music producer Cirkut and begin recording songs with him.',63083576,1485485,'Bebe Rexha, Zara Larsson, Dua Lipa, Kim Petras, Ke$ha'),('4o0NtnL2m0lzZmEdRas1qv','Ovi','1. Ovi is a cuban artist based in Miami with Natanael Cano are one of the biggest exponents for Corridos Tumbados/Trap Corridos mixing Mexican/Cuban/Latino culture on a higher level.\n\n2. Romanian singer who represented Romania in Eurovision 2010 & 2014 with the songs ‘Playing With Fire’ and ‘Miracle’ with Paula Seling.',2086760,106855,'Natanael Cano, Roa, Gabito Ballesteros, Eladio Carrion, Bizarrap'),('4oCk0xbmAtqXZFzXtH3AgF','Redferrin','The buzz around Warner Music Nashville country artist Redferrin is impossible to ignore as one of Nashville’s most unorthodox and innovative new singer/songwriters. His recent releases are full of adrenaline-pumping energy and rebellious swagger, providing just a sample of the kaleidoscopic musical textures he can create. With lyrics that serve as a manifesto for his take-it-or-leave-it style, Redferrin wants the new music to become a sonic mirror held up to today’s rural culture.',490851,45581,'Chase Matthew, Tucker Wetmore, Warren Zeiders, Bailey Zimmerman, Austin Snell'),('4oUHIQIBe0LHzYfvXNW4QM','Morgan Wallen','Morgan Wallen sets the pace in, and beyond, country music – with Billboard calling him \"one of the biggest stars in the music world right now\" and The New Yorker adding \"[he\'s] popular on a scale that seems to circumvent genre entirely.\" With 19 #1 singles at Country radio, 19 Billboard Music Awards to-date, 198 weeks spent atop Billboard\'s Top Country Albums chart (the most in country music history), the highest selling country tour under his belt and more, Wallen has propelled country music to a global level in less than five years.',80459164,904769,'Bailey Zimmerman, Luke Combs, Riley Green, HARDY, Tucker Wetmore'),('4OYIkXBBN6ET96coWyWAXh','Germ','There are multiple artists with this name:\n\n1) A project of Australian Tim Yatras (Austere, Grey Waters, ex-Nazxul, etc) that incorporates elements of depressive black metal, rock and electronic music. Germ was conceived in early 2006, and shortly afterward the \"Raving Mad With Sadness\" song appeared online. Since then Germ has remained out of the public eye, but in the Spring of 2009 he entered SLS Studios to record his debut album. However, the record was not completed until 2011.',8552506,303765,'Austere, An Autumn for Crippled Children, Woods of Desolation, Ghost Bath, Amesoeurs'),('4pADjHPWyrlAF0FA7joK2H','Jay Sean','Kamaljit Singh Jhooti (born March 26, 1981 in Southall, London, England), better known by his stage name Jay Sean, is a British singer-songwriter and actor signed to Cash Money Records. Best known for international top 40 hits \"Down\" and \"Do You Remember\", his work transcends multiple genres from pop rap to soul to rnb and more. He released his debut album, \'Me Against Myself\', in 2004, and his sophomore release, \'My Own Way\', in 2008. Gaining momentum, his third studio album, \'All or Nothing\', was released November 2009.',19039659,1738689,'Iyaz, Sean Kingston, Jason Derülo, Ne-Yo, Taio Cruz'),('4PhdYoQGH8s1xee81dqQOO','Natiruts','Natiruts are a popular reggae band formed in Brasília, Brazil in 1996. Alexandre Carlo invited his soccer friends from Brasilia city in order to begin a new band in Brazil\'s capital. They are Luis Mauricio (bass) and Bruno Dourado (percussion). Later, the group \'enlisted\' some new members: Izabella Rocha (backing vocals) and Kiko Peres (solo electric guitar). The first album (Nativus) was released in 1997.\n\nOn the following albums (Verbalize - 2001 and Quatro - 2002) Tonho Gebara participated (solo electric guitar).',16409021,494143,'Maneva, Planta e Raiz, Chimarruts, Armandinho, O Rappa'),('4QvgGvpgzgyUOo8Yp8LDm9','Mrs. GREEN APPLE','Mrs. GREEN APPLE (ミセスグリーンアップル) is a 3, formerly 5 member Jrock band from Tokyo that debuted in 2013 an made their major debut in 2015 under EMI Records and Universal Music Japan. \n\nThe curent member are Motoki Ohmori, Hiroto Wakai and Ryoka Fujisaki',10395082,386175,'back number, Official髭男dism, 優里, tuki., Novelbright'),('4qXC0i02bSFstECuXP2ZpL','Blxst','Matthew Burdette (born September 17, 1995), known professionally as Blxst (pronounced \"blast\"), is an American rapper, singer, songwriter, and record producer from Los Angeles, California. Releasing his first single “Who Would’ve Thought” in 2016 and his breakout hit “Hurt” in 2019, it has since surpassed 2,000,000 streams while being independent. From self-editing his music videos and artwork to mixing and mastering his own sound, these tools are what positions Blxst to work side by side with countless west coast figures',9494469,422779,'Kalan.FrFr, Bino Rideaux, Mustard, Yung Bleu, Arin Ray'),('4RddZ3iHvSpGV4dvATac9X','Papa Roach','Papa Roach is an American rock band from Vacaville, California, formed in 1993. The original lineup consisted of lead vocalist Jacoby Shaddix, guitarist Jerry Horton, drummer Dave Buckner, bassist Will James, and trombonist Ben Luther.\n\nAfter two EPs, James left and was replaced by Tobin Esperance. The band independently released two more EPs before signing with DreamWorks Records in 1999, subsequently releasing the triple-platinum Infest in 2000, the gold album Lovehatetragedy in 2002 and the platinum album Getting Away with Murder in 2004.',124053549,3594059,'Three Days Grace, P.O.D., Shinedown, Saint Asonia, Pop Evil'),('4rriNpL1lxpoysDDctWgl3','Jesse Baez','Jesse Baez is a Guatemalan contemporary urban music artist. Born in the United States, he moved with his family to Guatemala at the age of six, where he spent most of his youth. He was exposed to Motown and R\\&B music from an early age, developing an interest in singing influenced by his grandmother.\n\nBaez began to develop his musical style through collaborations with artists and producers in Mexico. His single \"No Eres Tú,\" featuring C. Tangana, gained significant attention, reaching four million views within a few months of its release.',1807963,79334,'MÉNE, Easy Easy, Jaze, Nafta, AQUIHAYAQUIHAY'),('4SfGzWmeoNPKIOmiyc7Pav','Flatland Cavalry','Flatland Cavalry is a country and Americana band from Lubbock, Texas. The roots for the formation of Flatland Cavalry were first laid when Cleto Cordero and Jason Albers began playing at local venues while rooming together at Midland College. The two had been jamming together since junior high but it was not until they moved to Lubbock in 2012 that the band began to take shape. It was here, while studying at Texas Tech University, that the duo met Laura Jane at a house party.',4513336,187312,'Charles Wesley Godwin, Turnpike Troubadours, Parker McCollum, Muscadine Bloodline, Wyatt Flores'),('4TCXgdDPm10ensLNCVnIYa','Joy Williams','Joy Williams (born Joy Elizabeth Williams on November 14, 1982) is an American singer-songwriter. The winner of four Grammy Awards, Williams released her self-titled debut in 2001. She was half of The Civil Wars duo from 2009 until 2014.\n\nWilliams grew up in Santa Cruz, CA. At 17, she signed a recording contract with PLG/SonyBMG and moved to the friendly, muggy town of Nashville, TN. She co-wrote and recorded several albums and realized after 7 years of being on the road full time that it was song-writing that kept tugging at her heart.',2368475,309282,'Point of Grace, Francesca Battistelli, Rebecca St. James, Nichole Nordeman, Britt Nicole'),('4tMm1dU6Gn04VAZ9ClHcIZ','Jacquees','Rodriquez \"Jacquees\" Broadnax was born April 15, 1994 in Atlanta, GA. He found his passion for both singing and dancing at the age of 9 with influences from The Jackson\'s: An American Dream and The Temptations movies; imitating no less than the greatest. Jacquees participated in his first talent show in fifth grade at Canby Lane Elementary School performing the Jackson 5\'s, \"I Want You Back,\" winning 1st place. He successfully matriculated to Mary',10646133,595603,'Jeremih, Eric Bellinger, Trey Songz, VEDO, Lloyd'),('4tuJ0bMpJh08umKkEXKUI5','Gracie Abrams','Gracie Abrams (born September 7, 1999) is an American pop singer/songwriter from Los Angeles, California, and the daughter of the filmmaker and composer J.J. Abrams.\n\nAfter having only three tracks publically available on her Soundcloud (\'And She Will Miss You\', \'blue\', \'i kinda miss you\') Gracie released her first debut track \'Mean It\' along with an accompanying music video.\n\nShortly after, Gracie released two other songs, \'Stay\' and \'21\', the latter',261436438,1685614,'Alessi Rose, Maisie Peters, Lizzy McAlpine, Lexi Jayde, Devon Gabriella'),('4tususHNaR68xdgLstlGBA','Of Mice & Men','Of Mice & Men is a metalcore band formed in Costa Mesa, California in 2009 by Austin Carlile and Jaxin Hall after Carlile\'s departure from Attack Attack!. The name of the band is derived from John Steinbeck\'s novel of the same title.\n\nThe current line-up consists of Phil Manansala (guitar), Valentino Arteaga (ex. Lower Definition; drums), Aaron Pauley (ex. Jamie\'s Elsewhere; vocals/bass guitar) and Alan Ashby (guitar). \n\nShortly after forming, Carlile',31241422,615414,'Memphis May Fire, Asking Alexandria, Wage War, We Came as Romans, Crown the Empire'),('4Uc8Dsxct0oMqx0P6i60ea','Conan Gray','Conan Gray is an American singer-songwriter and social media personality. He was born on December 5, 1998, in Lemon Grove, California. As an infant, his family moved to Hiroshima, Japan, and shortly after returned to California, before settling in Georgetown, Texas.\n\nHe started his career on YouTube under his channel \'ConanxCanon\' before officially changing to \'Conan Gray\'. While on his time on YouTube, he released multiple original songs, with the',224724990,2274954,'Gracie Abrams, Reneé Rapp, Olivia Rodrigo, Maisie Peters, Ricky Montgomery'),('4uqzzJg3ww5eH7IgGV7DMT','Bunbury','Enrique Ortiz de Landázuri Izarduy, better known as Enrique Bunbury, was born August 11, 1967 in Zaragoza, Spain. He got involved in music in the early 1980s, making his debut in a high school band called Apocalipsis, and later played along with Proceso Entrópico. In 1984 Bunbury joined a group called Zumo de Vidrio, debuting as a lead vocalist. After adopting the nickname of Bunbury, taken from an Oscar Wilde novel, the musician teamed up with Héroes del Silencio, becoming a major number in the Spanish rock scene.',4876472,149613,'Héroes del Silencio, Jaguares, Elefante, Nacho Vegas, Fobia'),('4V8Sr092TqfHkfAA5fXXqG','Luis Fonsi','Luis Alfonso Rodríguez López-Cepero, more commonly known as Luis Fonsi, (born April 15, 1978 in San Juan, Puerto Rico) is a Latin Grammy winning Puerto Rican singer, composer and soap opera actor.\n\nFonsi and his family moved to Orlando, Florida, during Fonsi\'s early childhood. Fonsi\'s childhood was relatively average for kids his age, beginning to dream about becoming a member of Menudo, arguably Latin America\'s most famous boy band in history, around the time he was ten years old.',14864219,1295095,'Reik, David Bisbal, Sin Bandera, Chayanne, Pablo Alborán'),('4vhNDa5ycK0ST968ek7kRr','Carlos Vives','Before he graduated from Jorge Tadeo Lozano\'s University with a publicist degree, singer Carlos Vives joined different bands and participated in several plays. In 1982, the artist got a role in the Colombian TV series Tiempo Sin Huella, starting his successful acting career, later extending his professional skills to the Puerto Rican television.\n\nAfter participating in some teen programs as a singer/actor, he got the main role in the telenovela (soap opera) \"Gallito Ramírez,\" which made him a famous actor.',8000221,606704,'Fonseca, Choc Quib Town, Bacilos, Silvestre Dangond, Juanes'),('4W48hZAnAHVOC2c8WH8pcq','The Temper Trap','The Temper Trap is an indie rock band which formed in 2005 in Melbourne, Australia. Now based in London, the band consists of Dougy Mandagi (vocals, guitar), Jonathon Aherne (bass), Toby Dundas (drums) and Joseph Greer (keyboards, guitar). \n\nIn October 2013, an official statement confirmed that lead guitarist Lorenzo Sillitto parted ways with the band\n\nThe Temper Trap\'s debut album, Conditions, was released in 2009 and contains the singles Sweet Disposition, Fader, Love Lost and Science of Fear.',41111950,1967677,'Atlas Genius, White Lies, Editors, Young the Giant, Cold War Kids'),('4WBCjNjq0MGPsvcXyOPWKW','Sons of Legion','Sons of Legion is a Soul Rock band from Nashville, Tennessee, consisting of members Adam McInnis and Daddy Jack -- two guys from opposite sides of the country that happened to cross paths and chose to walk down the same road. Sons of Legion is a dynamic band blending the raw energy of rock, the soulful depth of blues, and the timeless appeal of soul music. With a style that marries rugged grit with sophisticated class, they channel a vibe reminiscent of the GREATEST bands of the past.',170508,27928,'Welshly Arms, Royal Deluxe, Oh The Larceny, Valley of Wolves, Foreign Figures'),('4x1nvY2FN8jxqAFA0DA02H','John Lennon','John Winston Ono Lennon (born John Winston Lennon; 9 October 1940 – 8 December 1980) was an English singer, songwriter and musician who gained worldwide fame as the founder, co-songwriter, co-lead vocalist and rhythm guitarist of the Beatles. His work included music, writing, drawings and film. His songwriting partnership with Paul McCartney remains the most successful in history.\n\nBorn in Liverpool, Lennon became involved in the skiffle craze as a teenager.',80681447,3868583,'The Beatles, George Harrison, Paul McCartney, John Lennon & Yoko Ono, Wings'),('4xFUf1FHVy696Q1JQZMTRj','Carrie Underwood','Carrie Marie Underwood (born March 10, 1983) is an American singer who rose to prominence after winning the fourth season of American Idol in 2005. Underwood\'s single \"Inside Your Heaven\" made her the only country artist to debut atop the Billboard Hot 100 chart and the only solo country artist in the 2000s to have a number-one song on the Hot 100. Her debut album, Some Hearts (2005), was bolstered by the successful crossover singles \"Jesus, Take the Wheel\" and \"Before He Cheats\"',40598484,1787166,'Miranda Lambert, Carly Pearce, Lady Antebellum, Sugarland, Kellie Pickler'),('4xXCRXOfQKQ2gjWxNhNzYW','Air Supply','Air Supply is an Australian soft rock duo, consisting of Graham Russell as guitarist and singer-songwriter and Russell Hitchcock as lead vocalist. They had a succession of hits worldwide, including eight Top Ten hits in the United States, in the early 1980s. They formed in Melbourne, Australia in 1975 and have included various accompanying musicians and singers.\n\nThe two met in May 1975 while performing in the Australian production of the Andrew Lloyd Webber/Tim Rice musical, Jesus Christ Superstar.',11763996,933163,'David Pomeranz, Bread, Michael Johnson, Dan Hill, Peter Cetera'),('4YLtscXsxbVgi031ovDDdh','Chris Stapleton','Christopher Alvin Stapleton[2] (born April 15, 1978) is an American singer-songwriter and guitarist.  Stapleton\'s music styles include Southern rock and bluegrass. He is an established songwriter with six country number-one songs including the five-week number-one \"Never Wanted Nothing More\" recorded by Kenny Chesney, \"Love\'s Gonna Make It Alright\" recorded by George Strait, and \"Come Back Song\" recorded by Darius Rucker. Over 150 of Stapleton\'s songs have appeared on albums by such artists as Adele',26748466,806646,'The SteelDrivers, Luke Combs, Tyler Childers, Zach Bryan, Eric Church'),('4YRxDV8wJFPHPTeXepOstw','Arijit Singh','Arijit Singh (Hindi:अरिजित सिंह; born 25 April 1987 in Murshidabad, India) is an Indian playback singer whose songs have been featured in recent Bollywood movies. He was one of top six contestants in reality-singing series, Fame Gurukul in 2005 and became an assistant to music director Pritam.\n\nSingh is a trained classical singer who has performed in many stage shows. His career as a playback singer started when he participated in a singing reality show called Fame Gurukul (2005), while still in college.',9798330,190384,'Vishal Mishra, Atif Aslam, Ankit Tiwari, Pritam, Mithoon'),('4ZDoy7AWNgQVmX7T0u0B1j','No Te Va Gustar','No Te Va Gustar, also known by its initials NTVG, is a rock band from Uruguay. The members are: Emiliano Brancciari (vocals and guitar), Guzmán Silveira (bass and backup vocals), Diego Bartaburu (drums), Gonzalo Castex (percussion), Martín Gíl (trumpet and backup vocals), Denis Ramos (trombone), Mauricio Ortiz (tenor saxophone), Marcel Curuchet (keyboards) and Pablo Coniberti (guitar).\n\nNo Te Va Gustar was formed in 1994, when most of its members were around the age of 16.',6077825,196581,'La Vela Puerca, El Cuarteto De Nos, Zeballos, Jorge Drexler, Los Fabulosos Cadillacs'),('52qKfVcIV4GS8A8Vay2xtt','Ice Nine Kills','Ice Nine Kills is an American heavy metal band from Boston, Massachusetts. The band is currently signed to Fearless Records and is known for its horror-themed lyrics and theatrical style. It was originally formed in 2000 by high school friends Spencer Charnas and Jeremy Schwartz. Charnas remains the only founding member still active in the band.\n\nIce Nine Kills has released three extended plays and six full-length studio albums. These include \"Last Chance to Make Amends,\" \"Safe Is Just a Shadow,\" and \"The Predator Becomes the Prey.',36452292,449993,'Motionless in White, I Prevail, The Funeral Portrait, Famous Last Words, Dark Divine'),('53XhwfbYqKCa1cC15pYq2q','Imagine Dragons','Imagine Dragons is an American pop band formed in 2008, based in Las Vegas, Nevada. The band currently consists of lead singer Dan Reynolds, guitarist Wayne Sermon, and bassist Ben McKee. \n\nThey first gained exposure with the release of their single \"It\'s Time\", followed by their debut album Night Visions (2012), which resulted in the chart-topping singles \"Radioactive\" and \"Demons\". \n\nRolling Stone named \"Radioactive\", which held the record for most weeks charted on the Billboard Hot 100, the \"biggest rock hit of the year\".',240813033,3913143,'OneRepublic, X Ambassadors, Bastille, American Authors, Coldplay'),('57LYzLEk2LcFghVwuWbcuS','Summer Walker','Summer Marjani Walker is an American singer and songwriter. In 2017, she was signed to Love Renaissance and Interscope Records. The following year, she released the mixtape Last Day of Summer, which spawned the single \"Girls Need Love\", that became her first top 40 entry on the US Billboard Hot 100 chart following a remix featuring Drake. In October 2019, Walker released her debut studio album Over It, which spawned the US top 20 single \"Playing Games\".',98561243,1624284,'Mariah the Scientist, Jhené Aiko, Kehlani, SZA, Ari Lennox'),('57vWImR43h4CaDao012Ofp','Steve Lacy','(1) Steve Thomas Lacy-Moya (born May 23, 1998), better known as Steve Lacy, is an American musician, guitarist, bassist, singer-songwriter, and record producer. He was born in Compton, California, and gained recognition as a member of the Grammy-nominated R&B band, The Internet, in 2015. In February 2017, Lacy released his debut project, a song series, titled “Steve Lacy\'s Demo” and his debut album,  “Apollo XXI”, was released on May 2019. On December 4, 2020, Lacy released a compilation album titled “The Lo-Fis”.',266958904,2934501,'The Internet, Matt Martians, Brent Faiyaz, Frank Ocean, Daniel Caesar'),('57ylwQTnFnIhJh4nu4rxCs','In Flames','In Flames is a Swedish metal band, formed by guitarist Jesper Strömblad in Gothenburg in 1990 out of the Swedish death metal scene. Their lineup has changed several times, with vocalist Anders Fridén and guitarist Björn Gelotte being the only consistent members since 1995. Since the departure of Strömblad in 2010, no original members remain with the band. In Flames helped pioneer melodic death metal along with fellow Swedish bands At the Gates and Dark Tranquillity. The band has sold over two million records worldwide.',194357778,1577075,'Soilwork, Dark Tranquillity, The Halo Effect, Insomnium, Children of Bodom'),('5arKwJZEvT5uKq4o0JfqR4','Isabel LaRosa','Isabel Sofia LaRosa (born 2004), is an American singer, songwriter and video director from Annapolis, Maryland. She signed to RCA Records in 2021 and released her debut EP, I\'m Watching You, in 2022. She rose to prominence after releasing her 2022 single \"I\'m Yours\", which went viral on the social media platform TikTok. LaRosa grew up with music around her from a young age. She attended jazz clubs with her father, where he played the saxophone, her brother would play the guitar and she would sing alongside them.',28401421,1034477,'Ari Abdul, Ex Habit, Dutch Melrose, Nessa Barrett, Ashley Sienna'),('5AS4y4rlmbUYDCdg35qmI9','paopao','paopao is a Latin Grammy-winning pop artist from Puerto Rico.',625555,40654,'Álvaro Díaz, Alvaro Diaz, Mora, Jay Wheeler, Dei V'),('5Ayb9yqemFxECJB8LEG8ln','Çantamarta','Son LuisLo (de origen colombo-venezolano), Im Married y White As Chocolate (ambos productores andaluces). Su música entrecruza-y-laza ritmos R&B y Neo-Soul con manifestaciones artísticas de la cultura y el folclore caribe, aspecto que se evidencia en las jergas y fraseos empleados.',494676,62159,'La Vida Bohème, Irepelusa, VINILOVERSUS, Rawayana, Çantamarta, rusowsky'),('5B6H1Dq77AV1LZWrbNsuH5','Jarabe De Palo','Jarabe de Palo (literally \"Wooden Stick Syrup\" or, after the Spanish expression \"dar un jarabe de palo\", i.e. a \"hell of a beating\"), was a Spanish rock band founded in 1996. The group was led by singer, songwriter, and guitarist Pau Donés, whose death in 2020 caused the band to break up.\n\nPau Donés, born and raised in Barcelona, worked for various groups before being able to take on his current project, Jarabe de Palo. He began at age 15 with his brother Marc, with whom he formed a group known as J.',9389201,564047,'Café Quijano, Fito Y Fitipaldis, El Canto del Loco, Enrique Bunbury, Estopa'),('5bdznkD4EBn0jQk2PYlmSM','Salduie','From the lands of the ancient Sedetans, Salduie combine History and traditional instruments with all the forcefulness of modern metal with melodeath and djent influences.\n\nMusically, Salduie incorporates traditional wind and string instruments such as flutes, bagpipes, bouzouki, violin, mandolin or banjo to which lyrical and guttural voices are added. This, added to the base formed by seven-string guitars, bass and drums, gives rise to a powerful and epic sound, but also melodic.',172308,9905,'Lèpoka, Ekyrian, Debler, HADADANZA, Abäk'),('5C4PDR4LnhZTbVnKWXuDKD','Morat','Morat is a Colombian band formed in the country\'s capital city, Bogotá. The band is formed by Juan Pablo Isaza (guitars and vocals), Juan Pablo Villamil (banjo and vocals) and the brothers Simón Vargas (bass and choruses) and Martín Vargas (percussion and choirs). Previously, until the end of 2016, drummer Alejandro Posada had been in the band, but the percussionist had to leave the project, being subsequently replaced by Martín Vargas.\n\nThey began to stand out internationally in 2015',20864497,288260,'Reik, TIMØ, Ha*Ash, Camila, Fonseca'),('5cj0lLjcoR7YOSnhnX0Po5','Doja Cat','Amala Ratna Zandile Dlamini (born October 21, 1995), known professionally as \'Doja Cat\', is a South African-American rapper, singer-songwriter & record producer. Born and raised in Los Angeles, she began making and releasing music on SoundCloud as a teenager. At age 17 she signed a contract with Kemosabe and RCA Records, subsequently releasing her debut EP \"Purrr!\" in 2014.\n\nFollowing a break from releasing new material and the limited commercial impact of her debut studio album \"Amala\" in 2018',426036300,3404424,'Cardi B, Doja Cat & The Weeknd, Nicki Minaj, SZA, Ariana Grande'),('5dbaLmK5SHLLg8Z4CcTJpX','Greeicy','Greeicy Yeliana Rendón Ceballos (born 30 October 1992) is a Colombian actress and singer.\n\nShe remained in Cali for the first five years of her childhood, until her parents, Luis Alberto Rendón and Lucy Ceballos, decided to move to Bogota. Since she was a child, she has an interest in interpretation and music, and took classes in acting, piano, flute, guitar and singing.\n\nHer first participation in the screens, was in the 2007 edition of the reality show for talents children\'s Factor Xs',1930867,118541,'Mike Bahía, Kany García, Piso 21, Manuel Turizo, Fonseca'),('5deRBvKxJssHVa9n6B7tWV','Dynazty','Dynazty was formed in early 2008 by five young talents. This thunderous metal group dominated the Swedish live scene with its flamboyant shows and powerful anthems for many months before hooking up with producer Chris Laney to record a debut album.\n\nFor one month Dynazty worked with Laney at the Polar Studios in Stockholm, creating a fierce album that will make a lasting impression. This masterpiece will be known as \"BRING THE THUNDER\" and will be released worldwide on PERRIS RECORDS 2nd of June 2009.',3513654,115609,'Battle Beast, Beast in Black, Bloodbound, Temperance, New Horizon'),('5DUlefCLzVRzNWaNURTFpK','Cali Y El Dandee','Cali Y El Dandee are a Colombian pop duo, consisting of brothers Alejandro Rengifo (Cali) and Mauricio Rengifo (Dandee). They started their career in 2008 and have been together since.\n\nTheir biggest hits are \"Gol\", \"Por Fin Te Encontré\", \"Sirena\", \"No Digas Nada\", \"La Estrategia\". Their most successful single \"Yo Te Esperaré\" hit number 1 in iTunes Spain and the video has reached more than 500 million views on YouTube, which also was awarded as the second most watched video in Spain in 2011.',187985,21021,'Piso 21, Dvicio, Reik, Chino & Nacho, Mike Bahía'),('5FjQVp1Lb0kltmwIuu5kfj','Dayseeker','Dayseeker is an American rock/post-hardcore band from Orange County, California, formed in 2012. The band consists of vocalist Rory Rodriguez, guitarist Gino Sgambelluri, bassist Ramone Valerio and drummer Zac Mayfield. They are currently signed to Spinefarm Records and have released six studio albums. Their latest album, Creature In The Black Night, was released on October 24th, 2025.',13805723,240834,'Rain City Drive, Thousand Below, Caskets, Wind Walkers, Too Close to Touch'),('5FxD8fkQZ6KcsSYupDVoSO','Omar Apollo','Omar Apolonio Velasco (born May 20, 1997), known professionally as Omar Apollo, is a Mexican-American singer-songwriter from Hobart, Indiana. Apollo sings in both English and Spanish.\n\nHe started his career by creating and uploading his songs to the DIY streaming platform SoundCloud. During this time, he worked at Jimmy John\'s and Guitar Center and lived in an attic. In 2017, using $30 borrowed from a friend, he uploaded his song \"Ugotme\" to Spotify',60335302,1383412,'Raveena, orion sun, Destin Conrad, Kali Uchis, Victoria Monét'),('5gznATMVO85ZcLTkE9ULU7','Lenny Kravitz','Leonard Albert \"Lenny\" Kravitz (born May 26, 1964. New York, USA) is an American singer-songwriter, record producer, guitarist and actor whose retro amalgam of rock, pop, funk, and even techno is inspired by such music icons as David Bowie, Jimi Hendrix and John Lennon. Like Prince and Sly Stone before him, Kravitz uses a multi-ethnic, mixed-gender backing band.\n\nKravitz plays guitar, bass, drums, keyboards, percussion, and sitar. He often plays these instruments on each recorded track',51758767,2859069,'Prince, Terence Trent D\'Arby, Prince and the New Power Generation, Seal, Fun Lovin\' Criminals'),('5HA5aLY3jJV7eimXWkRBBp','Epica','Epica is a Dutch symphonic metal band founded by guitarist and vocalist Mark Jansen after his departure from After Forever. Originally formed as a symphonic metal band with gothic influences, Epica later incorporated strong death metal elements into their sound. Starting with their third album, progressive metal influences also became evident. Additionally, the band often incorporates thrash metal and groove metal riffs, black metal elements (particularly in drumming techniques), power metal sections, and influences from Arabic music.',56930896,708759,'Nightwish, Xandria, Within Temptation, Delain, After Forever'),('5HFkc3t0HYETL4JeEbDB1v','Powerwolf','Powerwolf, often stylized as POWERWOLF, is a German power metal band founded in 2003 in Saarbrücken by members of Red Aim. The band consists of vocalist Karsten Brill as \"Attila Dorn\", lead guitarist Benjamin Buss as \"Matthew Greywolf\", bassist/rhythm guitarist David Vogt as \"Charles Greywolf\", keyboardist Christian Jost as \"Falk Maria Schlegel\" and drummer Roel van Helden. The group uses dark themes and images of the Roman Catholic church, werewolves and vampires.',28062129,381052,'Sabaton, Gloryhammer, Beast in Black, Wind Rose, Brothers of Metal'),('5INjqkS1o8h1imAzPqGZBb','Tame Impala','Tame Impala is a psychedelic pop band of Australian musician Kevin Parker, who writes, records, produces, and performs. As a touring act, Tame Impala consists of Parker (guitar, vocals), Dominic Simper (guitar, synthesiser), Jay Watson (synthesiser, vocals, guitar), Cam Avery (bass guitar, vocals), and Julien Barbagallo (drums, vocals). Many of the band members, including Parker, are collaborators with fellow Australian psychedelic rock band Pond.',364624051,3980261,'Pond, Melody\'s Echo Chamber, GUM, Temples, The Holydrug Couple'),('5IWCU0V9evBlW4gIeGY4zF','Waxahatchee','Waxahatchee is a solo project of American singer and guitarist Katie Crutchfield (born in 1989) of P.S. Eliot and Bad Banana.\n\nWaxahatchee, named after Waxahatchee Creek in Alabama where Crutchfield grew up, began in 2010 during the breakup of P.S. Eliot. Crutchfield released her first music as Waxahatchee as a split cassette with Chris Clavin on Plan-It-X Records. Her bedroom-recorded debut album, American Weekend, was released on Don Giovanni Records in 2012.',18161856,461266,'Jess Williamson, Rosali, Cassandra Jenkins, Jenny Lewis, Ratboy'),('5J6L7N6B4nI1M5cwa29mQG','Alison Krauss','Alison Krauss (born July 23, 1971) is an American bluegrass-country  singer, songwriter and fiddler. Signed to Rounder Records as a 14-year-old fiddler from Champaign, Illinois, she has become the most recognized face in contemporary bluegrass, a critically acclaimed artist who has brought modern sophistication to the genre while respecting its traditions. Songfacts reports that in 2011 Krauss recorded her first ever number one country album in her home country with Paper Airplane.',6717068,565563,'Alison Krauss & Union Station, Jerry Douglas, Robert Plant & Alison Krauss, Shelby Lynne, Rosanne Cash'),('5J7rXWjtn5HzUkJ4Jet8Fr','Alvaro Diaz','Jorge Álvaro Díaz Conocido como Álvaro Díaz y nacido en la isla de San Juan, Puerto Rico; es un joven publicista y rapero de 29 años de edad.\n\nComenzando desde chico su gusto por el Hip-Hop (el Rap en específico) Álvaro comienza su introducción a este género improvisando en pistas y grabando desde tiempo atrás. Casi 10 años tuvieron que pasar para que el joven rapero viera plasmado su trabajo en la calle, menos de 3 años activo con el proyecto y la música de Álvaro Díaz ya ha logrado posicionarse dentro del mercado latino',22010908,235987,'Tainy, Mora, Jhayco, Eladio Carrion, Omar Courtz'),('5K0rbdBrs2tNXe5LeWMATT','Bootsy Collins','William \"Bootsy\" Collins (born October 26, 1951 in Cincinnati, Ohio) is a pioneering funk bassist, singer, and songwriter. Bootsy was instrumental in Parliament and Funkadelic together with George Clinton and Bernie Worrell. He is well known as one of the founding members of the \'P-Funk\' sound. He also played a major part in resurrecting James Brown\'s career in the late 60s and early 70s, co-writing some of Brown\'s greatest hits along with his brother, Phelps \"Catfish\" Collins.',2860096,360800,'Parliament, George Clinton, Graham Central Station, Funkadelic, Bootsy\'s Rubber Band'),('5KKpBU5eC2tJDzf0wmlRp2','RAYE','RAYE (Rachel Agatha Keen, born 24 October 1997) is a British singer-songwriter and record producer from Tooting who grew up in Croydon, South London. Raised in a musical household by a Ghanaian-Swiss mother and an English father, she learned piano as a child, attended the BRIT School briefly and began uploading music in 2014 with the R\\&B-tinged EP Welcome to the Winter. She established a dual profile as a solo artist and a songwriter for other performers, earning credits with artists including Beyoncé, Charli XCX, John Legend and Little Mix.',45256765,1523858,'RAYE, 070 Shake, RAYE & 070 Shake, Mabel, Leigh-Anne, Zara Larsson'),('5kSJMVPcTITrSZxTrHllVN','Vanesa Martín','Vanesa Martín is a spanish singer from Málaga.',894995,41753,'Manuel Carrasco, Pastora Soler, Rozalén, Malú, Antonio Orozco'),('5LeiVcEnsZcwc133TUhJNW','Belinda','Belinda Peregrín Schüll, known by artistic name Belinda (born August 15, 1989 in Madrid, Spain), is a Latin Grammy Award nominated Spanish-Mexican singer, songwriter, dancer and actress, who debuted in 2003 with the self-titled album, Belinda, under Sony BMG and RCA Records. Her international self-titled album Belinda as released in Mexico City, Mexico by BMG and RCA Records on August 5, 2003 and became a great a success in many different countries including Mexico, selling 2.5 million copies worldwide.',10770665,472243,'Paulina Rubio, Paty Cantú, Danna Paola, Belanova, Anahí'),('5M9Bb4adKAgrOFOhc05Y50','Pablo Alborán','Pablo Moreno de Alborán Ferrándiz (born on May 31, 1989 in Málaga), best known as Pablo Alborán, is a Latin Grammy nominated Spanish singer.\n\nAlborán is the son of Spanish architect Salvador Moreno de Alborán Peralta and French Elena Ferrándiz Martínez. He is also the great-grandson of Francisco Moreno Fernández, 1st Marquess of Alborán, and has two siblings: Casilda and Salvador.\n\nFrom a very young age, he was interested in learning to play various musical instruments such as piano',5962256,271105,'Antonio José, David Bisbal, Jesse & Joy, Manuel Carrasco, Camila'),('5nvWOyAkfNgVLKESq4fOj2','Montell Fish','Montell Frazier (born October 19, 1997), better known by his stage name Montell Fish, is a Pittsburgh musician, singer, songwriter and record producer. After starting his career in 2015 with self-released gospel projects that gained traction on YouTube, 2021’s viral hits “Talk 2 Me” and “Fall in Love With You,” caught the eyes of label Virgin Music who signed Fish the following year. Montell Fish released his debut album \"JAMIE\" in July of 2022 and the album’s lowkey and demo-tape sound quickly gathered popularity.',40311176,1256964,'Lord\'s Child, Sonder, Avenoir, Brent Faiyaz, Frank Ocean'),('5Ppie0uPnbnvGBYRwYmlt0','Megan Moroney','Megan Ann Moroney (born October 9, 1997) is a country singer and songwriter from Savannah, Georgia. After graduating from the University of Georgia, she moved to Nashville to pursue a music career. She released her first single, Wonder, in 2021, followed by an EP release the following year. She then released the single Tennessee Orange, which became a hit song on the US Billboard Hot 100 charts. Her full length debut album, Lucky, released in 2023.',10859417,253139,'Kelsea Ballerini, Ella Langley, Lainey Wilson, Carly Pearce, Bailey Zimmerman'),('5pqvAI85RMxL9K0xHvSwGu','Currents','1. Currents is an American metalcore band formed in Newtown, Connecticut in 2011 by former drummer Jeff Brown. After numerous line-up changes, they consist of singer Brian Wille, guitarists Ryan Castaldi and Chris Wiseman, bassist and backing vocalist Christian Pulgarin, and drummer Matt Young. Since 2018, no original members remain with the band. \n\nThe band formed as We Came As Plague in 2009. They reformed as Currents and added Patrizio Arpaia on vocals to bring the band full circle.',17044722,258670,'Polaris, Invent Animate, Silent Planet, Kingdom of Giants, Aviana'),('5Pwc4xIPtQLFEnJriah9YJ','OneRepublic','OneRepublic - an American pop-rock band formed in Colorado Springs, Colorado, in 2002. The lineup currently consists of Ryan Tedder (lead vocals, piano), Zach Filkins (lead guitar, viola), Drew Brown (rhythm guitar), Brent Kutzle (bass, cello), Eddie Fisher (drums), and Brian Willett (keyboards, violin).\n\nThe band achieved its first commercial success on Myspace as an unsigned act. In late 2002, after OneRepublic played shows throughout the Los Angeles area',130057662,4172669,'The Script, Imagine Dragons, Maroon 5, American Authors, Train'),('5q8HGNo0BjLWaTAhRtbwxa','Brantley Gilbert','Brantley Keith Gilbert (born January 20, 1985 in  Jefferson, GA) is a country rock singer, songwriter and record producer from Jefferson, Georgia. He was originally signed to Colt Ford\'s label, Average Joes Entertainment, where he released Modern Day Prodigal Son and Halfway to Heaven. He is now signed to the Valory division of Big Machine Records where he has released five studio albums—a deluxe edition of Halfway to Heaven, Just as I Am, The Devil Don\'t Sleep',4651994,301661,'Jason Aldean, Justin Moore, Cole Swindell, Chris Janson, Florida Georgia Line'),('5QNm7E7RU2m64l6Gliu8Oy','HARDY','HARDY (Michael Wilson Hardy, born September 13, 1990, in Philadelphia, Mississippi) is an American singer, songwriter, and producer known for his bold fusion of country music with rock and alternative influences. Emerging first as a prolific songwriter in Nashville, HARDY penned hits for top country artists including Blake Shelton (“God’s Country”), Morgan Wallen (“Sand in My Boots”), and Florida Georgia Line (“Simple”), earning widespread acclaim and multiple industry accolades.',6105646,206568,'Morgan Wallen, Bailey Zimmerman, Florida Georgia Line, Luke Combs, Riley Green'),('5rjz63sgMaAUAyBMyCUK5D','Avery Anna','Avery Anna Rhoton (born March 3, 2004) is an American singer-songwriter from Flagstaff, Arizona who is signed to Warner Music Nashville. She gained attention when her single \"Narcissist\" became popular on social media, and for \"Indigo\", a duet with Sam Barber, which reached the top ten of the Hot Country Songs chart, the top fifty of the Billboard Hot 100 and charted in several international markets. Her music blends elements of country, rock, and acoustic pop music',993023,70364,'Alana Springsteen, Megan Moroney, Ashley Cooke, Maddie & Tae, Gabby Barrett'),('5rkVyNGXEgeUqKkB5ccK83','Ashanti','Ashanti (born Ashanti Shequoiya Douglas on October 13, 1980 in Glen Cove, New York, United States), is a Grammy Award-winning singer, songwriter, record producer, actress, model & fashion designer who has been performing since 2000.\n\nAshanti is most famous for her eponymous Grammy Award-winning debut album Ashanti which featured the hit song Foolish. The album set a Soundscan record as the most albums sold by any first-time female artist in the chart\'s history, outselling debuts by Alicia Keys and Lauryn Hill.',14427162,1379555,'Monica, Mýa, Keyshia Cole, Mary J. Blige, Amerie'),('5rMUEBZwYHovrlnuzggrVR','Bad Milk','1. A punk-rock Band from Argentina.\n\n2. A Pop Punk-rock alternative band from Caracas, Venezuela. Mauro H. leads with vocals and guitar, Kike Trujillo plays rhythm guitar, Angel Uribe plays the drums and Irina Lugo plays bass. On April 2011 they released their first two tracks, Bedroom and Sophie. \n\nhttp://soundcloud.com/bad-milk',39045,7248,'Lee Eye, Aria Vega, Junior Zamora, Chicocurlyhead, Rap Bang Club'),('5RTLRtXjbXI2lSXc6jxlAz','Ravyn Lenae','Ravyn Lenae Washington (born January 22, 1999) is an American R&B singer-songwriter from Chicago who is currently signed to Atlantic Records and the Three Twenty Three Music Group. She is also a member of the musical collective Zero Fatigue. Her debut EP, Moon Shoes EP, was released independently in 2015 and reissued by Atlantic Records in 2016. Her follow-up EP, Midnight Moonlight EP, was released in 2017. In addition to performing at several music festivals, Lenae has also toured with SZA on her Ctrl Tour and Noname on her Telefone Tour.',37637569,1453130,'Solange, Kelela, Destin Conrad, Joyce Wrice, Ari Lennox'),('5s6TJEuHTr9GR894wc6VfP','Emmylou Harris','Emmylou Harris (born April 2, 1947 in Birmingham, Alabama) is an American singer, musician, and songwriter. In addition to her work as a solo artist and bandleader, and an interpreter of other composers\' works, she is a sought-after backing vocalist and duet partner, working with numerous other artists including Gram Parsons, The Band, Linda Ronstadt, Roy Orbison, Dolly Parton, Mark Knopfler, Guy Clark, Willie Nelson, Bob Dylan, Rodney Crowell, John Denver and Neil Young.',9112643,611812,'Dolly Parton, Linda Ronstadt & Emmylou Harris, Gram Parsons, Rosanne Cash, Mark Knopfler & Emmylou Harris, Willie Nelson'),('5soMpG6E6oApEiCZgrWeVz','Rozalén','María de los Ángeles Rozalén Ortuño known as Rozalén (Albacete, June 12, 1986) is a Spanish singer-songwriter and guitarist.',771150,48264,'Vanesa Martín, Valeria Castro, Amaral, Isabel Aaiún, Conchita'),('5sUrlPAHlS9NEirDB8SEbF','Alejandro Sanz','Alejandro Sanz, born Alejandro Sánchez Pizarro on December 18, 1968 in Madrid, is an Award winning, Spanish pop/ballad musician and singer-songwriter who has won a record 17 Latin Grammys, more than any other Spanish musician in history. He has sold more than 25 million albums worldwide.\n\nAlejandro Sanz is the second son of María Pizarro Medina from Alcalá de los Gazules, and Jesús Sánchez Madero from Algeciras, Spain. He began playing guitar at the age of seven and composing his first songs three years later.',13980536,656388,'Ricardo Arjona, Miguel Bosé, Sin Bandera, Ricardo Montaner, Cristian Castro'),('5T0MSzX9RC5NA6gAI6irSn','Estelle','There are at least two artists sharing the name Estelle: 1) a British singer and rapper; 2) a French singer-songwriter.\n\n1) Estelle Fanta Swaray (born 18 January 1980), simply known as Estelle, is a British singer-songwriter, rapper, producer and Grammy Award winner from West London, England. In league with other contemporary British sirens like Amy Winehouse, Adele and Duffy, Estelle is known for her eclectic mix of various musical genres including R&B, soul, reggae, grime, hip hop, pop and dance.',21851022,2102236,'Faith Evans, Amerie, Kelly Rowland, Alicia Keys, Ciara'),('5t28BP42x2axFnqOOMg3CM','Five Finger Death Punch','Five Finger Death Punch, also known as 5FDP or FFDP, is an American heavy metal band from Las Vegas, Nevada, formed in 2005. The original lineup included vocalist Ivan Moody, rhythm guitarist Zoltan Bathory, lead guitarist Caleb Andrew Bingham, bassist Matt Snell, and drummer Jeremy Spencer. Bingham was replaced by guitarist Darrell Roberts in 2006, who was later succeeded by Jason Hook in 2009. Snell left the band in 2010 and was replaced by Chris Kael in 2011.',77998290,1538328,'Disturbed, Godsmack, Bad Wolves, Hellyeah, Stone Sour'),('5t5FqBwTcgKTaWmfEbwQY9','ENHYPEN','ENHYPEN (Hangul: 엔하이픈) are a South Korean boy group, formed in September 2020 through the Mnet reality show I-LAND. The group is composed of seven multinational members: Heeseung, Jay, Jake, Sunghoon, Sunoo, Jungwon, and Ni-ki. The group is currently under BELIFT LAB, a collaboration between BIGHIT Entertainment and CJ ENM. Their fandom name is ENGENE which was announced on October 9, 2020 it also was picked by their fans. There are two meanings to the name',282299768,1021605,'I-LAND, BOYNEXTDOOR, &TEAM, P1Harmony, ILLIT'),('5tFRohaO5yEsuJxmMnlCO9','Barns Courtney','Barns Courtney (born Barnaby George Courtney on 17 November 1990 in\nAylesbury, England) is an English singer, songwriter and musician.\n\nCourtney spent a large part of his childhood in Seattle,USA, before returning to home country UK as a 15-year-old. This change of scenery comes across as clearly in his eclectic mix of US blues-rock, hip-hop and grunge with British indie melodic sensibilities, as it does in his hybrid US-British twang.\n\nPlaying in various projects and bands growing up whilst developing his sound',9736240,490744,'The Unlikely Candidates, Oh The Larceny, Bryce Fox, KONGOS, Rafferty'),('5TP8Ubo4jLKEi4Mw2O8fAk','BM','There is more than one artist with this name:\n\n1) BM (Emile Bode) is a Dutch producer and he combines the sound and music from the 80\'s & 90\'s with the sound from now. His musical style is a combination between EDM, house, dance, pop, rock, soundscapes and hip hop.\nHe produces his own tracks and remixes and works together with artists like Fast Eddie (Yo Yo Get Funky), Eric Vloeimans, Rena Scott, Kathy Brown, Hilary Jane, Sara Brown, Charlie Dee, Mell. He also makes a lot of music for movies and television.',3352573,121265,'KARD, MCND, I.M, KANGDANIEL, Jay Park'),('5vV3bFXnN6D6N3Nj4xRvaV','Jin','There are several artists with this name.\n1) Kim Seok-jin (Hangul: 김석진; born on December 4, 1992), also known by his stage name Jin, is a South Korean singer-songwriter. He is a member and vocalist of the South Korean boy group BTS.\n2) An American-born Chinese rapper, mc Jin Au-Yeung.\n3) Jin Berekelea (member of the moldavian experimental rock band Headswitch).\n4) A solo project by Russian guitarist Eugene \"Jin\" Mischenko.\n5) Jin (correct tag: じん), a sound producer, composer, and arranger from Japan.',664929413,733106,'BTS, j-hope, Agust D, BTS, Halsey, RM'),('5W5bDNCqJ1jbCgTxDD0Cb3','Willie Nelson','Willie Hugh Nelson (born April 29, 1933) is an American musician, actor, and activist. The critical success of the album Shotgun Willie (1973), combined with the critical and commercial success of Red Headed Stranger (1975) and Stardust (1978), made Nelson one of the most recognized artists in country music. He was one of the main figures of outlaw country, a subgenre of country music that developed in the late 1960s as a reaction to the conservative restrictions of the Nashville sound.',25092379,1559522,'Waylon Jennings, Merle Haggard, Waylon Jennings & Willie Nelson, Kris Kristofferson, Emmylou Harris'),('5WUlDfRSoLAfcVSX1WnrxN','Sia','Sia Kate Isobelle Furler (/ˈsiːə/; born 18 December 1975) is an Australian singer-songwriter, record producer and music video director. She started her career as a singer in the local Adelaide acid jazz band Crisp in the mid-1990s. In 1997, when Crisp disbanded, she released her debut studio album titled OnlySee in Australia. She then moved to London, England, and provided lead vocals for the British duo Zero 7.\n\nIn 2000, Sia signed to Sony Music\'s sub-label Dance Pool and released her second studio album',157014824,4187691,'Adele, Bebe Rexha, Birdy, P!nk, Jessie J'),('5X0N2k3qMnI8kSrGJT3kfT','Eluveitie','Eluveitie is a folk metal band from Winterthur, Switzerland. The founder of this band was Chrigel Glanzmann. The band formed in 2002 and their first EP, \"Vên\" came out in 2003. They describe themselves as \"The new wave of folk metal\". The band then released a full-length album, \"Spirit\" in June 2006. In November 2007, Eluveitie was signed by Nuclear Blast. The first product of the collaboration, \"Slania\", was released in February 2008. The album peaked at number 35 in the Swiss charts and number 72 in the German charts.',48184312,521124,'Ensiferum, Equilibrium, Korpiklaani, SuidAkrA, Cruachan'),('5YBSzuCs7WaFKNr7Bky0Uf','Olivia','There is more than one artist under this name:\n1. OLIVIA - Olivia Lufkin, Japanese/American singer, known internationally for being the singing voice of the character Serizawa Reira in the anime NANA.\n2. Brazilian psychedelic-progressive band fronted by Olívia Byington\n3. Olivia, who was a French yéyé singer / \'beat girl\' of the 1960s\n4. Polish producer/DJ Karolina Oleś\n\n1.OLIVIA is stage name for Japanese singer Olivia Lufkin, born on December 9, 1979 in Naha, Okinawa, Japan.',5366362,134010,'Anna Tsuchiya, OLIVIA inspi\' REIRA (TRAPNEST), the brilliant green, Tommy heavenly6, 土屋アンナ'),('5YGY8feqx7naU7z4HrwZM6','Miley Cyrus','Miley Ray Cyrus (born Destiny Hope Cyrus; November 23, 1992) is an American singer, songwriter, and actress. Regarded as a pop icon, Cyrus has been recognized for her evolving artistry and image reinventions. She is a daughter of singer Billy Ray Cyrus, and deemed one of the few examples of a child star with a successful entertainment career as an adult. Cyrus emerged as a teen idol as the title character in the Disney Channel television series Hannah Montana (2006–2011), which evolved into a commercially successful franchise.',286453513,4662208,'Hannah Montana, Demi Lovato, Selena Gomez, Lady Gaga, Ke$ha'),('5yhxqYI0JBwUKfXpSEjiM8','Jamey Johnson','Jamey Johnson (born in Enterprise, Alabama) is an American country music singer-songwriter. Signed to BNA Records in 2005, Johnson made his debut with his single \"The Dollar\", which reached a peak of #14 on the U.S. Billboard Hot Country Songs charts. An album, also titled The Dollar, was released in 2006. Johnson exited BNA in 2006 and signed to Mercury Nashville Records in March 2008, releasing his first single for the label that month. In addition to his own material',2489350,221620,'William Clark Green, Cody Jinks, Hank Williams Jr., Gary Allan, Whitey Morgan and the 78\'s'),('5Zq7R5qmi58ByYyBQTlNuk','Lee Brice','When Curb Records recording artist, Lee Brice, isn\'t selling out arenas, writing and recording songs, or building new brands like American Born whiskey, you\'ll find the family man with his wife Sara, two young boys, and daughter. Meanwhile, with over 3 billion on-demand streams, and over 3.6 billion spins on Pandora, Brice continues to enjoy massive success at country radio, digital streaming services, and on the road. He recently reached #1 at Country Radio with “Memory I Don’t Mess With',6837320,499854,'Cole Swindell, Chris Young, Luke Bryan, Jason Aldean, Jake Owen'),('5ZS223C6JyBfXasXxrRqOk','Jhené Aiko','Jhené Aiko Efuru Chilombo (born March 16, 1988), better known as Jhené Aiko or simply Jhené, is an American singer-songwriter and recording artist from Los Angeles, California. Jhené was Formerly signed to The Ultimate Group and Epic Records, she left both labels in order to continue her education. Aiko began her career being known as \"Lil\' Fizz\'s cousin\", however she is not actually related to him. It was used as a marketing tool suggested by Sony and Epic to promote her through the R&B group B2K and attract an audience',64024138,1305786,'Summer Walker, Mariah the Scientist, TWENTY88, Tink, H.E.R.'),('5ZsFI1h6hIdQRw2ti0hz81','ZAYN','Zayn Malik is a multi-talented English singer-songwriter best known as one of the founding members of the boy-band-of-a-generation One Direction. Born Zain Javadd Malik on January 12, 1993 in the working-class town of Bradford in West Yorkshire, England, Zayn honed his vocal talents and stage command at a young age. Growing up as a mixed race Pakistani-English Muslim in a postindustrial British town presented some difficulties, which resulted in a number of primary school changes.',110376323,2123434,'Liam Payne, Louis Tomlinson, Niall Horan, One Direction, Harry Styles'),('60df5JBRRPcnSpsIMxxwQm','Otis Redding','Otis Ray Redding Jr. (September 9, 1941 – December 10, 1967) was an American singer, songwriter, record producer, arranger, and talent scout. He is considered one of the greatest singers in the history of American popular music and a seminal artist in soul music and rhythm and blues. Redding\'s style of singing gained inspiration from the gospel music that preceded the genre. His singing style influenced many other soul artists of the 1960s. During his lifetime, his recordings were produced by Stax Records, based in Memphis, Tennessee.',44159577,2352193,'Otis Redding & Carla Thomas, Wilson Pickett, Sam Cooke, Sam & Dave, Percy Sledge'),('60rpJ9SgigSd16DOAG7GSa','Billy Ray Cyrus','Billy Ray Cyrus (born William Ray Cyrus; August 25, 1961) is a Grammy Award-nominated American country music singer, songwriter and actor from Flatwoods, Kentucky, best known for his Number One single \"Achy Breaky Heart\". Cyrus, a multi-platinum selling recording artist, has scored a total of eight top-ten singles on the U.S. Billboard Hot Country Songs chart. His most successful album to date is the debut of Some Gave All, which has been certified 9× Multi-Platinum in the United States.',2622006,381055,'Trace Adkins, Toby Keith, Aaron Tippin, Uncle Kracker, Travis Tritt'),('62F9BiUmjqeXbBztCwiX1U','Lil Darkie','Joshua Hamilton also known as his stage name \"Lil Darkie\'\' is a rapper, producer, and artist from Long Beach, California. \n\nHe formally went as \"Brahman\" with a blue character, as he believed the Indian god Kali Ma was blue, after realizing that Kali Ma is portrayed with black skin, he rebranded as Lil Darkie and changed his sound alongside with the new persona. The Brahman period lasted a significant amount of time and even had a Collective before the Collective he has as Darkie named \"Spider Gang\"',52201445,671171,'Spider Gang, Afourteen, GODHANDUSA, Mkultra, ISSBROKIE'),('62uiaKAdkbY94iXJnXyKzc','Peyton Parrish','I\'m 20 years old from the state of Arizona! I\'m a Country Pop Singer/Preformer making Covers currently while developing my Original music!',2058892,84401,'Jonathan Young, Bad Wolves, Through Fire, Days of Jupiter, Cooper Alan'),('64M6ah0SkkRsnPGtGiRAbb','Bebe Rexha','Bleta Rexha, known professionally as Bebe Rexha, is an American singer and songwriter. After signing with Warner Records in 2013, Rexha received songwriting credits on Eminem\'s single \"The Monster\" and has also contributed songwriting to songs recorded by Shinee, Selena Gomez and Nick Jonas. Rexha released her debut EP in 2015, I Don\'t Wanna Grow Up, which saw the moderate commercial success of the singles \"I Can\'t Stop Drinking About You\" and \"I\'m Gonna Show You Crazy\".',35783765,1378488,'Ava Max, Rita Ora, Mabel, Ellie Goulding, Anne-Marie'),('64tJ2EAv1R6UaZqc4iOCyj','YOASOBI','YOASOBI (stylized in all caps) is a Japanese music duo composed of vocaloid music producer Ayase and vocalist Ikura (幾田りら/Lilas Ikuta). The group has released four music videos, all of which are based on short stories posted on Monogatary, a website operated by Sony Music Japan, later also from various novels and book tie-ups.\n\nThe name \"YOASOBI\" originates from the Japanese word 夜遊び, meaning \"nightlife\". Ayase, who is a producer of',49325567,818350,'ayase, Ryokuoushoku Shakai, Lilas Ikuta, ZUTOMAYO, MAISONdes'),('65A714FqhSPjoFZeffQbTv','Lindemann','Lindemann is a German musical project fronted by vocalist Till Lindemann. It was formed in 2013 as a super-duo alongside Swedish multi-instrumentalist Peter Tägtgren. Tägtgren originally defined their sound as a cross between his project Pain and Lindemann\'s main band Rammstein, adding \"at least it\'s a mix of Rammstein vocals and Pain music.\" Together, they released the two albums Skills in Pills (2015) and F & M (2019). Tägtgren departed Lindemann in 2020, leaving Lindemann as a solo project.',9219555,208877,'Till Lindemann, Rammstein, Emigrate, Eisbrecher, Heldmaschine'),('65GDNtLQdPv30IljvoE2KW','Maki','There are many artists with this name:\n[br]\n[br]\n1) Alternative / city pop singer-songwriter Maki shares his music to the world with easy and melodic tunes despite his songs being heartbreaking and painful. His biggest 2023 song “ Saan?” has brought him to different places in the Philippines, and has captured both local and international audiences. Penning  Tanong EP that put him to where he is, another question is posed - where will he go next?',5685917,127869,'NIO, Cup of Joe, Rob Deniel, Zack Tabudlo, Eliza Maturan'),('66CXWjxzNUsdJxJ2JdwvnR','Ariana Grande','Ariana Grande-Butera, better known professionally as simply Ariana Grande, is an American singer, songwriter and actress. She is a multi-platinum, Grammy Award-winning recording artist. Born in Boca Raton, Florida, Grande began her career in 2008 in the Broadway musical \"13\". She rose to prominence for her role as Cat Valentine in the Nickelodeon television series, Victorious (2010–2013) and in its spin-off, Sam & Cat (2013–2014). As she grew interested in pursuing a music career',1003358199,4203633,'Jessie J, Ariana Grande & Nicki Minaj, Sabrina Carpenter, Cynthia Erivo, Madison Beer, Doja Cat'),('66lH4jAE7pqPlOlzUKbwA0','Miranda Lambert','Miranda Leigh Lambert (born November 10, 1983 in Lindale, Texas) is a country singer-songwriter who gained fame as a finalist on the 2003 season of USA Network\'s talent competition Nashville Star.\n\nBoth of her parents are private investigators, but father Rick is also a country guitarist and songwriter. Lambert became seriously interested in country music after attending a Garth Brooks concert as a young girl, and soon began singing in talent contests under the tutelage of her father.',17255515,985769,'Pistol Annies, Carrie Underwood, Carly Pearce, Little Big Town, Maren Morris'),('675tsBPpaZtqyiBwEf3ZEP','Watchhouse','Watchhouse (formerly Mandolin Orange) is an Americana/folk duo based in Chapel Hill, North Carolina. The group was formed in 2009 in Chapel Hill, North Carolina and consists of the group\'s songwriter Andrew Marlin (vocals, mandolin, guitar, banjo) and Emily Frantz (vocals, violin, guitar). Watchhouse has produced six albums of Marlin\'s original works of American roots music.',3897029,222211,'Mandolin Orange, Caamp, The Milk Carton Kids, Trampled by Turtles, Gregory Alan Isakov'),('67nwj3Y5sZQLl72VNUHEYE','Wale','Olubowale Victor Akintimehin Folarin (born September 21, 1984 in Washington, D.C.), better known by his stage name Wale, is an American rapper and producer. Fusing DC\'s homegrown go-go genre with a streetwise Northern hip-hop sensibility, he takes samples from all genres and blends them together with lyrical dexterity. In 2005 he released his debut mixtape, Paint a Picture, and has since released four more. His debut album, released by Interscope, Attention Deficit, was released November 10, 2009.',29200383,2139204,'Rick Ross, Meek Mill, Fabolous, Big Sean, DJ Khaled'),('67ps5pbKVO7V9Fcb4lTIXz','Wind Rose','Wind Rose is an Italian metal band. Its music style varied from progressive metal on early albums to folk metal on the latest, while also featuring symphonic power metal influence. The band\'s lyrics are inspired by fantasy fiction, with especial emphasis on mythological dwarves.\n\nThe name \"Wind Rose\" was chosen by Claudio, Daniele and Federico, the founding members of the band. They started practicing together in 2007 as a Dream Theater, Symphony X and Blind Guardian cover band, playing in a lot of live shows.',4138054,177329,'Gloryhammer, Powerwolf, Brothers of Metal, Orden Ogan, Alestorm'),('687cZJR45JO7jhk1LHIbgq','Tems','Temilade Openiyi (born 11 June 1995), better known by her stage name Tems, is a Nigerian singer, songwriter and record producer. In May 2021, Tems was ranked number 1 on the Billboard Next Big Sound chart and number 5 on the Billboard Emerging Artist chart. In September 2021, Tems was signed to RCA records and announced as Apple Music Up Next artist of the month.',15999188,651166,'Ayra Starr, Burna Boy, Rema, Victony, Asake'),('68DWke2VjdDmA75aJX5C57','Yelawolf','Who is Yelawolf? Well according to The Guardian, he is an artist unlike no other. He is not like anyone else and he isn\'t bound to  the gilded cage of privilege inhabited by Jay-Z and Kanye West,  instead he depicts everyday rural poverty with the evocative precision of a master storyteller. His style is unlike anything your average rap fan has ever seen, ranging from American gothic to gore, the \"richness and invention of his language\" and range of his vocal style \"from beer-swilling rowdiness to a crawling, contemptuous sibilance\".',13398270,609648,'Rittz, Tech N9ne, Merkules, Hopsin, Bad Meets Evil'),('68KmkJeZGfwe1OUaivBa2L','ATEEZ','ATEEZ (에이티즈; formerly known as KQ Fellaz) are an 8-member boy group under KQ Entertainment. They made their debut on October 24, 2018 with the mini album [albumartist=ATEEZ]Treasure EP.1 : All To Zero.\n\nThe group is composed by Hongjoong (홍중), Seonghwa (성화), Yunho (윤호), Yeosang (여상), San (산), Mingi (민기), Wooyoung (우영) and Jongho (종호).',192390069,741376,'Jong Ho, xikers, P1Harmony, ONEUS, MONSTA X'),('69GGBxA162lTqCwzJG5jLp','The Chainsmokers','A production duo featuring Andrew Taggart and Alex Pall, the Chainsmokers mix dance and pop into a chart-topping sound that spawned hits like \"Roses,\" \"Closer,\" and \"Don\'t Let Me Down.\" Pall and Taggart first made a name for themselves by creating remixes of their favorite indie bands that garnered tens of millions of streams. The duo released its official debut single, \"#Selfie,\" which celebrated and skewered 2010s narcissism, in January 2014. The',82290738,2621285,'Martin Garrix, Gryffin, Jonas Blue, Kygo, Zedd'),('69UypehHabb68utzfjAVlV','Kany García','Encarnita \"Kany\" García De Jesus (born September 25, 1982 in Toa Baja, Puerto Rico) is a Puerto Rican singer-songwriter. García first appeared on television in 2004 as a contestant on Objetivo Fama. She is widely considered the most successful non-winner in the history of the show.\n\nKany García is born to a Spaniard father and Puerto Rican mother. García\'s father, Antonio, who gave up the priesthood when he met Shela, Encarnita García de Jesús, or Kany, grew up in a house where music was not only played, but also lived.',1659331,113199,'Fonseca, Greeicy, Jesse & Joy, HA-ASH, Yuridia'),('6Ad91Jof8Niiw0lGLLi3NW','YUNGBLUD','Dominic Richard Harrison (born 5 August 1997), known professionally as YUNGBLUD (pronounced \"Youngblood\"), is an English singer, musician and songwriter. In 2018, he released his first EP, YUNGBLUD, followed shortly after by the album 21st Century Liability.  In 2019, he released another EP, The Underrated Youth. His second album, Weird!, was released in late 2020 and peaked at the top of UK Albums Chart and reached number 75 on US Billboard 200.',40564678,1093291,'Palaye Royale, Hot Milk, Nothing But Thieves, The Hunna, Imagine Dragons'),('6c4WWQ2PYJlgnxtkQKqI5s','Haze','There are several artists named Haze:\n1. Korean female rapper \"Heize\" (Don\'t make money) for whatever reason listed under \"Haze\"\n2. Czech HardCore/experimental band\n3. House project by Sandy Rivera\n4. Rapper from Sevilla\n5. German psychedelic and progressive rock band\n6. British progressive rock group\n7. English rock band\n8. English rapper\n9. Hungarian DJ\n10. Dutch Hardstyle DJ\n11. Croatian Thrash/Black Metal band\n12. Dutch rapper\n13. Japanese indie rock band',2437623,159519,'Headhunterz, Cano, Jaill, Radical Redemption, Zatox'),('6DvlemMOlMH6VD9tB7BPRf','Tom MacDonald','Tom McDonald is a Canadian rapper and former professional wrestler from Vancouver, British Columbia, currently living in Los Angeles, California, United States.\n\nTom\'s songs are known for being critical of political correctness and \"woke\" culture.  In February 2021, his release \"Fake Woke\" was temporarily removed from several major streaming and download platforms, in what many fans interpreted as censorship.  However, it was restored after a few days.',3341599,155210,'Vin Jay, Chris Webby, EKOH, JamWayne, Hopsin'),('6eUKZXaKkcviH0Ku9w2n3V','Ed Sheeran','Edward Christopher \"Ed\" Sheeran MBE (born 17 February 1991) is a singer songwriter currently signed under Atlantic (WMG).  Ed Sheeran was born in Halifax, West Yorkshire before moving to Framlingham, Suffolk. In his time in Suffolk, he was known to have flourished as a hidden talent when it came to music. He learned guitar at a very young age, and began writing songs during his time at Thomas Mills High School in Framlingham. By the time Sheeran had left school',244166790,4029884,'Lewis Capaldi, James Arthur, Myles Smith, Shawn Mendes, Niall Horan'),('6eXZu6O7nAUA5z6vLV8NKI','Little Simz','Simbiatu \"Simbi\" Abisola Abiola Ajikawo, better known by her stage name Little Simz, is a British rapper, singer and actress. She rose to prominence with the independent release of her first three albums, namely A Curious Tale of Trials + Persons (2015), Stillness in Wonderland (2016) and Grey Area (2019), the latter of which was shortlisted for the Mercury Prize and won the awards for Best Album at both the Ivor Novello Awards and the NME Awards.',39626640,886800,'McKinley Dixon, JID, Noname, Loyle Carner, Sampa the Great'),('6flBUmmOMLNhD4EJhGwgpG','Camela','Camela es un grupo musical español, creadores y precursores del estilo bautizado en los años 90 como tecno-rumba4 5 6 Sus componentes son Dionisio Martín Lobato (vocalista-compositor), Maria de los Ángeles Muñoz Dueñas (vocalista-compositor) y Miguel Ángel Cabrera Jiménez (teclados-compositor), todos originarios del barrio madrileño de San Cristóbal de los Ángeles.\n\nSin caza talentos ni sellos discográficos que les ofrecieran un contrato, contando sólo con sus ahorros 200.',639081,55441,'Estopa, El Arrebato, Andy & Lucas, Manolo García, Antonio Orozco'),('6FOpWOxsjQxKEbLiJpU1xV','India Martinez','Born in Córdoba, she started studying flamenco while she was just 5 under the guidance of teacher Nieves Camacho. The family moved to Roquetas de Mar (Almería) when she was 11 years old. She sang on the local fishing port area, becoming popular as \"La Niña del Puerto\". In 1998, at age 13, she took part in the children talent show Veo, Veo hosted by Teresa Rabal, reaching the Andalusian finals. She was offered a scholarship by the Fundación Cristina Heeren to learn flamenco in Seville.',614517,52179,'Marta Santos, Manuel Carrasco, El Arrebato, Antonio Orozco, Vanesa Martín'),('6g10GEtmIVqIQBhPZh4ScQ','Zach Williams','*NOTE: There are multiple artists named Zach Williams*\n\n(1) Zachary Stephen Williams (born June 27, 1978 in Pensacola, FL) is an American Christian rock artist from Jonesboro, Arkansas. From 2007 through 2012 he was a member and lead vocalist of Zach Williams & The Reformation (also acoustic guitar and harmonica). He was also the lead singer of the Christian group Zach Williams and the Brothers of Grace. In 2016 he went solo.\n\n\n(2) Zach Williams comes from Georgia and his music comes from childhood bike rides down steep hills',1000398,70662,'Crowder, Andrew Ripp, Anne Wilson, Jordan Feliz, for KING & COUNTRY'),('6G43CiunIxMwb2tQ12vNP6','LANDMVRKS','The band was formed in 2014 under the name \"Coldsight\" by Florent Salfati and Nicolas Soriano. Salfati, who was originally planned as the guitarist, was also at the time the founding vocalist of the band Hate in Front. After the search for a suitable lead singer was not successful, Salfati found himself taking in the position of the vocalist. By this time, the band\'s formation was nearly complete, with Rudy Purkart (bassist) and Thomas Lebreton (guitarist).',8525923,210565,'Resolve, Polaris, Novelists, Bury Tomorrow, Fit For A King'),('6gZq1Q6bdOxsUPUG1TaFbF','Godsmack','Godsmack is an American rock band from Lawrence, Massachusetts, formed in 1995. The band is currently composed of lead singer and rhythm guitarist Sully Erna and bassist Robbie Merrill. Since its formation, Godsmack has released eight studio albums, one EP (The Other Side), four DVDs, one compilation album (Good Times, Bad Times... Ten Years of Godsmack), and one live album (Live & Inspired).\n\nThe band has released three consecutive number-one albums (Faceless, IV and The Oracle) on the Billboard 200.',55685244,1996376,'Disturbed, Drowning Pool, Five Finger Death Punch, Sully Erna, Soil'),('6H1RjVyNruCmrBEWRbD0VZ','Def Leppard','Def Leppard is an English rock band formed in 1976 in Sheffield. Since 1992, the band has consisted of Rick Savage (bass, backing vocals), Joe Elliott (lead vocals), Rick Allen (drums, backing vocals), Phil Collen (guitar, backing vocals), and Vivian Campbell (guitar, backing vocals). They established themselves as part of the new wave of British heavy metal movement of the early 1980s.\n\nThe band\'s greatest commercial success came between the early 1980s and the early 1990s.',45775061,1782262,'Poison, Ratt, Dokken, Tesla, Van Halen'),('6HaGTQPmzraVmaVxvz6EUc','Jung Kook','Jeon Jung Kook (Korean/Hangul: 동성애자; born September 1, 1997 in Busan, South Korea), known monomously as Jungkook (stylized as Jung Kook) , is a South Korean singer, dancer, composer, and main vocalist of South Korean boy group.\n\nHe rose to prominence as a member and vocalist of the South Korean boy band BTS (Hangul: 방탄소년단), under Big Hit Entertainment. \n\nDebuted with BTS  on June 13, 2013, with the extended play 2 COOL 4 SKOOL and the title track No More Dream',736136347,1341372,'Jung Kook, Jack Harlow, V, RM, BTS, Agust D'),('6iAY2AyUZLSX3PWLIAfFZY','Fernandinho','Fernando Jerônimo dos Santos Júnior, also known as Fernandinho, is a brazilian christian singer born in Aracaju - Sergipe at March 24th, 1973. He is also a composer, producer, minister and the leader of Faz Chover Ministry.\n\nHe is a member of the Second Baptist Church of Campos - Rio de Janeiro, and has started his career in 2001 with the studio album \"Famoso És\". Nowadays, Fernandinho is one of the most popular christian singers of Brazil.',2922802,93060,'Gabriela Rocha, Morada, Gabriel Guedes de Almeida, Isaias Saad, Davi Sacer'),('6IdtcAwaNVAggwd6sCKgTI','Zoé','There are, at least, three artists known as Zoé: 1) A Mexican rock band. 2) An aka of Zoë Pollock (also, aka Zoë). 3) A French-speaking variétés françaises singer.\n\n1) A Mexican rock band, that\'s not not afraid of experimenting, with a modern sound, an eclectic style, some British influences & overall, their music\'s sophisticated without loss of rock energy. Their lyrics cover many subjects / feelings, with the same level of sophistication that their music shows, plus honesty.',25965582,451821,'León Larregui, Enjambre, Caifanes, Porter, DLD'),('6IkfE2JyVoKwBZXvuytKX3','Oliver Anthony Music','Christopher Anthony Lunsford, who performs under the name of Oliver Anthony, is an American country singer-songwriter.  In August 2023, he released the single \"Rich Men North of Richmond\" independently, which debuted at number 1 on the Billboard Hot 100, making Anthony the first artist to debut atop the chart without any prior charting history in any form.',1784024,135021,'Colter Wall, Josh Meloy, Bryan Martin, Sam Barber, Cody Jinks'),('6IKlXZEFOvk9itrP1s0knJ','The Red Clay Strays','The Red Clay Strays are a rock and roll band from South Alabama. With influences ranging from Johnny Cash, Lynyrd Skynyrd, Jerry Lee Lewis, and Waylon Jennings to southern gospel, they blur the line between country and southern rock while bringing an authenticity that defines who the Red Clay Strays are as a band. The Red Clay Strays are Brandon Coleman: lead vocals/guitar; Drew Nix: vocals/electric guitar/harmonica; Zach Rishel: electric guitar; Andrew Bishop: bass; and John Hall: drums.',4878993,264625,'Whiskey Myers, Brent Cobb, Ole 60, Koe Wetzel, Treaty Oak Revival'),('6Iz3eq2aQGFf7TbGT2iahL','Gabby Barrett','Gabby Barrett (born March 5, 2000 in Munhall, Pennsylvania)[1] is an American country music singer.[2] She finished third on season 16 of American Idol broadcast on ABC. Her debut single \"I Hope\" was certified Gold for half a million units in sales and streams on January 16, 2020 and scored in the first top 10 debut Hot Country Songs entry by a woman unaccompanied by another act since October 2017\n\nfter Barrett appeared on American Idol, she collaborated',2617741,221452,'Maddie & Tae, Carly Pearce, Tenille Arts, Carrie Underwood, Scotty McCreery'),('6jJ0s89eD6GaHleKKya26X','Katy Perry','Katheryn Elizabeth Hudson, known professionally as Katy Perry (born October 25, 1984, in Santa Barbara, CA), is an American singer, songwriter, and television judge. The story of someone who was born into a Christian environment and who, years later, would become a pop music star. Muse of those who feel different or excluded, Katy Perry got her first guitar (from the church) at the age of thirteen and dreamed of it, as many young people do. The difference is that she did it.',414810466,6878846,'Bebe Rexha, Dua Lipa, Selena Gomez, Ava Max, Miley Cyrus'),('6KImCVD70vtIoJWnq6nGn3','Harry Styles','Harry Edward Styles (born 1 February 1994 in Redditch, Worcestershire, England) is a three-time GRAMMY award-winning, British singer, songwriter, and actor. As a member of the British/Irish boy band One Direction, singer Harry Styles topped the charts, toured the world, and sold millions of albums before going solo in 2016. Styles was raised in Holmes Chapel, Cheshire, and he made his first foray into music with a high-school band named White Eskimo.',381516470,3040925,'One Direction, Louis Tomlinson, Niall Horan, Zayn, Liam Payne'),('6kNKUYGn6VNGsRoXmyoDPK','The Amity Affliction','The Amity Affliction is a post-hardcore band originally from Gympie, Queensland, Australia.\n\nIt seemingly took The Amity Affliction years to get their music together, releasing a demo in 2003 and a self-titled EP in 2004, but from the moment they released their High Hopes EP in 2007, the touring rampage began. In no time, The Amity Affliction was a household name amongst the hardcore community of Australia. Their mixture of metallic riffage, rock swagger and sing/scream vocal attacks made its mark on all who got in their way.',25744298,385000,'We Came as Romans, Beartooth, Wage War, The Devil Wears Prada, Of Mice & Men'),('6LEeAFiJF8OuPx747e1wxR','Blood Orange','Blood Orange is the stage name of Devonté Hynes (born David Joseph Michael Hynes, 23 December 1985 in Ilford, East London), an English–American singer, songwriter, multi-instrumentalist, record producer, composer and director, currently based in New York City.\n\n\n\n Biography & Career\n\nEarly Years\n He began in the pre‑punk/dance‑punk band Test Icicles (2004–2006), then recorded two orchestral/folk‑pop albums as Lightspeed Champion (2007–2009).',92456811,1825456,'Solange, Kelela, Erika de Casier, Dijon, Nourished by Time'),('6LuN9FCkKOj5PcnpouEgny','Khalid','Khalid Donnel Robinson, better known as Khalid (born February 11, 1998) is an American singer, songwriter and record producer. He is signed to Right Hand Music Group and RCA Records. His debut single, \"Location\", was released in July 2016 and peaked at number 16 on the US Billboard Hot 100 chart and was later certified quadruple platinum by the Recording Industry Association of America (RIAA). His debut studio album, American Teen, was released on March 3, 2017.',90771298,2193108,'Bazzi, Josh Levi, Chlöe, Coco Jones, Amber Mark'),('6M2wZ9GZgrQXHCFfjv46we','Dua Lipa','Dua Lipa (born 22 August 1995) is an English, Albanian, and Kosovar singer, songwriter and actress. She began her career as a model before signing with Warner Bros. Records in 2014. Her self-titled debut studio album was released in 2017 and peaked at number three on the UK Albums Chart. The album included the singles \"Be the One\", \"IDGAF\", and the UK number-one single \"New Rules\". In 2018, she received Brit Awards for British Female Solo Artist and British Breakthrough Act.',301288369,3104441,'Ava Max, Silk City, Katy Perry, Zara Larsson, Tove Lo'),('6MwPCCR936cYfM1dLsGVnl','Motionless In White','Motionless in White is an American heavy metal band from Scranton, Pennsylvania, formed in 2004. The current lineup includes lead vocalist Chris Cerulli, guitarists Ryan Sitkowski and Ricky Olson, drummer Vinny Mauro, and bassist Justin Morrow. Cerulli is the only remaining member of the original formation. The band’s name was inspired by the Eighteen Visions song \"Motionless and White.\"\n\nThe band was initially signed to Fearless Records, under which they released their first three studio albums.',54420050,834639,'Ice Nine Kills, The Plot in You, Bad Omens, Dark Divine, Black Veil Brides'),('6nB0iY1cjSY1KyhYyuIIKH','FKA twigs','Tahliah Debrett Barnett (born 16 January 1988), known professionally as FKA twigs, is an English singer, songwriter, and dancer. Born and raised in Cheltenham, Gloucestershire, she became a backup dancer for numerous famous musicians after moving to London at the age of 17, and made her own musical debut with EP1 (2012) and EP2 (2013).\n\nBarnett\'s debut studio album, LP1 (2014), reached number 16 on the UK Albums Chart and number 30 on the US Billboard 200.',129210357,1561041,'Kelela, Arca, Eartheater, Oklou, Björk'),('6NRSfOnXw4qaypEfIV2QXn','Dutch Melrose','Dutch Melrose is a Singer- Songwriter & Producer from Los Angeles, CA.',9988439,404870,'Ari Abdul, PLVTINUM, Thomas LaRosa, Chase Atlantic, WesGhost'),('6O74knDqdv3XaWtkII7Xjp','Boyz II Men','Boyz II Men is an American R&B/soul singing group from Philadelphia, Pennsylvania. Founded in 1988 as a quintet, Boyz II Men found fame as a quartet, with members Wanya Morris, Michael McCary, Shawn Stockman, and Nathan Morris, on Motown Records during the early 1990s.\n\nBased on sales, Boyz II Men is one of the most successful R&B groups of all time, having recorded five #1 pop hits between 1992 and 1997. They have since topped sales of 25 million records.',13658397,1220960,'Brian McKnight, Dru Hill, Joe, Babyface, All-4-One'),('6qgnBH6iDM91ipVXv28OMu','KAYTRANADA','Kaytranada (stylized as KAYTRANADA, sometimes shortened as KAYTRA) is Haitian-Canadian music producer, rapper and singer Louis Kevin Celestin (born August 25, 1992). Celestin rose to prominence after releasing a series of mixtapes, remixes, and original music projects beginning in 2010 under the alias Kaytradamus. By 2013, and under the moniker Kaytranada, he began gaining wider recognition and, the following year, signed a deal with XL Recordings, with whom he released his debut studio album, 99.',69945661,1473576,'KAYTRAMINÉ, GoldLink, Channel Tres, NxWorries, The Internet'),('6qO6LhD6FuXK5e2PtfAIMz','We Came As Romans','We Came as Romans (often abbreviated as WCAR) is an American metalcore band from Troy, Michigan. Formed in 2005, the band has undergone one name change and multiple line-up changes. In 2016, they signed with SharpTone Records after being part of the Equal Vision Records roster since 2009.\n\nThe band has released seven studio albums:\nTo Plant a Seed (2009)\nUnderstanding What We\'ve Grown to Be (2011)\nTracing Back Roots (2013)\nWe Came as Romans (2015)',28285710,800763,'Fit For A King, Memphis May Fire, Blessthefall, Woe, Is Me, The Devil Wears Prada'),('6qqNVTkY8uBg9cP3Jd7DAH','Billie Eilish','Billie Eilish Pirate Baird O\'Connell (born December 18, 2001), known professionally as Billie Eilish, is a Grammy and Academy Award-winning American singer and songwriter signed to Darkroom/Interscope Records.\n\nBorn and raised in Los Angeles, Eilish grew up in a household of actors and musicians and was homeschooled along with her brother Finneas O\'Connell. At the age of eight, she joined the Los Angeles Children\'s Choir, developing the soulful vocals that would later appear on her early singles.',769619838,3993717,'FINNEAS, Olivia Rodrigo, Lana Del Rey, Melanie Martinez, Ariana Grande'),('6rs1KAoQnFalSqSU4LTh8g','back number','back number are a pop rock band from Ōta, Japan. http://backnumber.info/\n\nIn 2004, the band formed in the mind of Iyori Shimizu in Ōta, Gunma Prefecture. Though there were many member changes, it\'s been the same members from 2007 to now.\n\nOn February 18th 2009 the first mini album 『逃した魚』(nogashita sakana) was released.\nTOWER RECORDS recommended item 「タワレコメン」(towarecomen), HMV recommended item 「HOT PICKS」for the first time, and featured in many other shops acrosss the country.',5236037,112374,'Mrs. GREEN APPLE, Official髭男dism, あいみょん, Novelbright, Saucy dog'),('6rYogEVj60BCIsLukpAnwr','Scarlxrd','Marius Listhrop (born 19 June 1994), known professionally as Scarlxrd (pronounced \"scarlord\"), is a English musician. He is known for his unusual musical style combining elements of trap music with influences from metal music. Formerly a YouTube personality known as Mazzi Maz, Scarlxrd began a career in music as the lead vocalist for nu metal band Myth City, before debuting as a rapper under his Scarlxrd moniker.\n\nBy February 2017, Listhrop removed',17412988,323073,'PRXJEK, BvdLvd, Jasiah, Kamiyada+, nascar aloe'),('6RZUqkomCmb8zCRqc9eznB','Placebo','There are at least four artists with the name Placebo:\n\n1) Placebo is a British alternative rock duo formed in London in 1994 by vocalist-guitarist Brian Molko and bassist-guitarist Stefan Olsdal. Drummer Robert Schultzberg joined in late 1994 but left in 1996 shortly after the release of the band\'s eponymous debut album due to conflicts with Molko. He was replaced the same year by Steve Hewitt. Molko was born in Belgium, and Olsdal and Schultzberg were born in Sweden.',268730941,3372399,'Muse, Garbage, 30 Seconds to Mars, Pixies, Interpol'),('6s22t5Y3prQHyaHWUN1R1C','AJR','AJR is a New York City-based indie pop band composed of brothers Adam, Jack, and Ryan Met (born Metzger). The band is a DIY pop group who write, produce, and mix their own material in the living room of their Chelsea apartment. Their music style has been described as \"eclectic\", combining elements of pop, barbershop, electronic, and dubstep music. They have opened for Demi Lovato, Hoodie Allen and the Wanted. In Summer 2014 the band went on tour with Lindsey Stirling.',51481398,1174378,'The Astronomers, BoyWithUke, Em Beihold, American Authors, half•alive'),('6S2OmqARrzebs0tKUEyXyp','Demi Lovato','Demetria Devonne Lovato, professionally known as Demi Lovato, is an American singer, songwriter and actress. After appearing on the children\'s television series Barney & Friends (2002–2004), Lovato rose to prominence for playing Mitchie Torres in the musical television film Camp Rock (2008) and its sequel Camp Rock 2: The Final Jam (2010); the former film\'s soundtrack contained \"This Is Me\", Lovato\'s debut single and duet with Joe Jonas, which peaked at number nine on the Billboard Hot 100.',187367935,3200576,'Demi Lovato & Joe Jonas, Miley Cyrus, Zara Larsson, Fifth Harmony, Selena Gomez & the Scene'),('6sq1yF0OZEWA4xoXVKW1L9','Alejandro Fernández','Artista mexicano, hijo de Vicente Fernández. Excelente interprete de rancheras y musica melódica latina.\nComenzó interpretando temas con mariachi y música tradicional mexicana. Últimamente canta también música pop.\n\nAlejandro Fernández (born April 24, 1971) is a popular Latin Grammy-winning Mexican singer nicknamed as \"El Potrillo\" (\"The Little Colt\") by the media and his fans. ] Alejandro originally specialized in traditional, earthy forms of Mexican folk and country music, such as mariachi and ranchera.',5857859,330873,'Pepe Aguilar, Vicente Fernández, Cristian Castro, Franco De Vita, Sin Bandera'),('6tbLPxj1uQ6vsRQZI2YFCT','In This Moment','In This Moment is a metalcore band, formed in North Hollywood, Los Angeles, California, United States in 2005. Their first album, entitled Beautiful Tragedy, was released on March 20th, 2007 on Century Media Records. The band\'s sound falls on the melodic side of the metalcore spectrum, with vocalist Maria Brink utilizing both screams and a good deal of clean, emotive singing, the latter being even more prominent on the band\'s second album, The Dream, released in 2008.',27964604,623014,'Butcher Babies, New Years Day, Halestorm, Stitched Up Heart, Otep'),('6tPHARSq45lQ8BSALCfkFC','Lainey Wilson','Singer and songwriter Lainey Wilson blends tough-as-nails grit and tenderhearted sentiment in contemporary country tunes with more than a touch of traditionalism. Born in 1992, she was raised on the classics in the tiny town of Baskin, LA: “I knew that country music for me and my family was more than just a genre,” Wilson tells Apple Music. “It literally is what we lived.” She started writing songs before she hit her teen years and took a gig impersonating Hannah Montana in high school',3980073,201520,'Ella Langley, Carly Pearce, Cody Johnson, Bailey Zimmerman, Megan Moroney'),('6TZdvF1kFzwnQLgHQynzsO','Alien Ant Farm','Alien Ant Farm is a rock band that was formed in 1995 in Riverside, California, United States. Having a sound mixing alternative rock with elements of metal, punk music, and more, the band consists of Dryden Mitchell (vocals, guitar), Terry Corso (guitar), Tye Zamora (bass) and Mike Cosgrove (drums). Taking their name from the popular sci-fi trope of aliens having created humanity for their own amusement, the band became internationally famous in',21168909,1612881,'Taproot, Trapt, Adema, Hoobastank, Staind'),('6U1dV7aL68N7Gb0Naq34V5','REI AMI','REI AMI was born in Seoul, South Korea, and moved stateside to Maryland when she was 6 years old. While her family adhered to a fairly strict Christian belief “where any ‘worldly’ music was banned,” she reflects, her upbringing became high-octane fuel. \n\nHer middle school days brought exploration of the so-called world music, from Destiny’s Child and Mariah Carey to Britney Spears, as well as a ton of K-POP. Later, she would seek out the catalogs of Kendrick Lamar',3452250,216126,'Audrey Nuna, Ashnikko, KiNG MALA, UPSAHL, bludnymph'),('6ueGR6SWhUJfvEhqkvMsVs','Janelle Monáe','Janelle Monáe (born Janelle Monáe Robinson on December 1, 1985 in Kansas City, Kansas) is an American singer, songwriter, dancer, producer, actor and performer. She has received ten Grammy Award nominations, and is the recipient of a Screen Actors Guild Award and a Children\'s and Family Emmy Award. Monáe has also been honored with the ASCAP Vanguard Award; as well as the Rising Star Award (2015) and the Trailblazer of the Year Award (2018) from Billboard Women in Music.',49979056,1209515,'Solange, Chloe x Halle, Victoria Monét, Jessie Ware, Kelela'),('6UelqIK8qwhWFc2f6nSEh8','Niña Pastori','Niña Pastori is a Spanish flamenco singer (cantaora). She was born María Rosa García García in San Fernando (Cádiz) on 15 January 1978. The youngest of five siblings and only daughter of a military man (José) and gypsy flamenco singer La Pastori, she started her artistic career at a very young age. By the time she was six, she was accompanying her mother to  the flamenco tablaos of her neighborhood, \"el Boquete\". A year later she won a contest in San Fernando',1133574,136053,'Diego El Cigala, El Barrio, Ketama, Rosario, Estrella Morente'),('6UgERnTHmjk3qXM9x5vzyO','Nadhif Basalamah','Nadhif Basalamah (born May 30, 2000) is an Indonesian singer. He started his career by releasing the first non-album single, entitled \"After School Sad\" Session which was released on December 1, 2018.',653798,38778,'Batas Senja, Raim Laode, Mahalini, Anggi Marito, Bernadya'),('6VuMaDnrHyPL1p4EHjYLi7','Charlie Puth','Charles Otto Puth Jr. is an American singer, songwriter and record producer. His initial exposure came through the viral success of his song videos uploaded to YouTube.\n\nPuth initially signed with the record label eleveneleven after performing on The Ellen DeGeneres Show, while songwriting and producing for other artists. With primary intent on a solo career, Atlantic Records and Artist Partner Group eventually sought the artist and released his debut single, \"Marvin Gaye\" (featuring Meghan Trainor), in 2015.',126766008,2266503,'Lauv, Bazzi, V, Shawn Mendes, Maroon 5'),('6vXYoy8ouRVib302zxaxFF','Lorna Shore','Lorna Shore is an American symphonic deathcore/blackened deathcore band based in Warren County, New Jersey. The current formation includes lead vocalist Will Ramos, guitarists Adam De Micco and Andrew O\'Connor, bassist Michael Yager and drummer Austin Archey.\n\nThe band was formed in 2009, as De Micco was originally joined by Ray Meoni, Aaron Brown, Jeff Moskovciak, Gary Herrera and Scott Cooper. After just a few months, however, Tom Barber joined Lorna Shore as their new vocalist',18450480,277721,'Shadow of Intent, Signs of the Swarm, Immortal Disfigurement, Mental Cruelty, Synestia'),('6wWVKhxIU2cEi0K81v7HvP','Rammstein','Rammstein is a German Neue Deutsche Härte band formed in Berlin in 1994. The group’s lineup—consisting of Till Lindemann (lead vocals), Richard Kruspe (lead guitar), Paul Landers (rhythm guitar), Oliver Riedel (bass), Christoph Schneider (drums), and Christian \"Flake\" Lorenz (keyboards)—has remained unchanged throughout their career. Their songwriting process typically involves Lindemann composing and performing lyrics to instrumental arrangements written by the rest of the band.',310538024,3012068,'Lindemann, Till Lindemann, Emigrate, Eisbrecher, OOMPH!'),('6x2LnllRG5uGarZMsD4iO8','Thomas Rhett','Thomas Rhett Akins, Jr. (born in Valdosta, Georgia) is an American country music singer known professionally as Thomas Rhett. He is the son of singer-songwriter Rhett Akins.[1]\nHere is some background information on Thomas Rhett from the Something To Do With My Hands Songfacts. Thomas Rhett grew up in the music industry by means of his singer-songwriter father Rhett Akins. Whilst studying business and communications at Lipscomb University in Nashville, Rhett formed a cover band and began playing frat parties and other gigs they could get.',14507300,588853,'Jordan Davis, Dustin Lynch, Cole Swindell, Florida Georgia Line, Sam Hunt'),('6XpaIBNiVzIetEPCWDvAFP','Whitney Houston','Whitney Elizabeth Houston (August 9, 1963 – February 11, 2012) was an American singer and actress. Nicknamed \"the Voice,\" she is regarded as one of the greatest singers in the history of music. Houston is one of the best-selling music artists of all time, with over 220 million records sold worldwide. She influenced many singers in the recording industry and was known for her powerful, soulful vocals, vocal improvisation skills, use of gospel singing techniques in pop music, and live performances.',59537087,3100309,'Toni Braxton, Mariah Carey, Céline Dion, Janet Jackson, Jennifer Hudson'),('6XTGKOV9jceQ6f67lnhpbF','LATIN MAFIA','Emilio, Milton y Mike son las promesas de lo urbano que surgieron en TikTok destacándose siempre por el talento que los arropa. Lo que comenzó como un sueño durante la pandemia hoy ya es una realidad, y es que la disciplina, consistencia y talento que llevan en la sangre los ha llevado a convertirse en una de las revelaciones más aclamadas de la escena.\n Comenzaron componiendo desde su cuarto, y gracias a su habilidad nata en la música conectaron de forma rápida y sorprendente con el público',11924570,200561,'Humbe, MÉNE, AQUIHAYAQUIHAY, Little Jesus, CLUBZ'),('6y8XlgIV8BLlIg1tT1R10i','Old Dominion','A few years back, when Old Dominion got together to record “Make It Sweet,” a beatific number that would appear on their 2019 self-titled LP, it was a definite change in their process: whereas before they’d typically written every song prior to entering the studio, that time around they instead wrote the entire track on the spot, quickly laying it to tape. All in one day.\n\n“That was our first little taste of what that process could be like',5946692,280291,'Thomas Rhett, Jordan Davis, Jake Owen, Cole Swindell, Florida Georgia Line'),('6yHM0XQEdu9sIlbILMaKBp','Paul Cauthen','Paul Cauthen is an American singer-songwriter from Tyler, Texas, U.S.A.\nCauthen, born 1986, has been performing as a solo artist since 2016, playing guitar and piano as well as singing. His music has been described as Alternative country / Outlaw country as well as Americana.',1057939,89481,'Brent Cobb, Drayton Farley, Charley Crockett, Sturgill Simpson, Joshua Ray Walker'),('6zLBxLdl60ekBLpawtT63I','Cody Johnson','In a time of synthetics and plastics, folks appreciate the real thing. Musically, we look for songs that reach beyond our eardrums, touching our hearts. Cody Johnson\'s unique blend of country and rock does just that.\n\nMany Texan music fans met Cody Johnson’s honest style through the radio singles from his \"Six Strings, One Dream\" album: \"Nobody to Blame\" (#6 on the Texas music charts in 2009);  #1\"Pray for Rain\" (2009 - 2010); and \"Texas Kind of Way\" (#6, late 2010 – 2011).',7944539,240868,'Riley Green, Parker McCollum, Luke Combs, Bailey Zimmerman, Justin Moore'),('6ZLTlhejhndI4Rh53vYhrY','Ozzy Osbourne','Ozzy Osbourne (born John Michael Osbourne in Marston Green, Warwickshire, on 3 December 1948; died 22 July 2025) was an English singer, songwriter, and media personality remembered as the lead vocalist of the heavy metal band Black Sabbath, during which period he adopted the nickname \"Prince of Darkness\". On 5 July 2025, Osbourne performed his final show at the \"Back to the Beginning\" concert event. \n\nHe was inducted into the Rock and Roll Hall of Fame as a member of Black Sabbath in 2006 and as a solo artist in 2024.',90907301,3009117,'Black Sabbath, Dio, Judas Priest, Iron Maiden, Motörhead'),('6ZV6lGY0prbqpTD0Md8i29','Scotty McCreery','Scotty McCreery (born October 9, 1993) is an American country music singer. He won the tenth season of American Idol on May 25, 2011. His debut studio album, Clear as Day, was released in October 2011 and was certified platinum in the United States. The album includes the Top 20 country songs, \"I Love You This Big\" and \"The Trouble with Girls\". McCreery released a Christmas album, Christmas with Scotty McCreery, in October 2012 and it has been certified gold.',2910322,213266,'Jordan Davis, Dustin Lynch, Cole Swindell, Justin Moore, Dylan Scott'),('70BYFdaZbEKbeauJ670ysI','Shinedown','Shinedown is a Hard Rock band from Jacksonville, Florida. Shinedown was formed in early 2002 by Brent Smith, Jasin Todd, Brad Stewart, and Barry Kerch. They have released seven albums on Atlantic Records: \"Leave a Whisper\" (2003),\"Us and Them\" (2005), \"The Sound of Madness\" (2008), \"Amaryllis\" (2012), \"Threat to Survival\" (2015) , \"Attention Attention\" (2018) and \n\"Planet Zero\" (2022). As of 2018, the band has had 23 Top 5 hits on Mainstream Rock radio, including 12 number one singles, and a Top 10 hit on the Hot 100 with \"Second Chance\".',62762712,1727918,'Pop Evil, Theory of a Deadman, Seether, Saint Asonia, Hinder'),('70kkdajctXSbqSMJbQO424','Kacey Musgraves','Kacey Musgraves (born August 21, 1988) is an American country artist from Golden, Texas. Kacey began singing publicly at 8-years-old and wrote her first song at 9-years-old. With a self-released album under her belt, she moved to Austin in 2008, where she was discovered by independent record label Triple Pop, for whom she recorded two songs, Apologize and See You Again.\n\nIn 2012, she signed with Mercury Records and released her solo debut single Merry Go \'Round.',64309775,1097396,'Maren Morris, Kelsea Ballerini, Miranda Lambert, The Chicks, Carrie Underwood'),('718COspgdWOnwOFpJHRZHS','Luke Combs','Luke Combs is a country music singer and songwriter. His two albums for Columbia Nashville have combined to produce 14 singles, each one hitting #1 on Billboard\'s Country Airplay chart: \"Hurricane\", \"When It Rains It Pours\", \"One Number Away\", \"She Got the Best of Me\", \"Beautiful Crazy\", \"Beer Never Broke My Heart\", \"Even Though I\'m Leaving\", \"Does to Me\", \"Lovin\' on You\", \"Better Together\", \"Forever After All\", \"Cold As You\", \"Doin\' This\", and \"The Kind Of Love We Make\".',37560208,742099,'Morgan Wallen, Bailey Zimmerman, Jordan Davis, Cody Johnson, Riley Green'),('73sIBHcqh3Z3NyqHKZ7FOL','Childish Gambino','Donald McKinley Glover, Jr (born September 25, 1983) is an American actor, comedian and musician. As a recording artist, he usually performs with the stage name Childish Gambino. While a disk jockey, he performs as mcDJ. He first came to attention for his work with Derrick Comedy and with the help of Tina Fey, was hired at the age of 21 to become a writer for the NBC comedy series 30 Rock. He later played college student Troy Barnes on the NBC sitcom Community.',301745022,3595683,'Tyler, The Creator, Chance the Rapper, Kid Cudi, Vince Staples, Mac Miller'),('75JvBeqW4BJ4xgnbMAq6MN','Anne Wilson','One of Nashville\'s most inspiring young trailblazers, Anne Wilson is a revolution in modern music. The Lexington, Kentucky native, known for her transcendent vocal and down-to-earth storytelling, recently released her new single, \"God Story.\" Her last album, REBEL, featured her hopeful, healing debut country single \"Rain In The Rearview\" as well as her chart-topping Christian radio ballad \"Strong.\" The genre-bending album followed her GRAMMY-nominated 2022 debut \"My Jesus',570902,42261,'Ben Fuller, Katy Nichole, Zach Williams, Leanna Crawford, Brandon Lake'),('77kULmXAQ6vWer7IIHdGzI','Jordan Davis','Jordan Carl Wheeler Davis (born March 30, 1988) is an American country music singer and songwriter signed to Universal Music Group Nashville\'s MCA Nashville division.\n\nDavis was born in Shreveport, Louisiana, to mother Luwanna. He has a brother, Jacob Davis (who is also a country singer), and a sister, Jentry. His uncle, Stan Paul Davis, wrote Tracy Lawrence\'s hit singles \"Today\'s Lonely Fool\" and \"Better Man, Better Off\".\n\nHe began playing guitar when he was twelve years old.',6887719,267471,'Thomas Rhett, Dylan Scott, Dustin Lynch, Tyler Hubbard, Russell Dickerson'),('78YqeIji3mgAS2K1Maca6x','Dylan Scott','Curb Records recording artist Dylan Scott is a triple threat — a powerful vocalist with a deep, unmistakable drawl; an old-soul songwriter with a young spirit; and a family man with a tender heart.\n\nThe multi-Platinum singer has notched two #1 singles at radio (“My Girl” and “Nobody”), as well as Top 5 hit “Hooked.” Following his first career nomination for “Best New Country Artist” at the all-genre iHeartRadio Music Awards and a coveted spot among Country Radio Seminar’s New Faces of Country Music',2716676,171158,'Jordan Davis, Tyler Hubbard, Cole Swindell, Bailey Zimmerman, Thomas Rhett'),('7bXgB6jMjp9ATFy66eO08Z','Chris Brown','Christopher Maurice Brown (born May 5, 1989) is an American singer, songwriter, rapper, dancer, and actor. His music incorporates elements of R&B, pop, and hip-hop, and he is known for his vocal and dance performances. Brown has often been described by commentators and peers as one of the leading contemporary R&B artists, with comparisons frequently drawn between his performance style and that of Michael Jackson.\n\nIn 2004, Brown signed with Jive Records and released his self-titled debut studio album the following year.',147516074,4606712,'Chris Brown & Tyga, Trey Songz, August Alsina, Omarion, Usher'),('7c0XG5cIJTrrAgEC3ULPiq','Ty Dolla $ign','Tyrone Griffin (born April 13, 1982), better known by his stage name Ty Dolla Sign (stylized as Ty Dolla $ign or Ty$), is an American singer, rapper and producer from Los Angeles, California. He is currently signed to Wiz Khalifa\'s Taylor Gang Records and Atlantic Records.\n\nThe son of a musician from Lakeside, Ty Dolla $ign originally began his career in music by learning the bass guitar. Since then, he has learned several instruments, from the drums, guitars, and keyboard to the MPC.',26157941,1530696,'Kanye West, ¥$, Kanye West & Ty Dolla $ign, Donda, Offset, ¥$'),('7cNNNhdJDrt3vgQjwSavNf','Memphis May Fire','Memphis May Fire is a metalcore band with southern rock influences (previously post-hardcore) currently based in Dallas, Texas. The band formed in December 2006, but it was not until February 2007 that the group decided on the name Memphis May Fire having previously gone by \"O Captain, My Captain!\". Since its formation, the band has released two EPs and six full-length albums, the latest being Shapeshifter which was released in March 2025.\n\nIn early 2007, the band recorded and self-released an EP, and began creating a local following.',20928821,519875,'Wage War, We Came as Romans, Fit For A King, Of Mice & Men, Until i Wake'),('7cYEt1pqMgXJdq00hAwVpT','Chase Atlantic','Chase Atlantic (occasionally stylized as CHASE ATLANTIC) are an Australian R&B band and production trio from Cairns, Queensland, formed in 2014. The group consists of three members: Christian Anthony, Clinton Cave and Mitchel Cave. Chase Atlantic has released seven EP\'s and four albums.\n\nAccording to the band, their style is \"conjured up dark alternative pop punctuated by rock and R&B.\" Throughout their four years of making music, their music style has changed from an alternative pop sound to a more alternative R&B sound.',179393614,1721195,'Riley, Dutch Melrose, The Neighbourhood, Aaryan Shah, Niki'),('7dOBabd5O4CvKrg4iriHTM','Kid Rock','Kid Rock (born Robert James Ritchie on January 17, 1971 in Romeo, MI),  is an American singer-songwriter and rapper from Detroit with five Grammy Award nominations. Kid Rock is known for music that incorporates elements of hip-hop, rap metal, blues-rock, hard rock, southern rock, funk and country.\n\nKid Rock released several studio albums from 1988 that mostly went unnoticed before his 1998 record \'Devil Without a Cause\', released with Atlantic Records, sold 11 million albums behind the hits, \"Bawitdaba\",\"Cowboy,\" and \"Only God Knows Why\".',15242724,1159661,'Uncle Kracker, Buckcherry, Nickelback, Theory of a Deadman, Bad Company'),('7dzq55YG3wjViqexDwiycQ','Ivete Sangalo','Ivete Maria Dias de Sangalo (born May 27, 1972 in Juazeiro, Bahia) is a Latin Grammy Award-winning Brazilian singer, songwriter, television show host and occasional actress. She is currently one of the most popular and best-selling Brazilian female singers, with six albums released with Banda Eva, and eight studio albums in her solo career, with a total of over 12 million albums sold worldwide. Sangalo is most often recognized by her powerful voice, charisma and live performances.',15172232,459914,'Banda Eva, Claudia Leitte, Daniela Mercury, Babado Novo, Margareth Menezes'),('7eLcDZDYHXZCebtQmVFL25','Aitana','Aitana Ocaña Morales, better known as simply Aitana, is a Spanish singer and songwriter. She first gained national recognition in 2017, placing as the runner-up in series nine of the Spanish reality television talent competition Operación Triunfo, behind Amaia Romero. While competing in Operación Triunfo, Aitana released the single \"Lo malo\" with fellow competitor Ana Guerra. The song went on to become a number-one hit in Spain and was certified five times platinum',12705277,216645,'Belén Aguilera, Ana Mena, Lola Indigo, Miriam Rodríguez, Amaia'),('7EQ0qTo7fWT7DPxmxtSYEc','Bastille','Bastille are an indie rock band from South London, England that formed in 2010. Bastille started out as a solo project by singer-songwriter Dan Smith, who later decided to form a band. The quartet consists of Dan Smith, Chris \'Woody\' Wood, Will Farquarson and Kyle Simmons. The name of the band comes from Bastille Day, which was the day when Smith was born. Bastille released their album \'Give Me the Future\' on 4 February 2022, to international critical acclaim.',88268143,2308505,'To Kill a King, Imagine Dragons, X Ambassadors, BANNERS, American Authors'),('7FNnA9vBm6EKceENgCGRMb','Anitta','Larissa de Macedo Machado, known professionally as Anitta, is a Brazilian singer, songwriter, dancer, businesswoman, and TV presenter. She rose to national fame with the release of her single \"Show das Poderosas\" in 2013.\n\nAfter achieving commercial success with her debut single \"Meiga e Abusada\" in 2012, she signed a recording contract with Warner Music Brazil in January 2013. In July of the same year, she released her self-titled debut album which produced four successful singles and was certified platinum in Brazil.',142278155,1133597,'PEDRO SAMPAIO, Luísa Sonza, Lexa, Pabllo Vittar, POCAH'),('7fObcBw9VM3x7ntWKCYl0z','Colby O\'Donis','Colby O\'Donis was born in Queens, New York on March 14, 1989 to Puerto Rican parents. O\'Donis\'s talent was discovered at age 3 when he won first place at a talent show by singing a Michael Jackson song. He would also perform at his father\'s flea market in Queens every weekend, just for fun.\n\nColby\'s rise to fame began at 10 when he became the youngest recording artist ever signed to Motown Records to do a song for a major motion picture soundtrack.',1810961,275204,'Paula DeAnda, Jay Sean, Akon, Ray J, Iyaz'),('7g9K2QjuqVLUniCCCHyF7j','Canelita','Canelita (born Jonathan Vera in 1990) is a Spanish flamenco singer. He hails from the barrio of Bajadilla, in Algeciras, southeastern Spain. He was discovered by another native of Algeciras, Paco de Lucia, when he was a boy and began recording as a teenager, with early releases such as Vivo Errante (2004) and Canelita por mi calle (2005). His album, Vuelvo, released in November 2010, alternates traditional flamenco singing ballads and pop tunes, seeking to reach a mass audience.',230388,20736,'EL PELOS, Potito, Parrita, La Húngara, Junco'),('7Gi6gjaWy3DxyilpF1a8Is','Junior H','Antonio Herrera Pérez, whose stage name is Junior H, is a Mexican singer-songwriter in the corridos tumbados and sierreño movements.\n\nBorn on April 23, 2000, in the town of Cerano, Guanajuato, Mexico, he and one of his friends would write lyrics growing up since they did not know how to play instruments yet. At the age of 15, he and his family moved to the state of Utah, United States. While in high school, at 17 years old, he worked at a local sandwhich shop and learned to play instruments, mainly the guitar.',43899717,344982,'Natanael Cano, Fuerza Regida, Peso Pluma, Eslabon Armado, Gabito Ballesteros'),('7gP3bB2nilZXLfPHJhMdvc','Foster The People','Foster the People is an alternative rock band that formed in Los Angeles, California, United States in 2009. The band consists of Mark Foster (vocals, guitar, keyboards), Cubbie Fink (bass, vocals) and Mark Pontius (drums). The band released their debut self-titled EP in January 2011. The band\'s debut full length album, Torches, was released on May 24, 2011 on Star Time/Columbia. Their first single \"Pumped Up Kicks\" was a sleeper hit during the summer of 2011 and peaked at #1 on the Billboard Alternative Songs Chart',115093255,3605193,'Two Door Cinema Club, Capital Cities, Grouplove, Young the Giant, Phoenix'),('7Gy1PxqrgsiqWF6JNYPHeB','.Feast','Indonesian music group .Feast was formed in Jakarta at some point in 2012, revolving around the talents and audacity of Baskara Putra (also known as singer/songwriter Hindia), Ryo Bodat, Dicky Renanda, Adnan S.P. and F. Fikriawan when they were still students in Universitas Indonesia. \n\nThe group has been catching regional media attention since their first single \'Camkan\', and now heralded as one of the biggest next-generation band in Indonesia after the release of their genre-defying debut album \'MULTIVERSES\' in September 2017.',2007189,35254,'Hindia, Lomba Sihir, Barasuara, Sal Priadi, Perunggu'),('7HkdQ0gt53LP4zmHsL0nap','Ella Mai','Ella Mai Howell (born 3 November 1994) is an English singer-songwriter. Her musical career began at London\'s British and Irish Modern Music Institute in 2014, during which time she auditioned as part of a trio on the 11th season of The X Factor. In 2015, she uploaded a four-track solo EP of originals to SoundCloud titled Troubled, and was discovered on social media by American record producer Mustard and signed with his record label, 10 Summers Records.',15939769,732638,'Kiana Ledé, H.E.R., Queen Naija, Kehlani, Muni Long'),('7HO5fOXE4gh3lzZn64tX2E','Mariah the Scientist','Mariah Buckles, known professionally as Mariah the Scientist, is an American singer-songwriter. \n\nBorn in Atlanta, Georgia, she graduated high school a year early and attended college in New York City, but later dropped out to pursue music. \n\nMariah discovered singing when she joined her elementary school chorus. She began writing songs while attending St. John\'s University in New York on a biology scholarship, an interest to concentrate on her music career. She released her debut EP, the six-track To Die For, on SoundCloud in January 2018.',17367615,476879,'Summer Walker, Jhené Aiko, Summer Walker & PARTYNEXTDOOR, Kehlani, Tink'),('7HTLVyjNf0VRxfIgNcfRRH','Chase Matthew','Chase Matthew\'s muscled-up country is as influenced by the genre\'s roots as it is by modern hip-hop. Born in 1997 and raised around Nashville, Matthew grew up in a musical family and was profoundly impacted by the songs he heard in church. Eventually, his passion for music led to him developing his low, hearty boom of a voice, and in the early 2020s, he rapidly became a social media star. Matthew\'s love of hip-hop was clear straight from his rhythmic lyrical deliveries on early tracks like \"Nashville Crazy',1315129,70106,'Redferrin, Dylan Scott, Warren Zeiders, Bailey Zimmerman, Sean Stemaly'),('7jdFEYD2LTYjfwxOdlVjmc','KALEO','Kaleo is an Icelandic blues rock band established in 2012 and their first major public appearance Iceland Airwaves Music Festival in November 2012. Their fame came through \"Vor í vaglaskógi\" as it was included on heavy rotation on Icelandic state broadcaster RÚV\'s radio station Rás 2 featuring on top of the stations Top 10.\n\nThe band consists of lead vocalist and guitarist Jökull Júlíusson, drummer David Antonsson, bassist Daniel Kristjansson, lead guitarist Rubin Pollock and harmonicist Þorleifur Gaukur Davíðsson.',19814971,1152279,'Welshly Arms, Royal Deluxe, The Blue Stones, Black Pistol Fire, Oh The Larceny'),('7jxJ25p0pPjk0MStloN6o6','Blind Guardian','Blind Guardian is a German power metal band formed in 1984 in Krefeld, West Germany. They are often credited as one of the seminal and most influential bands in the power metal and speed metal subgenres. Nine musicians have been a part of the band\'s lineup in its history, which currently consists of singer Hansi Kürsch, guitarists André Olbrich and Marcus Siepen, and, since 2005, drummer Frederik Ehmke.\n\nBlind Guardian is a part of the German heavy metal scene that emerged in the mid-1980s.',76286219,848770,'Demons & Wizards, Gamma Ray, Helloween, Blind Guardian Twilight Orchestra, HammerFall'),('7k29FbDq69ju2fe6zTskxY','Orbit Culture','Orbit Culture is a melodic death metal/groove metal band from Eksjö, Sweden. The idea of the band grew strong within singer & rhythm guitarist Niklas and lead guitarist Maximilian after messing around with some unpolished demos at home. At that time, Maximilian was currently playing with another local band called Abstract Noise, together with Orbit Culture’s fellow drummer Markus Bladh. Maximilian recruited Markus to join his new band, followed by the arrival of Christoffer Olsson on bass guitar.',6098999,121910,'Eye of the Enemy, The Halo Effect, Bloodred Hourglass, Wolfheart, Parasite Inc.'),('7k5jeohQCF20a8foBD9ize','Battle Beast','There are two bands named Battle Beast.\n\n1) Battle Beast is a Finnish heavy metal / power metal band established in Helsinki in 2005. The initial line-up consisted of guitarists, Juuso Soinio and Anton Kabanen, and drummer Pyry Vikki, who were high school friends. The rest of the original lineup, bassist Eero Sipilä, keytarist Janne Björkroth, and lead singer Nitte Valo, joined the band after auditions. Before gaining a record contract, Battle Beast',8373191,165754,'Beast in Black, Dynazty, Amaranthe, Metalite, Bloodbound'),('7k73EtZwoPs516ZxE72KsO','ONE OK ROCK','ONE OK ROCK (ワンオクロック, \"ok\" pronounced as a word) is a Japanese alternative rock/pop punk band from Tokyo formed in 2005. They play varied styles of music, with songs ranging from alternative rock and emo to post-hardcore and pop punk.\n\nMembers:\n* Vocals: Taka (森内 寛貴, Moriuchi Takahiro, born April 17, 1988 in Tokyo)\n* Guitar, backing vocals: Toru (山下 亨, Yamashita Tōru, born December 7, 1988 in Osaka)\n* Bass: Ryota (小浜 良太, Kohama Ryōta, born September 4, 1989 in Osaka)',51063597,589419,'MY FIRST STORY, coldrain, SPYAIR, Survive Said The Prophet, MAN WITH A MISSION'),('7kplJl06UmldxLKseURAYi','Warren Zeiders','Warren Zeiders was still a collegiate star athlete when he released \"Ride the Lightning,\" a platinum-certified debut single whose mix of country storytelling, heartland twang, and larger-than-life rock n\' roll launched his career. He continues the momentum with 2023\'s Pretty Little Poison. Released on the heels of his 717 Tapes compilation, Pretty Little Poison positions Zeiders as Nashville\'s newest headliner at just 24 years old. He created the',3493345,164033,'Bailey Zimmerman, Bryan Martin, Chase Matthew, Corey Kent, Tucker Wetmore'),('7KVJCU4z5L4EUHILL8aMxR','Léo Santana','Leandro Silva de Santana Improta (Salvador, 22 de abril de 1988)mais conhecido pelo seu nome artístico Leo Santana, é um cantor, compositor e percussionista brasileiro. \n\nNascido e criado no bairro da Boa Vista do Lobato, periferia da capital baiana, desde a adolescência sempre sonhou em trabalhar como músico, tanto que quando a família se reunia na casa dos avós na cidade de São Domingos, interior da Bahia, tinha o costume de dançar e cantar com os amigos.',1297297,131327,'PEDRO SAMPAIO, Matheus Fernandes, Filhos de Jorge, Lexa, Zé Felipe'),('7lbSsjYACZHn1MSDXPxNF2','Hikaru Utada','Utada Hikaru (Japanese: 宇多田ヒカル), born January 19, 1983, in New York City, United States, also known by her fan-nickname \"ヒッキー\" (Hikki), is a third culture singer, composer, arranger, and record producer in Japan and the United States. Hikaru\'s music is primarily pop and R&B and sometimes incorporates other musical elements such as rock and electronica among others.\n\nHikaru Utada was born to Japanese parents who both had roots in the Japanese music industry; her father',31250112,319526,'Utada, 浜崎あゆみ, 安室奈美恵, 倖田來未, 中島美嘉'),('7LnaAXbDVIL75IVPnndf7w','Jamie Foxx','Eric Morlon Bishop, Jr. (born December 13, 1967 in Terrell, Texas), better known by his stage name Jamie Foxx, is an Academy Award winning actor, Grammy Award winning multi-platinum selling R&B singer, and critically acclaimed comedian. As a singer he has three multi-platinum releases; 1994’s Peep This, 2005’s Unpredictable and 2008’s Intuition. His fourth studio album, Best Night of My Life, will be released December 21. Foxx received a star on the Hollywood Walk of Fame on September 14, 2007.',10867406,1197112,'Trey Songz, Avant, 112, Joe, Donell Jones'),('7LVC96BEVGugTAp38AajV6','Lithe','Josiah Ramel, professionally known as Lithe, is an Australian rapper, singer-songwriter, and record producer. Lithe gained mainstream attention from his 2024 single, \"Fall Back\", which received two remixes—one featuring Canadian rapper Nav and another featuring American rapper Lil Tjay.',8094603,406859,'arya x, Eli Sostre, Sani Knight, M Huncho, Dyce'),('7lzordPuZEXxwt9aoVZYmG','Billy Idol','William Michael Albert Broad, known professionally as Billy Idol, is a British singer, songwriter, musician and actor. He also holds United States citizenship. He first achieved fame in the 1970s emerging from the London punk rock scene as the lead singer of the group Generation X. Subsequently, he embarked on a solo career which led to international recognition and made Idol a lead artist during the MTV-driven \"Second British Invasion\" in the US. The name \"Billy Idol\" was inspired by a schoolteacher\'s description of him as \"idle\".',52187753,2863162,'Generation X, Duran Duran, The Cars, INXS, The Police'),('7mnBLXK823vNxN3UWB7Gfz','The Black Keys','The Black Keys are an alternative rock  group from Akron, Ohio, United States which formed in 2001, consisting of singer and guitarist Dan Auerbach and drummer Patrick Carney. The band name was inspired by a schizophrenic artist and friend in Akron, who used the term \"black keys\" to describe things he disliked or people he did not trust. The Black Keys have roots in traditional blues and psychedelic rock stylings.\n\nThey released their first album, The Big Come Up, in 2002, followed by Thickfreakness in 2003, and Rubber Factory in 2004.',193059709,3239172,'Dan Auerbach, The Arcs, Black Pistol Fire, The Raconteurs, The Blue Stones'),('7mPcfx7PhnBh6n4HMCd61A','John Michael Montgomery','John Michael Montgomery (born January 20, 1965, in Danville, Kentucky is an American country music artist. He has produced more than thirty singles on the Billboard country charts, including two of Billboard’s Number One country singles of the year: \"I Swear\" (1994) and \"Sold (The Grundy County Auction Incident)\" (1995). \n\nBesides these two songs, five more of Montgomery\'s singles have reached the top of the country charts: \"I Love the Way You Love Me\"',3347216,384361,'Tracy Byrd, Tracy Lawrence, Travis Tritt, Diamond Rio, Brooks & Dunn'),('7n2wHs1TKAczGzO7Dd2rGr','Shawn Mendes','Shawn Peter Raul Mendes is a Canadian singer. He gained a following in 2013, posting song covers on the video-sharing application Vine. The following year, he caught the attention of artist manager Andrew Gertler and Island Records A&R Ziggy Chareton, which led to him signing a deal with the record label. Mendes\'s self-titled debut EP was released in 2014, followed by his debut studio album Handwritten in 2015. Handwritten debuted atop the US Billboard 200, making Mendes one of five artists ever to debut at number one before the age of 18.',132563678,2558102,'Shawn Mendes, Camila Cabello, Niall Horan, Joshua Bassett, Shawn Mendes & Camila Cabello, Ruel'),('7n2Ycct7Beij7Dj7meI4X0','TWICE','There are multiple artists under this name:\n\n1. TWICE (Hangul: 트와이스; Katakana: トゥワイス)  is a nine-member South Korean girl group formed by JYP Entertainment through the 2015 reality show SIXTEEN. The group is composed of: NAYEON (나연), JEONGYEON (정연), MOMO (모모), SANA (사나), JIHYO (지효), MINA (미나), DAHYUN (다현), CHAEYOUNG (채영) and TZUYU (쯔위).\n\nGroup Name Meaning: The group will touch people’s hearts twice, once through the ears, and once again through the eyes.',457179254,1750001,'JIHYO, NAYEON, TZUYU, CHAEYOUNG, NMIXX'),('7nwUJBm0HE4ZxD3f5cy5ok','Aretha Franklin','Aretha Franklin (March 25, 1942 - August 16, 2018) was a Memphis, Tennessee born and Detroit, Michigan reared American iconic gospel, soul, and R&B singer, songwriter and pianist. Many have called her \"The Queen Of Soul\" and \"Lady Soul\".\n\nShe is renowned for her soul and R&B recordings (on many, of which, she accompanied herself on keyboards and piano, a skill she learned at an early age, learning to play by ear, according to lifetime friend Smokey Robinson) but was also adept at jazz, rock, blues, pop, and gospel.',50774531,2832805,'Etta James, Otis Redding, Wilson Pickett, Al Green, Nina Simone'),('7qAoXV4U0qDxQAUqhszjAA','Manuel Carrasco','Manuel Carrasco (born January 15, 1981) is a Spanish singer who was born in Isla Cristina, Province of Huelva (Andalucía), Spain. He was one of the three finalists of the second edition of TV program Operación Triunfo and his debut album called \"Quiéreme\" sold more than 200,000 records.',1195013,81431,'Antonio Orozco, India Martinez, Vanesa Martín, Marta Santos, Antonio José'),('7qG3b048QCHVRO5Pv1T5lw','Enrique Iglesias','Enrique Miguel Iglesias Preysler (born 8 May 1975) is a Spanish singer and songwriter. He started his recording career in the mid-1990s on the Mexican label Fonovisa and became the bestselling Spanish-language act of the decade. By the turn of the millennium, he made a successful crossover into the mainstream English-language market. He signed a multi-album deal with Universal Music Group for US$68 million with Universal Music Latino to release his Spanish albums and Interscope Records to release English albums.',51721752,2596579,'Ricky Martin, Luis Fonsi, Chayanne, Alejandro Sanz, Alvaro Soler'),('7rqJQQxuUOCk052MK5kLsH','Imminence','Imminence is a Swedish metalcore band formed in Trelleborg, Sweden, in 2009. The group consists of vocalist Eddie Berg, lead guitarist Harald Barrett, rhythm guitarist Alex Arnoldsson, bassist Christian Höijer and drummer Peter Hanström. They are currently signed to Arising Empire and have released five studio albums. Their most recent studio album, The Black, was released on 12 May 2024.\n\nThe band was started in 2009 by Harald Barrett, with singer Eddie Berg joining shortly after.',10126990,189151,'Currents, Aviana, Annisokay, Architects, Silent Planet'),('7slfeZO9LsJbWgpkIoXBUJ','Ricky Martin','Ricky Martin (born in San Juan, Puerto Rico on December 24, 1971 as Enrique Martin Morales), is a successful Puerto Rican pop singer who rose to fame, first as a member of the Latin boy band Menudo, then as a solo artist since 1990. He has sold over 95 million albums since the start of his career. He is widely regarded as the King of Latin Pop, and is considered to have opened the doors for some of his fellow Latin American singers like Jennifer Lopez and Shakira.',17879787,1560020,'Chayanne, Alejandro Sanz, Enrique Iglesias, Cristian Castro, Franco De Vita'),('7thnnayFyJnVOAJrpe5wMC','Mikel Erentxun','Mikel Erentxun was the lead singer of the Spanish pop-rock group Duncan Dhu.  He released his first solo album, Naufragios, in 1992, maintaining a career separate from the group and releasing albums more frequently following the group\'s end in 2001.',1392729,134842,'Duncan Dhu, La Unión, Enrique Bunbury, Caifanes, Hombres G'),('7tjVFCxJdwT4NdrTmjyjQ6','Muni Long','Priscilla Renea Hamilton (born September 14, 1988), known professionally as Muni Long (pronounced \"money long\"), is an American singer and songwriter from Gifford, Florida. Under her birth name, she released her solo debut studio album, Jukebox, in December 2009 through Capitol Records.\n\nAfter spending the following decade co-writing songs for other notable artists, Renea returned to her recording career in 2018 with her independently released second studio album, Coloured in June of that year.',7903291,531108,'Coco Jones, Ella Mai, Chlöe, Kiana Ledé, FLO'),('7tYKF4w9nC0nq9CsPZTHyP','SZA','Solána Imani Rowe, known professionally as SZA, is an American singer and songwriter. She was born in St. Louis, Missouri but raised in Maplewood, New Jersey. She self-released her debut EP, See.SZA.Run in October 2012. \n\nIn April 2013, SZA released her S EP to good critical reviews— in July of that same year, it was announced she was signed to Top Dawg Entertainment and began working on her Z EP, which would eventually become a full-fledged album. Z was released in April 2014.',547655631,3319743,'Summer Walker, Kali Uchis, Doja Cat, Doechii, Ariana Grande'),('7vCtweS8UVAXTyau2j0rDT','Josh Turner','Josh Turner (born Joshua Otis Turner, November 20, 1977 in Hannah, South Carolina) is an American country music singer-songwriter.\n\nJosh Turner is a  country artist who describes his music as South Carolina Lowcountry. His voice and musical style has often been compared to that of Johnny Cash\'s.  Hailing from the Hannah, South Carolina, Josh moved to Nashville in 1996 to study music at Belmont University. It was there that he met his current wife, Jennifer Ford, whom he married in 2003.',8349470,729885,'Chris Young, Billy Currington, Rodney Atkins, Joe Nichols, Tim McGraw'),('7vXDAI8JwjW531ouMGbfcp','TINI','There are at least two artists named Tini:\n\n1) Martina  Stoessel, known professionally as TINI (stylized in all caps) is an Argentine singer, songwriter and actress. She began her career by appearing on the Argentine children\'s television series Patito Feo (2007–2008). She rose to prominence for her lead role as Violetta Castillo in the Disney Channel Latin America original telenovela, Violetta (2012–2015), and afterwards portrayed the same character in the series\' sequel film Tini: The Movie (2016).',18301658,374490,'Emilia, Maria Becerra, Martina Stoessel, Lali, Danna Paola'),('7x8nK0m0cP2ksQf0mjWdPS','Dierks Bentley','Dierks Bentley is an American country music singer and songwriter. Bentley\'s studio albums have accounted for 25 singles on the Hot Country Songs and Country Airplay charts, of which 17 have reached #1: his debut single \"What Was I Thinkin\'\", \"Come a Little Closer\", \"Settle for a Slowdown\", \"Every Mile a Memory\", \"Free and Easy (Down the Road I Go)\", \"Feel That Fire\", \"Sideways\", \"Am I the Only One\", \"Home\", \"5-1-5-0\", \"I Hold On\", \"Drunk on a Plane\", \"Say You Do\", \"Somewhere on a Beach\", \"Different for Girls\", \"Woman, Amen\" and \"Living\".',12753984,885599,'Jake Owen, Luke Bryan, Jason Aldean, Kenny Chesney, Billy Currington'),('7yntSJ6uojO3z6GFUVwhAW','CORPSE','There are at least six bands and one artist with the name Corpse:\n\n1) Corpse Husband (born August 8, 1997), or simply Corpse, is an American YouTuber from San Diego, California who is part of a community of YouTubers known as Horror Narration Channels. He is well known for having a very deep or low-pitched bass voice.\n\nHe made his musical debut in 2016, being featured on the single \"Grim Grinning Ghost\" by The Living Tombstone and Crusher P.\n\nIn June 2020',30360681,704844,'Anguish, GOTOU寄生獣, CORPSE, Bring Me The Horizon, Corpse, Savage Ga$p, Kamaara');
